INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<img src="sites/default/files/global-opportunities-local-focus.jpg" width=100% height=100%/>', 'Homepage Banner', 'full_html'),
(2, '<p>Keiretsu Forum Mid-Atlantic offers you access to a wealth of international angel funding opportunities, vetted by business experts with local first hand knowledge of every investment.</p>\r\n\r\n<p><a href="contact-us" target="_self" title="EXTEND YOUR INVESTMENT REACH">EXTEND YOUR INVESTMENT REACH</a></p>\r\n', 'About Keiretsu Forum Mid-Atlantic', 'full_html'),
(3, '<p><strong>FREE REPORT:</strong> Three Things You Must Know About Angel Investment Groups Before Investing</p>\r\n\r\n<p><a href="/node/51" target="_self" title="DOWNLOAD NOW">DOWNLOAD NOW</a></p>\r\n', 'FREE REPORT: Three Things', 'full_html'),
(4, '<div class="footer-nav" style="text-align: center;">\r\n<ul>\r\n	<li><a href="/node">Home</a></li>\r\n	<li><a href="/node/1">Why Keiretsu</a></li>\r\n	<li><a href="/node/12">About Keiretsu</a></li>\r\n	<li><a href="/node/35">Angel Capital Expo<sup>SM</sup></a></li>\r\n	<li><a href="/node/18">Investors</a></li>\r\n	<li><a href="/node/21">Entrepreneurs</a></li>\r\n	<li><a href="/node/24">Sponsors</a></li>\r\n	<li><a href="/node/27">The Keiretsu Advantage</a></li>\r\n</ul>\r\n</div>\r\n\r\n<div style="text-align: center;">\r\n<p>© 2014 www.KeiretsuForum-MidAtlantic.com | website by <a href="http://www.square2marketing.com" target="_blank">Square2Marketing</a></p>\r\n</div>\r\n', 'The Homepage footer links', 'full_html'),
(5, '<p><strong>FREE REPORT:</strong> Seven Critical Questions To Ask When Selecting An Angel Investment Group</p>\r\n\r\n<p><a href="/node/49" target="_self" title="DOWNLOAD NOW">DOWNLOAD NOW</a></p>\r\n', 'FREE REPORT: Seven Critical ', 'full_html'),
(6, '<p><img alt="rob at ATI graduation 2012" src="/sites/default/files/rob-at-ati-graduation-2012.png" style="float:left; margin:3px 10px 10px 0px" /><em>“Keiretsu Forum takes a disciplined and comprehensive approach to deal screening and due diligence for their investors. Their process allows companies to access a large group of sophisticated investors, while allowing Keiretsu members to access quality deals. The enthusiasm Savara received has been tremendous; allowing us to proceed with a Phase II clinical trial in MRSA infected cystic fibrosis patients without the need for VC funding! As of October 2012, and with Keiretsu Forum’s 15 chapters taking the lead, Savara raised a little over $5m.”</em></p>\r\n\r\n<p><strong>Robert Neville</strong><br />\r\n<strong>CEO, Savara Pharmaceuticals, Inc.</strong></p>\r\n', 'About Robert Neville', 'full_html'),
(7, '<p>Keiretsu Forum Mid-Atlantic announces the first Mid-Atlantic Region Angel Capital Expo - Wednesday, October 23, and the Entrepreneur Academy - Thursday, October 24 on the campus of Drexel University, our host partner. To learn more click this link.</p>\r\n\r\n<p><a href="/node/35" target="_self" title="ANGEL CAPITAL EXPO">ANGEL CAPITAL EXPO</a></p>\r\n', 'Angel Capital Expo & Entrepreneur Academy', 'full_html'),
(8, '<p>By conducting comprehensive six-week due diligence reviews of the most promising entrepreneurial businesses, Keiretsu Forum offers you the most carefully selected and vetted investment opportunities possible.</p>\r\n\r\n<p><a href="/node/29">Make Your Money Smarter</a></p>\r\n', 'Smart Money', 'full_html'),
(9, '<p>In order to bear fruit, promising deals require the support of a strong angel investment network. Keiretsu''s growth-oriented angel funding philosophy is driven and sustained by its unique process of investment cultivation.</p>\r\n\r\n<p><a href="/node/28" target="_self" title="ENRICH YOUR OPPORTUNITIES">ENRICH YOUR OPPORTUNITIES</a></p>\r\n', 'Investment Cultivation', 'full_html'),
(10, '<p>Created by and for Keiretsu Forum members, the Investor Academy offers monthly half-day educational sessions on a wide range of topics pertaining to angel funding and private equity investing.</p>\r\n\r\n<p><a href="/node/16" target="_self" title="EDUCATE YOUR INVESTMENTS">EDUCATE YOUR INVESTMENTS</a></p>\r\n', 'Investor Academy', 'full_html'),
(11, '<p>With 25 chapters around the world, Keiretsu Forum takes your investment opportunities to a global level with local angel investment expertise.</p>\r\n\r\n<p><a href="/node/30">Get The Global Advantage</a></p>\r\n', 'Global Investment Opportunities', 'full_html'),
(12, '<p>Keiretsu Forum provides its private equity investors and presenting entrepreneurs with the expert guidance of industry-leading sponsors. Get smart about angel investment.</p>\r\n\r\n<p><a href="/node/24">Connect With The Experts</a></p>\r\n', 'Robust Network Of Sponsors', 'full_html'),
(13, '<p>This interactive portal gives you comprehensive access to a wealth of global investors and angel funding opportunities across Keiretsu Forum’s 25 worldwide chapters -- all in the convenience of your own home.</p>\r\n\r\n<p><a href="/node/31">Bring Global Value Home</a></p>\r\n', 'K4 DealRoom', 'full_html'),
(14, '<p>Keiretsu Forum provides more than quality angel investment opportunities. Our Fellowship Program promotes education and involvement for law students.</p>\r\n\r\n<p><a href="/node/5">Pass On Your Knowledge</a></p>\r\n', 'Fellowship Program', 'full_html'),
(15, '<p>Enroll in Keiretsu Forum’s Entrepreneur Academy, where private equity investors and business experts provide educational courses on startup business development, sales, marketing and angel investment.</p>\r\n\r\n<p><a href="/node/15">Educate Your Investments</a></p>\r\n', 'Entrepreneur Academy', 'full_html'),
(16, '<p>&nbsp;</p>\r\n\r\n<p>To apply to present your business or become an Investor member of Keiretsu Forum, click the button below.</p>\r\n\r\n<p><a href="/node/45"><img alt="CONNECT WITH KEIRETSU" class="hs-cta-img" id="hs-cta-img-b7b9c7c2-32a6-4541-8f67-637d3204bd5d" src="/sites/default/files/ce52bb5f-bc0b-41b8-9995-d50cb4623f1a.png" style="border-width:0px; height:33px; width:208px" /></a></p>\r\n', 'Paypal Page Connect With Us Block', 'full_html'),
(17, '<div class="utility">\r\n<ul>\r\n	<li>610.971.4067</li>\r\n</ul>\r\n</div>\r\n\r\n<div id="utility">\r\n<ul>\r\n	<li><a href="/blog">Blog</a></li>\r\n	<li><img src="/sites/all/themes/keiretsu/box-small2.png" /></li>\r\n	<li><a href="/contact-us">Contact Us</a></li>\r\n</ul>\r\n</div>', 'Utility links (Blog and Contact Us)', 'full_html'),
(18, '<iframe src="http://Hyper-Team.com/Calendar.html" style="width: 102%; height: 1100px; border=" none;"="" frameborder="0" />', 'Calendar Iframe Block', 'full_html');
