('node', 'page', 0, 1, 1, 'und', 0, '<h1>Angel Investment Opportunities</h1>\r\n\r\n<h2>For Private Investors With Global Pursuits</h2>\r\n\r\n<h3>WHO WE ARE</h3>\r\n\r\n<p><img alt="describe the image" src="/sites/default/files/investment-opportunities.jpg" style="float:right" />"Keiretsu" is the Japanese word for a family of affiliated companies that form a tight-knit alliance and work toward each other’s mutual success. Consistent with this definition, Keiretsu Forum is a conglomeration of serious investors, business leaders, venture capitalists, corporate/institutional investors and serial entrepreneurs bound by two overlapping and codependent goals:</p>\r\n\r\n<ul>\r\n	<li>To work together for each other’s mutual benefit, forming strategic partnerships, enhancing each other’s knowledge and building an angel network of diverse skills</li>\r\n	<li>To access promising <a href="/node/1" title="angel investment opportunities">angel investment opportunities around the world</a></li>\r\n</ul>\r\n\r\n<p>With nearly 1,000 accredited angel investor members dispersed throughout <a href="/node/30" title="25 chapters on three continents">26 chapters on three continents</a>, Keiretsu Forum is the world’s largest and most successful accredited investor - private equity community. Since Keiretsu Forum''s founding in 2000, its members have invested more than $400 million in 300+ different companies from a myriad of industries, including software, telecommunications, health/life sciences, biotech, real estate, mobile applications, Internet, consumer products and other high growth areas.</p>\r\n\r\n<h3>WHAT WE DO</h3>\r\n\r\n<p>Forum members collaborate in the <a href="/node/1" title="thorough due diligence phase">thorough due diligence phase</a> and angel funding terms process, but make individual investment decisions with rounds in the range of $250k-$2m.&nbsp; Keiretsu Forum’s investment opportunities are strengthened by <a href="/node/1" title="extensive educational opportunities">extensive educational opportunities</a>, stimulating smart angel investing decisions and long-lasting strategies. Along with investing in innovative companies, the members of Keiretsu Forum’s angel network are also encouraged to participate in both social activities and charitable opportunities and serve as mentors through our <a href="/node/5" title="Fellowship Program">Fellowship Program</a>.&nbsp; Forum members have donated over $2m to date to over 110 nonprofit organizations.</p>\r\n\r\n<h3>HOW WE OPERATE</h3>\r\n\r\n<p>Keiretsu Forum believes that through a holistic approach -- which includes interlocking relationships with <a href="/node/33" title="sponsors">sponsors</a>, partners and key resources -- it offers an angel network that produces the highest quality deal flow and <a href="/node/1" title="investment opportunities">investment opportunities</a>.</p>\r\n\r\n<h3>KEIRETSU FORUM MID-ATLANTIC CHAPTER</h3>\r\n\r\n<p>Keiretsu Forum Mid-Atlantic, formed in 2011 and comprised of the Philadelphia, DC Metro, New York, and Pittsburgh chapters, is committed to being one of the most successful and distinguished private equity/angel investment organizations in the region.&nbsp; Our core team of angel investor members, sponsors and partners is growing every day, strengthening the chapter’s knowledge base and working together to <a href="/node/1" title="access quality investment opportunities">access quality investment opportunities</a> around the world.</p>\r\n\r\n<ul>\r\n	<li><a href="/node/2" title="How Keiretsu Forum Works">How Keiretsu Forum Works</a></li>\r\n	<li><a href="/node/3" title="Management">Management</a></li>\r\n	<li><a href="/node/4" title="Chapters">Chapters</a></li>\r\n	<li><a href="/node/46" title="Calendar Of Events">Calendar Of Events</a></li>\r\n	<li><a href="/node/5" title="Fellowship Program">Fellowship Program</a></li>\r\n	<li><a href="/node/6" title="Guest Policy">Guest Policy</a></li>\r\n	<li><a href="/node/7" title="Code Of Conduct">Code Of Conduct</a></li>\r\n	<li><a href="/node/8" title="Terms And Conditions">Terms And Conditions</a></li>\r\n	<li><a href="/node/9" title="Testimonials">Testimonials</a></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href="/node/45" target="_self"><img alt="EXTEND YOUR INVESTMENT REACH" src="https://hubspot-hubshot.s3.amazonaws.com/hubshot/prod/12/10/04/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" /></a></p>\r\n', '', 'full_html'),
('node', 'page', 0, 2, 2, 'und', 0, '<h1>Collaboration + Quality Deal Flow + Due Diligence</h1>\r\n\r\n<div id="inner-content">\r\n<h2>The Equation For Angel Investing Success</h2>\r\n\r\n<h3>KEIRETSU&rsquo;S KEY COMPONENTS</h3>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349719726861" src="/sites/default/files/angel-investing.jpg" style="float:right" />Keiretsu Forum&rsquo;s angel investing members benefit from <strong>collaborative relationships</strong> with industry experts who participate via <a href="/node/33" title="sponsorship or partnership">sponsorship or partnership</a>. These organizations include professional services firms, colleges and universities, incubators, commercial real estate firms, investment banking institutions and other private investors in angel investment groups, venture capital firms and private equity funds.</p>\r\n\r\n<p>These relationships facilitate <strong>quality deal flow</strong> -- providing the capital, talent, technology, expert guidance and resources needed to access <a href="/node/28" title="promising angel investment opportunities">promising angel investment opportunities</a> and build prosperous ventures.</p>\r\n\r\n<p>However, it is not sufficient to merely provide the resources, expertise and exciting new investment opportunities.&nbsp; Keiretsu Forum is dedicated to mitigating the risk of investments as much as possible -- from pre-screening and deal screening entrepreneurs before they are invited to present at a Forum meeting, to the <a href="/node/29" title="extensive due diligence phase">extensive <strong>due diligence</strong> phase</a>.</p>\r\n\r\n<h3>THE EIGHT-STEP PROCESS</h3>\r\n\r\n<ol>\r\n	<li><strong>Application:</strong> Companies and entrepreneurs who are interested in securing angel funding through Keiretsu Forum <a href="/node/45" title="fill out an application">fill out an application</a>.</li>\r\n	<li><strong>Pre-Screening:</strong> Applications are pre-screened by the appropriate committees, who select 7-10 companies to present at the Deal Screening.</li>\r\n	<li><strong>Deal Screening:</strong> The Deal Screening presentations are seven minutes long, followed by eight minutes of questions and answers. Three-to-five companies are chosen to present their stories and business plans in front of the full Forum.</li>\r\n	<li><strong>Presentations:</strong> At the Keiretsu Forum meeting, each company makes a 10-minute core presentation and then engages attending Forum members with 10 minutes of questions and answers.</li>\r\n	<li><strong>Interest List:</strong> After each entrepreneur presents, an interest list is signed by the individual members who are interested in the company.</li>\r\n	<li><strong>Discussion:</strong> Once all the presentations are concluded, entrepreneurs are excused and Forum members discuss the companies. This exchange of opinions is designed to open up investors&rsquo; eyes and minds to thoughts and ideas that had not occurred to them during the presentations.</li>\r\n	<li><strong>Due Diligence:</strong> The early stage or startup company enters into a comprehensive <a href="/node/29" title="six-week due diligence phase">six-week due diligence phase</a> with the angel investing members who signed the interest sheet at the Keiretsu Forum meeting. It is common for one or two members to take the lead in due diligence and negotiations with the company. While the members collaborate in the due diligence process, each one makes individual investment decisions.</li>\r\n	<li><strong>Multi-Chapter Investing:</strong> After a company sparks interest from investors in the chapter closest to it geographically, it has the unique opportunity to present at other chapters of its choosing -- broadening exposure to both expert advice and equity capital from Forum members. Members of each chapter conduct their own due diligence, sharing their reports with the entire <a href="/node/30" title="Global Investment Network">Global Investment Network</a> on <a href="/node/31" title="K4-DealRoom.com">K4-DealRoom.com</a>. This provides yet another collaborative, global-reach benefit of angel investing membership with Keiretsu Forum.</li>\r\n</ol>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 3, 3, 'und', 0, '<h1>Your Private Equity &amp; Business Management Experts</h1>\r\n\r\n<div>\r\n<h2>Here To Connect You To Innovative &amp; Earnest Entrepreneurs</h2>\r\n\r\n<h4>Introducing:</h4>\r\n\r\n<h3>Howard Lubert, Area President - Keiretsu Forum Mid-Atlantic</h3>\r\n\r\n<p><img alt="describe the image" class="alignRight" src="/sites/default/files/private-equity.jpg" style="float:right" />Howard Lubert is the founder and managing partner/senior analyst at SafeHatch LLC, a technical due diligence and business acceleration consultancy that supports startup and early stage technology companies. SafeHatch typically takes a senior management role in the portfolio companies it supports and works with them until they are prepared to complete their management teams with full-time employees.&nbsp; Business Acceleration services are provided for companies in many disciplines, but are usually focused in the Internet, e-business, security, SaaS, infrastructure, software, e-learning, mobile or wireless spheres.</p>\r\n\r\n<p>Mr. Lubert dedicated 28+ years to formalizing and optimizing the due diligence and deal flow processes for Safeguard Scientifics and its family of private equity funds, as well as other venture capital and angel investment groups.&nbsp; Lubert was also senior manager at Deloitte &amp; Touche, where he played a principal role in the development of the e-business consulting practice.</p>\r\n\r\n<h4>Areas Of Expertise:</h4>\r\n\r\n<ul>\r\n	<li>Technical Due Diligence</li>\r\n	<li>Business Acceleration</li>\r\n	<li>Business Remediation/Turnaround</li>\r\n</ul>\r\n\r\n<h4>Introducing:</h4>\r\n\r\n<h3>Vince Leusner, Area Vice President - Keiretsu Forum Mid-Atlantic</h3>\r\n\r\n<p>Vince Leusner helps businesses maximize value as a Philadelphia-based partner with B2B CFO®.&nbsp; As the largest CFO firm in the U.S., B2B CFO focuses on emerging and mid-market companies, with revenues of up to $75 million, that want to increase cash, profitability, sales and company value.</p>\r\n\r\n<p>Mr. Leusner has 27 years of financial management and financial advisory experience, working with publicly traded and privately held entities of all sizes.&nbsp; Vince has managed, advised and consulted with entities in North and South America, Europe and Asia.&nbsp; He worked for clients in a vast variety of industries, including services, media, financial services, retailing, distribution, public utilities, hospitality, manufacturing, not-for-profit and gaming.</p>\r\n\r\n<h4>Areas Of Expertise:</h4>\r\n\r\n<ul>\r\n	<li>Treasury/Cash Management</li>\r\n	<li>Financial Performance</li>\r\n	<li>Processes &amp; Procedures</li>\r\n	<li>Cost Effective Internal Controls</li>\r\n	<li>Financial Management, Financial Reporting, Budgeting &amp; Variance Analysis</li>\r\n</ul>\r\n\r\n<h4>Introducing:</h4>\r\n\r\n<h3>Jack Warnock, Area Vice President - Keiretsu Forum Mid-Atlantic</h3>\r\n\r\n<p>A serial entrepreneur, early stage company advisor, Mr. Warnock joined the K4-MA regional management team in January, 2014.&nbsp; An accredited investor, Jack brings extensive exterience in mergers &amp; acquisitions, joint ventures &amp; strategic alliances, governance and risk management, finance &amp; operations, management &amp; due diligence, and succession planning to the K4 network.&nbsp; Jack was a CPA at Arthur Andersen, CFO at FTP Software, Thinking Machines, and Towers &amp; Perrin Administration Solutions, M&amp;A at Verizon (Bell Atlantic), Office Managing Partner at Tatum, Business Consulting &amp; Development at Smart Devine, Co-founder at JW Strategic Advisors, McIsaac Risk Solutions and Safeguard Scientifics (Bridge Tech Partners), Investment Banker at W.H. Newbold’s, and currently serves on the Board of Directors at C. W. Thomas.</p>\r\nAreas Of Expertise:\r\n\r\n<ul>\r\n	<li>Corporate Management &amp; Development</li>\r\n	<li>Finance, Operations, Strategic Inititatives</li>\r\n	<li>University Tech Transfer</li>\r\n	<li>Market &amp; Technical Due Diligence</li>\r\n</ul>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'filtered_html'),
('node', 'page', 0, 4, 4, 'und', 0, '<h1>Angel Investment Network For The Mid-Atlantic Region</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Global Investment Opportunities At Your Local Convenience</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" src="/sites/default/files/angel-investment-network.jpg" style="float:right" />Keiretsu Forum Mid-Atlantic, established in 2011, consists of chapters in Philadelphia, Metro Washington, D.C.,&nbsp; Pittsburgh, and New York.</p>\r\n\r\n<h3>Keiretsu Forum - Philadelphia:</h3>\r\n\r\n<p>Keiretsu Forum Philadelphia opened in March, 2011 and holds its Forum meetings at the Law Offices of Woodcock Washburn, the Philadelphia Host Sponsor:</p>\r\n\r\n<p>The Cira Center<br />\r\n2929 Arch Street, 12th Floor<br />\r\nPhiladelphia, PA 19104<br />\r\n<a href="https://maps.google.com/maps?oi=map&amp;q=2929+Arch+St,+Philadelphia,+PA+19103" target="_self" title="Google Map">Google Map</a></p>\r\n\r\n<p>Chapter President Chuck Carter can be reached at (215) 233-0342.</p>\r\n\r\n<h3>Keiretsu Forum - DC Metro:</h3>\r\n\r\n<p>Keiretsu Forum DC Metro held its first meeting in July 2011 and meets monthly at the offices of its host sponsor, CohnReznick:</p>\r\n\r\n<p>7501 Wisconsin Avenue, Suite 400E<br />\r\nBethesda, MD 20814-6583<br />\r\n<a href="https://maps.google.com/maps?q=7501+Wisconsin+Avenue+Suite+400E+Bethesda,+MD+20814-6583&amp;oe=utf-8&amp;client=firefox-a&amp;ie=UTF-8&amp;hq=&amp;hnear=0x89b7c96530455f77:0xb40c8cf637d47e23,7501+Wisconsin+Ave+%23400e,+Bethesda,+MD+20814&amp;gl=us&amp;ei=oCrVTpKjKKby0gGyo5WZAg&amp;oi=geocode_result&amp;ved=0CB4Q8gEwAA" target="_blank" title="Google Map">Google Map</a></p>\r\n\r\n<p>Chapter President Richard Greene can be reached at (301) 280-3074.</p>\r\n\r\n<h3>Keiretsu Forum - New York:</h3>\r\n\r\n<p>Keiretsu Forum New York became a part of the Mid-Atlantic Region in March, 2013 and hold''s it''s meetings in Manhattan at the offices of its host sponsor, Loeb &amp; Loeb meetings:</p>\r\n\r\n<p>345 Park Avenue<br />\r\nNew York, NY 10154<br />\r\n<a href="https://maps.google.com/maps?q=7501+Wisconsin+Avenue+Suite+400E+Bethesda,+MD+20814-6583&amp;oe=utf-8&amp;client=firefox-a&amp;ie=UTF-8&amp;hq=&amp;hnear=0x89b7c96530455f77:0xb40c8cf637d47e23,7501+Wisconsin+Ave+%23400e,+Bethesda,+MD+20814&amp;gl=us&amp;ei=oCrVTpKjKKby0gGyo5WZAg&amp;oi=geocode_result&amp;ved=0CB4Q8gEwAA" target="_blank" title="Google Map">Google Map</a></p>\r\n\r\n<p>Chapter President Charles Albanese can be reached at (201) 848-1082<br />\r\nEleanor Hass, EVP of Business Development can be reached at (212) 421-5257</p>\r\n\r\n<h3>Keiretsu Forum - Pittsburgh:</h3>\r\n\r\n<p>The Pittsburgh chapter joined the Mid-Atlantic Region in March, 2012. It holds monthly Forum meetings at the offices of its host sponsor, Schnader Harrison Segal &amp; Lewis LLP:</p>\r\n\r\n<p>Fifth Avenue Place‎<br />\r\n120 Fifth Ave, Suite 2700<br />\r\nPittsburgh, PA 15222-3001<br />\r\n<a href="https://maps.google.com/maps?hl=en&amp;ie=UTF-8&amp;q=schnader+harrison+fifth+avenue+place+120+fifth+avenue+suite+2700,+pittsburgh&amp;fb=1&amp;gl=us&amp;hq=schnader+harrison+fifth+avenue+place+120+fifth+avenue+suite+2700,&amp;hnear=0x8834f16f48068503:0x8df915a15aa21b34,Pittsburgh,+PA&amp;cid=0,0,4402471530874218397&amp;ei=iFgEUJGEH8Pf0gGN6YSzBw&amp;ved=0CHkQ_BIwBA&amp;oi=local_group" target="_blank" title="» Google Map">Google Map</a></p>\r\n\r\n<p>Chapter President Malcolm Handelsman can be reached at (412) 859-8008.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 5, 5, 'und', 0, '<h1>Angel Investment That Makes A Difference</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Giving Students Real World Knowledge And Experience</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" src="/sites/default/files/angel-investment-2.jpg" style="float:right" />Keiretsu Forum Mid-Atlantic is proud of the quality angel investment opportunities that it provides its angel investor members.&nbsp; It’s proud of its provision of quality deal flow, made possible by an <a href="/node/33" title="extensive sponsorship network">extensive sponsorship network</a> of industry experts, its commitment to <a href="/node/28" title="attracting, screening and guiding">attracting, screening and guiding</a> innovative entrepreneurs and its dedication to <a href="/node/29" title="methodical due diligence">methodical due diligence</a>.</p>\r\n\r\n<p>We’re also proud of our <strong>Due Diligence Fellowship Program</strong>, which is the first program of its type to be established.&nbsp; Initiated in the Philadelphia Chapter, the program recruits local law &amp; MBA students to engage in the due diligence process.&nbsp; This not only helps them fulfill their fellowship requirements, but the program also establishes mutually beneficial relationships between the students and Keiretsu’s investors and entrepreneurs.</p>\r\n\r\n<p>The Fellows attend the monthly screening and Forum meetings held in Philadelphia, where they observe the entrepreneurs’ presentations and participate in the discussions with the chapter’s investors.&nbsp; The students then indicate which projects interest them and are assigned to a due diligence team led by one of the investors.&nbsp; Over the next few weeks, the students assist with the due diligence process.</p>\r\n\r\n<p>President Howard Lubert also conducts a workshop to teach the students the rigorous due diligence process that Keiretsu Forum follows.&nbsp; The students also receive continuous training and feedback from the due diligence team members and the chapter leaders throughout the program.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 6, 6, 'und', 0, '<h1>Keiretsu Forum Mid-Atlantic Welcomes &amp; Encourages Its Guests</h1>\r\n\r\n<div id="inner-content">\r\n<h2>From Future Presenters To Private Equity Investors And Potential Sponsors</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" src="/sites/default/files/private-equity-investors.jpg" style="float:right" />Guests are welcome and encouraged to attend Keiretsu Forum Philadelphia, DC Metro and Pittsburgh meetings.</p>\r\n\r\n<h3>THREE MAIN RULES</h3>\r\n\r\n<ol>\r\n	<li>Only those who are invited by a Keiretsu Forum member or team member are able to attend</li>\r\n	<li>Must complete pre-registration before the meeting</li>\r\n	<li>Guests may attend no more than two meetings before applying for membership or submitting a request for their company to present</li>\r\n</ol>\r\n\r\n<h3>WHO ARE OUR GUESTS?</h3>\r\n\r\n<p>A guest is:</p>\r\n\r\n<ul>\r\n	<li><a href="/node/21" title="A future presenter">A future presenter</a></li>\r\n	<li>An active private equity investor and/or <a href="/node/19" title="potential member">potential member</a></li>\r\n	<li>A <a href="/node/33" title="potential sponsor">potential sponsor</a> or chapter partner</li>\r\n</ul>\r\n\r\n<p>We also actively seek out college and university students <a href="/node/21" target="_self" title="interested in Entrepreneurship">interested in Entrepreneurship</a>.</p>\r\n\r\n<h3>GUEST ETIQUETTE</h3>\r\n\r\n<p><strong>Respect:</strong><br />\r\nBecause Keiretsu Forum Mid-Atlantic values everyone’s participation and each speaker’s time, we highly encourage that guests stay for the entire meeting.</p>\r\n\r\n<p><strong>Participation:</strong><br />\r\nWe also encourage “mind share,” discussions on the facilitated topics for mutual edification and expansion of each attendee’s personal opinions and ideas.</p>\r\n\r\n<p><strong>Devices:</strong><br />\r\nTo support our meeting objectives, please turn off your communication devices. They interfere with both the presentations and our sound system.</p>\r\n\r\n<p><strong>Non-Solicitation:</strong><br />\r\nTo ensure a positive experience for all, guests may not solicit presenting candidates and/or K4 members. Anyone who violates this policy will be asked to leave the meeting immediately.</p>\r\n\r\n<p><strong>Business Cards:</strong><br />\r\nWe are a community of angel investors and innovative entrepreneurs with common passions, not a convenient networking group.&nbsp; We welcome information exchange in an atmosphere of discovery that builds community and connections, but please exercise discretion with business card distribution by waiting until you are asked.</p>\r\n\r\n<h3>THE DETAILS</h3>\r\n\r\n<p><strong>Meeting Composition:</strong><br />\r\nThe overall Keiretsu Forum membership profile consists of:</p>\r\n\r\n<ul>\r\n	<li>80% SEC-accredited individual private equity investors</li>\r\n	<li>10% venture capital investors who are also accredited individual investors</li>\r\n	<li>5% <a href="/node/33" title="sponsor organizations">sponsor organizations</a></li>\r\n	<li>5% Forum resource members who are, first and foremost, active accredited investors</li>\r\n</ul>\r\n\r\n<p><strong>Forum Introductions:</strong><br />\r\nDuring the Forum meetings, there are brief introductions between presentations and all attendees are given an opportunity to participate.&nbsp; We suggest that you be prepared to deliver a brief 30-second vignette addressing your personal and business-related passions and goals.</p>\r\n\r\n<p>We hope to see you at a Forum meeting soon! Reference our <a href="calendar-of-events" title="Calendar of Events">Calendar of Events</a> for one that’s convenient for you.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 7, 7, 'und', 0, '<h1>Code Of Conduct Regarding Investments Offered At The Keiretsu Forum</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Establishing Respectful Business Between Angel Investors &amp; Entrepreneurs</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" src="/sites/default/files/angel-investors.jpg" style="float:right" />Keiretsu Forum arranges meetings between Entrepreneurs and potential Members (Investors).&nbsp; Those Entrepreneurs may be considering conducting private offerings of their equity in which the Member (Investor) may want to consider investing.&nbsp; Under securities law, Entrepreneurs conducting private offerings of their securities must observe various requirements, including that private offering may not involve any advertising or general solicitation.</p>\r\n\r\n<p>Keiretsu Forum and Entrepreneurs that attend its meetings do not conduct any advertising or general solicitation.&nbsp; Keiretsu Forum Members (Investors) that attend meetings and that might want to invest in any Entrepreneurs must have demonstrated appropriate qualifications and must agree to the following terms:</p>\r\n\r\n<ol>\r\n	<li>Member (Investor) agrees that any invitation to Keiretsu Forum that a Member (Investor) may receive is personal to the Member (Investor) and the Member (Investor) will not invite anyone else to attend, whether in addition to or instead of Member (Investor). If you desire to introduce any other potential Member (Investor) to Keiretsu Forum, please contact the Keiretsu Forum in advance.</li>\r\n	<li>Member (Investor) understands that Member (Investor) may learn of private offerings through the Keiretsu Forum. These private offerings are subject to state and federal securities laws, which prohibit, among other things, the communication or retransmission to anyone of information received by Member (Investor) from Entrepreneurs through Keiretsu Forum.&nbsp; <strong>Such information is for the sole use of Member (Investor) and may not be reviewed by or shared with others.</strong>&nbsp; To the extent necessary, Entrepreneurs may separately provide information to Member (Investor) and to Member (Investor)’s legal, tax and investment decisions.</li>\r\n	<li>Member (Investor) understands that Keiretsu Forum has not reviewed any information about Entrepreneurs that are represented at its meetings.&nbsp; Member (Investor) will not rely on Keiretsu Forum for any such review.&nbsp; Keiretsu Forum makes no representations or warranties about any Entrepreneur, express or implied.&nbsp; Member (Investor) understands that Member (Investor) is solely responsible for Member (Investor)’s own due diligence investigation of any Entrepreneur before deciding to invest in that Entrepreneur.</li>\r\n	<li>Member (Investor) understands that all negotiations concerning investments (including price, percentage ownership interest and other terms) will take place directly between Member (Investor) and Entrepreneurs and that Keiretsu Forum is not acting as an agent or principal or in any other capacity in those negotiations or transactions.</li>\r\n	<li>Member (Investor) understands that Keiretsu Forum is not an investment adviser or underwriter for Member (Investor) for any Entrepreneur and that Keiretsu Forum takes no responsibility for the accuracy or completeness of any information about any Entrepreneur communicated to Member (Investor) by any means or by any person at any time.</li>\r\n	<li>Member (Investor) understands that, due to SEC regulations, Member (Investor) may not be able to review certain Entrepreneurs represented at prior Keiretsu Forum Meetings. Member (Investor) may also not be able to view certain Entrepreneurs until 45 days after Keiretsu Forum receives this completed and signed questionnaire.</li>\r\n	<li>Member (Investor) understands that if the Entrepreneur wants Member (Investor) to agree to other restrictions on the use of the Entrepreneur’s confidential information, the Entrepreneur may require that Member (Investor) enter into a separate non-disclosure agreement before providing the confidential information.</li>\r\n	<li>Member (Investor) understands that investing in early stage, private companies involves extreme risk and should be considered only by Members (Investors) that can afford to lose their entire investment.</li>\r\n	<li>Member (Investor) understands that Keiretsu Forum is not a broker/dealer and may not sell, offer to sell or solicit an offer to buy any security. References to Keiretsu Forum include its U.S. affiliates and agents.</li>\r\n	<li>There is a no solicitation policy for members and guests at Keiretsu Forum Meetings and events and members agree not to use their membership for the purpose of soliciting business to their individual firms.</li>\r\n	<li>Member (Investor) should consult Member’s (Investor’s) own attorneys, accountants, investment advisers and other professional advisers when considering an investment.</li>\r\n</ol>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 8, 8, 'und', 0, '<h1>Terms &amp; Conditions For Presenting Entrepreneurs</h1>\r\n\r\n<div id="inner-content">\r\n<h2>To Access Angel Funding, Please Respect The Following</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" src="/sites/default/files/angel-funding.jpg" style="float:right" />Agreement with the following terms and conditions is required in order to present at our Keiretsu Forum Member meetings:</p>\r\n\r\n<h3>FEES</h3>\r\n\r\n<ul>\r\n	<li>There are no fees to submit an application, have your application documents pre-screened or to present at our Deal Screening meetings, if invited.</li>\r\n	<li>There is no fee for attendance at K4 Entrepreneur Workshops, should you choose to attend.</li>\r\n	<li>Companies selected to present at a Keiretsu Forum Member meeting must pay an administrative fee of $3,000 to present to all 4 chapters, which includes the video recording of your presentation at the Forum Meeting and the hosting of the recording, along with your deal package, on <a href="/node/31" title="K4-DealRoom.com">K4-DealRoom.com</a>.</li>\r\n	<li>If you are invited into due diligence as a result of your presentation and member interest there may be fees for normal due diligence items such as background checks, high-level legal review of IP, etc. and you will be advised and will approve these expenses in advance.</li>\r\n</ul>\r\n\r\n<h3>PROCESS AND PROCEDURES</h3>\r\n\r\n<p>If you are selected to present at a Keiretsu Forum Member meeting, you agree to:</p>\r\n\r\n<ul>\r\n	<li>Provide all necessary presentation material according to the timelines indicated to you</li>\r\n	<li>Use the presentation approved at the Deal Screening meeting</li>\r\n</ul>\r\n\r\n<p>If you enter into a <a href="/node/29" title="due diligence process">due diligence process</a> with Keiretsu Forum Mid-Atlantic as a result of your presentation at a Keiretsu Forum Member Meeting, you agree to:</p>\r\n\r\n<ul>\r\n	<li>Provide all additional information requested in a timely and complete manner</li>\r\n	<li>Participate in meetings/conference calls as requested to respond to angel investor questions</li>\r\n	<li>Respond to terms sheet and/or funding agreements in a timely manner</li>\r\n</ul>\r\n\r\n<h3>ANGEL FUNDING OFFERED</h3>\r\n\r\n<p>If you receive funding as a result of your Keiretsu Forum Mid-Atlantic participation, you agree to:</p>\r\n\r\n<ul>\r\n	<li>Provide Keiretsu Forum with a copy of the investment documents/terms sheet and any other financial agreements supplied to the angel investors</li>\r\n	<li>Keep us informed of funding events as we track these locally, nationally and <a href="/node/30" title="internationally">internationally</a></li>\r\n</ul>\r\n\r\n<p>Thank you for adhering to our terms and conditions. By doing so, you prove that you value Keiretsu Forum’s commitment to quality angel investment opportunities and respectful business relationships.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 9, 9, 'und', 0, '<h1>An Angel Network Built On Quality Deal Flow</h1>\r\n\r\n<div id="inner-content">\r\n<h2>And Strategic Partnerships Founded On Respect</h2>\r\n\r\n<h3>Sponsor Testimonial:</h3>\r\n\r\n<p><em>"After spending significant time working with emerging growth companies during my career, I immediately recognized the value of importing K4 to Washington, D.C. and to allow my firm, Cozen O’Connor, to act as host sponsor.&nbsp; I was intrigued by Keiretsu’s model because the members collaborate to generate the best deal flow and carry out extensive due diligence.&nbsp; This model struck me as something that would be an outstanding advantage in the Washington, D.C. angel community -- incredibly helpful to both investors and entrepreneurs."</em><br />\r\n<strong>Louis M. Heidelberger, Esq.<br />\r\nMember of Cozen O''Connor</strong></p>\r\n\r\n<ul>\r\n	<li>Louis has been honored on a number of occasions for his contributions to the legal profession, being named a Best Lawyer in Intellectual Property every year since 1999 and a Best Lawyer in the Bay Area in Intellectual Property from 2003 to 2005.&nbsp; He is listed in Chambers as a Leading Lawyer in IP and was named a Super Lawyer in both Washington, D.C. and Pennsylvania. In 2011, he was elected as member of The Cosmos Club.</li>\r\n</ul>\r\n\r\n<h3>Entrepreneur Testimonial:</h3>\r\n\r\n<p><em>"Keiretsu Forum Mid-Atlantic takes a disciplined approach to deal screening, in-depth due diligence and investing, enabling companies to access a large group of sophisticated investors and enabling its members to access pre-qualified deal flow. The enthusiasm Savara received has been tremendous, and we are delighted at the level of Keiretsu Forum support as we work to advance our lead program through Phase II clinical development."</em><br />\r\n<strong>Robert Neville<br />\r\nChief Executive Officer of Savara Pharmaceuticals</strong></p>\r\n\r\n<ul>\r\n	<li>Rob has successfully started and run a number of companies and projects.&nbsp; Prior to Savara, Rob was founder and CEO of Evity, Inc., which he sold to BMC for $100m in 2000.&nbsp; Based on his work at Evity, Rob was honored as a finalist in the Ernst &amp; Young Entrepreneur of the Year award.</li>\r\n</ul>\r\n\r\n<h3>Investor Testimonial:</h3>\r\n\r\n<p><em>Keiretsu Forum Mid-Atlantic is unique because their investors are particularly savvy and their due diligence process is extremely rigorous."</em><br />\r\n<strong>Bernie Rudnick<br />\r\nMember of Keiretsu Mid-Atlantic</strong></p>\r\n\r\n<ul>\r\n	<li>With 36 years of experience in executive level strategy, finance and management, as well as substantial experience investing and guiding investments in entrepreneurial companies, Bernie has led capital formation totaling over $380M in the past six years and $3B over the last 15 years.&nbsp; He is a founding member and Chairman Emeritus of Mid-Atlantic Diamond Ventures within the Fox School of Business at Temple University.</li>\r\n</ul>\r\n\r\n<h3>Fellow Testimonial:</h3>\r\n\r\n<p><em>"Keiretsu Forum Mid-Atlantic offers a unique educational opportunity for law students.&nbsp; For those of us soon entering into the fields of emerging growth business and corporate law, understanding how investors evaluate companies is a critical component to becoming more effective advocates for our clients.&nbsp; The investors also find the program beneficial, appreciating help with conducting the exhaustive due diligence process."</em><br />\r\n<strong>Pat Bellow, Esq.<br />\r\nFormer Keiretsu Mid-Atlantic Fellow</strong></p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'event_calendar', 0, 11, 11, 'und', 0, '<h1>test event desc</h1>', '', 'full_html'),
('node', 'page', 0, 12, 12, 'und', 0, '<h1>Angel Investing 101: Power Up Your Knowledge</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Everything Investors &amp; Entrepreneurs Need To Know</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724823742" src="/sites/default/files/angel-investing-3.jpg" style="float:right" />Knowledge is power in pretty much every aspect of life, but especially when it comes to your business and angel investment decisions.&nbsp; Keiretsu Forum makes it easy for you to stay informed and up-to-date on everything going on in the world of private equity and startup business development.</p>\r\n\r\n<p>Power up your knowledge with the latest news, trends and developments in angel investing.&nbsp; Download free, instructional content on topics ranging from angel network selection to choosing the best investment opportunities with the lowest risk.&nbsp; Finally, attend educational courses designed for both private investors and entrepreneurs.</p>\r\n\r\n<ul>\r\n	<li><a href="/node/13" target="_self" title="News &amp; Articles">News &amp; Articles</a></li>\r\n	<li><a href="/node/14" target="_self" title="White Papers">Whitepapers</a></li>\r\n	<li><a href="/node/15" target="_self" title="Keiretsu Forum Entrepreneur Academy">Keiretsu Forum Entrepreneur Academy</a></li>\r\n	<li><a href="/node/16" target="_self" title="Keiretsu Forum Investor Academy">Keiretsu Forum Investor Academy</a></li>\r\n</ul>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 13, 13, 'und', 0, '<h1>Your Angel Network Keeps You Aware And Informed</h1>\r\n\r\n<div id="inner-content">\r\n<h2>The Greatest Articles And Latest Updates In The World Of Private Equity</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724849555" src="/sites/default/files/angel-network-3.jpg" style="float:right" />Browse through these articles and press releases to get the news and information that directly affects your angel investment decisions and startup business development.</p>\r\n\r\n<ol>\r\n	<li><a href="/sites/default/files/docs/How-Software-Entrepreneurs-can-be-Successful-Presenters-to-Investors.pdf" target="_blank" title="How Software Entrepreneurs can be Successful Presenters to Investors">How Software Entrepreneurs can be Successful Presenters to Investors</a></li>\r\n	<li><a href="/sites/default/files/docs/Angel-Investing-Worth-the-Effort-by-Geoff-Roach.pdf" target="_blank" title="Angel Investing - Worth the Effort? by Geoff Roach">Angel Investing - Worth the Effort? by Geoff Roach</a></li>\r\n	<li><a href="/sites/default/files/docs/What-Every-Entrepreneur-Should-Know-About-Angel-Investors.pdf" target="_blank" title="What Every Entrepreneur Should Know about Angel Investors">What Every Entrepreneur Should Know about Angel Investors</a></li>\r\n	<li><a href="/sites/default/files/docs/The-Keiretsu-Forum-Entrepreneur-Application-DealRoom-Process.pdf" target="_blank" title="The Entrepreneur''s Guide to the Keiretsu Forum Process">The Entrepreneur''s Guide to the Keiretsu Forum Process</a></li>\r\n	<li><a href="http://technicallyphilly.com/2012/10/25/keiretsu-forum-midatlantic-an-inside-look-at-the-local-angel-group-that-has-invested-3-4m-in-two-years" target="_blank" title="Keiretsu Forum Mid-Atlantic: An inside look at the local angel group that has invested $3.4M in two years">Keiretsu Forum Mid-Atlantic: An inside look at the local angel group that has invested $3.4M in two years</a></li>\r\n	<li><a href="/node/47" target="_blank" title="Sensible Investments: The Only Ones Worth Making">Sensible Investments: The Only Ones Worth Making</a></li>\r\n	<li><a href="/node/48" target="_blank" title="The Risks And Rewards Of Investing In Foreign Companies">The Risks And Rewards Of Investing In Foreign Companies</a></li>\r\n</ol>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 14, 14, 'und', 0, '<h1>Educational Content On Private Equity And Angel Investing</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Available At Your Convenience For Free Download</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724876740" src="/sites/default/files/private-equity-2.jpg" style="float:right" />If you’re serious about your angel investing and private equity pursuits, you want to get your hands on every piece of instructional and educational content available. Keiretsu Forum Mid-Atlantic understands your needs, so every time we publish a whitepaper or tip sheet on angel investment or startup development, this is where it will go.</p>\r\n\r\n<ul>\r\n	<li><a href="/node/49" target="_self" title="Seven Critical Questions To Ask When Selecting An Angel Investment Group">Seven Critical Questions To Ask When Selecting An Angel Investment Group</a></li>\r\n	<li><a href="/node/50" target="_self" title="Five Reasons To Consider Joining An Angel Investor Network">Five Reasons To Consider Joining An Angel Investor Network</a></li>\r\n	<li><a href="/node/51" target="_self" title="Three Things You Must Know About Angel Investment Groups Before Investing">Three Things You Must Know About Angel Investment Groups Before Investing</a></li>\r\n</ul>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 15, 15, 'und', 0, '<h1>Your Private Investors Offer Private Instruction</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Courses On Startup Planning From Business Experts</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724909093" src="/sites/default/files/private-investors.jpg" style="float:right" />The Keiretsu Forum Entrepreneur Academy was designed by the angel investor members of Keiretsu Forum to provide first-class course offerings.&nbsp; Each course, taught by seasoned industry executives, focuses on the critical elements of a startup company''s business plan.</p>\r\n\r\n<p>Academy courses may occur twice a year in person or via webinar and include:</p>\r\n\r\n<ol>\r\n	<li>CEO''s Roles &amp; Responsibilities</li>\r\n	<li>The Deal - Understanding Terms and Conditions and Financing Options</li>\r\n	<li>Protecting Intellectual Property</li>\r\n	<li>Avoiding Incorporation, Formation and Compensation Pitfalls &amp; Landmines</li>\r\n	<li>Sales &amp; Marketing</li>\r\n	<li>Accounting - Setting Up Books and Financial Projections</li>\r\n</ol>\r\n\r\n<p><a href="/node/45"><img alt="ENROLL IN ENTREPRENEUR ACADEMY" class="hs-cta-img" id="hs-cta-img-7c8cf4fe-8a6a-497a-9b0c-cd28c0139fe5" src="/sites/default/files/a4077289-7127-4dd5-85f0-3ca9890d4810.png" style="border-width:0px; height:33px; width:294px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 16, 16, 'und', 0, '<h1>Our Private Equity Investors Get Private Tutoring</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Enroll In The Academy &amp; Get Smart About Your Angel Investing</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724934872" src="/sites/default/files/private-equity-investors-3.jpg" style="float:right" />The Keiretsu Forum Academy for Investors was created in August 2004, by and for our angel investor members, to provide quality education and instruction on private equity investing.&nbsp; These half-day sessions are held monthly and are of tremendous value to anyone who is serious about investment opportunities.</p>\r\n\r\n<p>Previous courses taught at Keiretsu Forum Investor Academy include:</p>\r\n\r\n<ul>\r\n	<li>Beyond Investing</li>\r\n	<li>Investing in Oil and Gas Companies</li>\r\n	<li>Convertible Notes and Warrants</li>\r\n	<li>Legal Aspects of Angel Due Diligence</li>\r\n	<li>Deal Structuring</li>\r\n	<li>Micro Multi-Nationals: A New Global Startup</li>\r\n	<li>Early Stage Company Valuations</li>\r\n	<li>Negotiating Term Sheets</li>\r\n	<li>Financial Due Diligence for Angel Investors</li>\r\n	<li>Pitfalls of Angel Investing</li>\r\n	<li>How to Choose a Winning Management Team</li>\r\n	<li>Intellectual Property</li>\r\n	<li>Real Estate Investing 101</li>\r\n	<li>Investing in China</li>\r\n	<li>Stock Ownership, Value and Dilution</li>\r\n	<li>Investing in Distressed Markets</li>\r\n	<li>Structuring Real Estate Funds</li>\r\n</ul>\r\n\r\n<p><a href="/node/45"><img alt="ATTEND INVESTOR ACADEMY" class="hs-cta-img" id="hs-cta-img-29ca3cce-892a-4ee4-b4ec-9496c0c75270" src="/sites/default/files/bff66cfb-4f3a-46f7-8ba0-f24d23a56f34.png" style="border-width:0px; height:33px; width:232px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 17, 17, 'und', 0, '<h1>Keiretsu Forum Mid-Atlantic In The News</h1>\r\n\r\n<div id="inner-content">\r\n<h2>An Informed Investor Is A Smart Investor</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724876740" src="/sites/default/files/angel-investment-opportunities.jpg" style="float:right" />Keiretsu Forum Mid-Atlantic is keeping busy helping to make its region one of the most active in the angel investing community.&nbsp; Review our press releases to see our most recent achievements and activities.</p>\r\n\r\n<ul>\r\n	<li><a href="/sites/default/files/docs/Woodcock-Washburn.pdf" target="_blank" title="Keiretsu Forum Mid-Atlantic Philadelphia Chapter Announces Woodcock Washburn As New Host Sponsor  ">Keiretsu Forum Mid-Atlantic Philadelphia Chapter Announces Woodcock Washburn As New Host Sponsor </a></li>\r\n	<li><a href="/sites/default/files/docs/Keiretsu_pr_savara_v2.pdf" target="_blank" title="Keiretsu Forum Makes Its Largest Single Investment To Date In Savara Pharmaceuticals'' Recent Series B">Keiretsu Forum Makes Its Largest Single Investment To Date In Savara Pharmaceuticals'' Recent Series B</a></li>\r\n	<li><a href="/sites/default/files/docs/Keiretsu_pr_CourageBizAdvisors_v2.pdf" target="_blank" title="Keiretsu Forum Mid-Atlantic Announces CEO Coaching Partnership with Courage International Business Advisors">Keiretsu Forum Mid-Atlantic Announces CEO Coaching Partnership with Courage International Business Advisors</a></li>\r\n	<li><a href="/sites/default/files/docs/Keiretsu-Forum-Welcomes-New-MidAtlantic-Chapter-President.pdf" target="_blank" title="Keiretsu Forum Welcomes New Mid-Atlantic Chapter President">Keiretsu Forum Welcomes New Mid-Atlantic Chapter President</a></li>\r\n	<li><a href="/sites/default/files/docs/Keiretsu-Forum-Mid-Atlantic-Establishes-Due-Diligence-Fellowship-Program.pdf" target="_blank" title="Keiretsu Forum Mid-Atlantic Establishes Due Diligence Fellowship Program">Keiretsu Forum Mid-Atlantic Establishes Due Diligence Fellowship Program</a></li>\r\n	<li><a href="/sites/default/files/docs/Keiretsu-Forum-Gives-New-Wings-To-Angel-Investing-In-The-Mid-Atlantic-Region.pdf" target="_blank" title="Keiretsu Forum Gives New Wings To Angel Investing In The Mid-Atlantic Region">Keiretsu Forum Gives New Wings To Angel Investing In The Mid-Atlantic Region</a></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html');
