INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, '<h1>Angel Investment Opportunities</h1>\r\n\r\n<h2>For Private Investors With Global Pursuits</h2>\r\n\r\n<h3>WHO WE ARE</h3>\r\n\r\n<p><img alt="describe the image" src="/sites/default/files/investment-opportunities.jpg" style="float:right" />"Keiretsu" is the Japanese word for a family of affiliated companies that form a tight-knit alliance and work toward each other’s mutual success. Consistent with this definition, Keiretsu Forum is a conglomeration of serious investors, business leaders, venture capitalists, corporate/institutional investors and serial entrepreneurs bound by two overlapping and codependent goals:</p>\r\n\r\n<ul>\r\n	<li>To work together for each other’s mutual benefit, forming strategic partnerships, enhancing each other’s knowledge and building an angel network of diverse skills</li>\r\n	<li>To access promising <a href="/node/1" title="angel investment opportunities">angel investment opportunities around the world</a></li>\r\n</ul>\r\n\r\n<p>With nearly 1,000 accredited angel investor members dispersed throughout <a href="/node/30" title="25 chapters on three continents">26 chapters on three continents</a>, Keiretsu Forum is the world’s largest and most successful accredited investor - private equity community. Since Keiretsu Forum''s founding in 2000, its members have invested more than $400 million in 300+ different companies from a myriad of industries, including software, telecommunications, health/life sciences, biotech, real estate, mobile applications, Internet, consumer products and other high growth areas.</p>\r\n\r\n<h3>WHAT WE DO</h3>\r\n\r\n<p>Forum members collaborate in the <a href="/node/1" title="thorough due diligence phase">thorough due diligence phase</a> and angel funding terms process, but make individual investment decisions with rounds in the range of $250k-$2m.&nbsp; Keiretsu Forum’s investment opportunities are strengthened by <a href="/node/1" title="extensive educational opportunities">extensive educational opportunities</a>, stimulating smart angel investing decisions and long-lasting strategies. Along with investing in innovative companies, the members of Keiretsu Forum’s angel network are also encouraged to participate in both social activities and charitable opportunities and serve as mentors through our <a href="/node/5" title="Fellowship Program">Fellowship Program</a>.&nbsp; Forum members have donated over $2m to date to over 110 nonprofit organizations.</p>\r\n\r\n<h3>HOW WE OPERATE</h3>\r\n\r\n<p>Keiretsu Forum believes that through a holistic approach -- which includes interlocking relationships with <a href="/node/33" title="sponsors">sponsors</a>, partners and key resources -- it offers an angel network that produces the highest quality deal flow and <a href="/node/1" title="investment opportunities">investment opportunities</a>.</p>\r\n\r\n<h3>KEIRETSU FORUM MID-ATLANTIC CHAPTER</h3>\r\n\r\n<p>Keiretsu Forum Mid-Atlantic, formed in 2011 and comprised of the Philadelphia, DC Metro, New York, and Pittsburgh chapters, is committed to being one of the most successful and distinguished private equity/angel investment organizations in the region.&nbsp; Our core team of angel investor members, sponsors and partners is growing every day, strengthening the chapter’s knowledge base and working together to <a href="/node/1" title="access quality investment opportunities">access quality investment opportunities</a> around the world.</p>\r\n\r\n<ul>\r\n	<li><a href="/node/2" title="How Keiretsu Forum Works">How Keiretsu Forum Works</a></li>\r\n	<li><a href="/node/3" title="Management">Management</a></li>\r\n	<li><a href="/node/4" title="Chapters">Chapters</a></li>\r\n	<li><a href="/node/46" title="Calendar Of Events">Calendar Of Events</a></li>\r\n	<li><a href="/node/5" title="Fellowship Program">Fellowship Program</a></li>\r\n	<li><a href="/node/6" title="Guest Policy">Guest Policy</a></li>\r\n	<li><a href="/node/7" title="Code Of Conduct">Code Of Conduct</a></li>\r\n	<li><a href="/node/8" title="Terms And Conditions">Terms And Conditions</a></li>\r\n	<li><a href="/node/9" title="Testimonials">Testimonials</a></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href="/node/45" target="_self"><img alt="EXTEND YOUR INVESTMENT REACH" src="https://hubspot-hubshot.s3.amazonaws.com/hubshot/prod/12/10/04/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" /></a></p>\r\n', '', 'full_html'),
('node', 'page', 0, 2, 2, 'und', 0, '<h1>Collaboration + Quality Deal Flow + Due Diligence</h1>\r\n\r\n<div id="inner-content">\r\n<h2>The Equation For Angel Investing Success</h2>\r\n\r\n<h3>KEIRETSU&rsquo;S KEY COMPONENTS</h3>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349719726861" src="/sites/default/files/angel-investing.jpg" style="float:right" />Keiretsu Forum&rsquo;s angel investing members benefit from <strong>collaborative relationships</strong> with industry experts who participate via <a href="/node/33" title="sponsorship or partnership">sponsorship or partnership</a>. These organizations include professional services firms, colleges and universities, incubators, commercial real estate firms, investment banking institutions and other private investors in angel investment groups, venture capital firms and private equity funds.</p>\r\n\r\n<p>These relationships facilitate <strong>quality deal flow</strong> -- providing the capital, talent, technology, expert guidance and resources needed to access <a href="/node/28" title="promising angel investment opportunities">promising angel investment opportunities</a> and build prosperous ventures.</p>\r\n\r\n<p>However, it is not sufficient to merely provide the resources, expertise and exciting new investment opportunities.&nbsp; Keiretsu Forum is dedicated to mitigating the risk of investments as much as possible -- from pre-screening and deal screening entrepreneurs before they are invited to present at a Forum meeting, to the <a href="/node/29" title="extensive due diligence phase">extensive <strong>due diligence</strong> phase</a>.</p>\r\n\r\n<h3>THE EIGHT-STEP PROCESS</h3>\r\n\r\n<ol>\r\n	<li><strong>Application:</strong> Companies and entrepreneurs who are interested in securing angel funding through Keiretsu Forum <a href="/node/45" title="fill out an application">fill out an application</a>.</li>\r\n	<li><strong>Pre-Screening:</strong> Applications are pre-screened by the appropriate committees, who select 7-10 companies to present at the Deal Screening.</li>\r\n	<li><strong>Deal Screening:</strong> The Deal Screening presentations are seven minutes long, followed by eight minutes of questions and answers. Three-to-five companies are chosen to present their stories and business plans in front of the full Forum.</li>\r\n	<li><strong>Presentations:</strong> At the Keiretsu Forum meeting, each company makes a 10-minute core presentation and then engages attending Forum members with 10 minutes of questions and answers.</li>\r\n	<li><strong>Interest List:</strong> After each entrepreneur presents, an interest list is signed by the individual members who are interested in the company.</li>\r\n	<li><strong>Discussion:</strong> Once all the presentations are concluded, entrepreneurs are excused and Forum members discuss the companies. This exchange of opinions is designed to open up investors&rsquo; eyes and minds to thoughts and ideas that had not occurred to them during the presentations.</li>\r\n	<li><strong>Due Diligence:</strong> The early stage or startup company enters into a comprehensive <a href="/node/29" title="six-week due diligence phase">six-week due diligence phase</a> with the angel investing members who signed the interest sheet at the Keiretsu Forum meeting. It is common for one or two members to take the lead in due diligence and negotiations with the company. While the members collaborate in the due diligence process, each one makes individual investment decisions.</li>\r\n	<li><strong>Multi-Chapter Investing:</strong> After a company sparks interest from investors in the chapter closest to it geographically, it has the unique opportunity to present at other chapters of its choosing -- broadening exposure to both expert advice and equity capital from Forum members. Members of each chapter conduct their own due diligence, sharing their reports with the entire <a href="/node/30" title="Global Investment Network">Global Investment Network</a> on <a href="/node/31" title="K4-DealRoom.com">K4-DealRoom.com</a>. This provides yet another collaborative, global-reach benefit of angel investing membership with Keiretsu Forum.</li>\r\n</ol>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 3, 3, 'und', 0, '<h1>Your Private Equity &amp; Business Management Experts</h1>\r\n\r\n<div>\r\n<h2>Here To Connect You To Innovative &amp; Earnest Entrepreneurs</h2>\r\n\r\n<h4>Introducing:</h4>\r\n\r\n<h3>Howard Lubert, Area President - Keiretsu Forum Mid-Atlantic</h3>\r\n\r\n<p><img alt="describe the image" class="alignRight" src="/sites/default/files/private-equity.jpg" style="float:right" />Howard Lubert is the founder and managing partner/senior analyst at SafeHatch LLC, a technical due diligence and business acceleration consultancy that supports startup and early stage technology companies. SafeHatch typically takes a senior management role in the portfolio companies it supports and works with them until they are prepared to complete their management teams with full-time employees.&nbsp; Business Acceleration services are provided for companies in many disciplines, but are usually focused in the Internet, e-business, security, SaaS, infrastructure, software, e-learning, mobile or wireless spheres.</p>\r\n\r\n<p>Mr. Lubert dedicated 28+ years to formalizing and optimizing the due diligence and deal flow processes for Safeguard Scientifics and its family of private equity funds, as well as other venture capital and angel investment groups.&nbsp; Lubert was also senior manager at Deloitte &amp; Touche, where he played a principal role in the development of the e-business consulting practice.</p>\r\n\r\n<h4>Areas Of Expertise:</h4>\r\n\r\n<ul>\r\n	<li>Technical Due Diligence</li>\r\n	<li>Business Acceleration</li>\r\n	<li>Business Remediation/Turnaround</li>\r\n</ul>\r\n\r\n<h4>Introducing:</h4>\r\n\r\n<h3>Vince Leusner, Area Vice President - Keiretsu Forum Mid-Atlantic</h3>\r\n\r\n<p>Vince Leusner helps businesses maximize value as a Philadelphia-based partner with B2B CFO®.&nbsp; As the largest CFO firm in the U.S., B2B CFO focuses on emerging and mid-market companies, with revenues of up to $75 million, that want to increase cash, profitability, sales and company value.</p>\r\n\r\n<p>Mr. Leusner has 27 years of financial management and financial advisory experience, working with publicly traded and privately held entities of all sizes.&nbsp; Vince has managed, advised and consulted with entities in North and South America, Europe and Asia.&nbsp; He worked for clients in a vast variety of industries, including services, media, financial services, retailing, distribution, public utilities, hospitality, manufacturing, not-for-profit and gaming.</p>\r\n\r\n<h4>Areas Of Expertise:</h4>\r\n\r\n<ul>\r\n	<li>Treasury/Cash Management</li>\r\n	<li>Financial Performance</li>\r\n	<li>Processes &amp; Procedures</li>\r\n	<li>Cost Effective Internal Controls</li>\r\n	<li>Financial Management, Financial Reporting, Budgeting &amp; Variance Analysis</li>\r\n</ul>\r\n\r\n<h4>Introducing:</h4>\r\n\r\n<h3>Jack Warnock, Area Vice President - Keiretsu Forum Mid-Atlantic</h3>\r\n\r\n<p>A serial entrepreneur, early stage company advisor, Mr. Warnock joined the K4-MA regional management team in January, 2014.&nbsp; An accredited investor, Jack brings extensive exterience in mergers &amp; acquisitions, joint ventures &amp; strategic alliances, governance and risk management, finance &amp; operations, management &amp; due diligence, and succession planning to the K4 network.&nbsp; Jack was a CPA at Arthur Andersen, CFO at FTP Software, Thinking Machines, and Towers &amp; Perrin Administration Solutions, M&amp;A at Verizon (Bell Atlantic), Office Managing Partner at Tatum, Business Consulting &amp; Development at Smart Devine, Co-founder at JW Strategic Advisors, McIsaac Risk Solutions and Safeguard Scientifics (Bridge Tech Partners), Investment Banker at W.H. Newbold’s, and currently serves on the Board of Directors at C. W. Thomas.</p>\r\nAreas Of Expertise:\r\n\r\n<ul>\r\n	<li>Corporate Management &amp; Development</li>\r\n	<li>Finance, Operations, Strategic Inititatives</li>\r\n	<li>University Tech Transfer</li>\r\n	<li>Market &amp; Technical Due Diligence</li>\r\n</ul>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'filtered_html'),
('node', 'page', 0, 4, 4, 'und', 0, '<h1>Angel Investment Network For The Mid-Atlantic Region</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Global Investment Opportunities At Your Local Convenience</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" src="/sites/default/files/angel-investment-network.jpg" style="float:right" />Keiretsu Forum Mid-Atlantic, established in 2011, consists of chapters in Philadelphia, Metro Washington, D.C.,&nbsp; Pittsburgh, and New York.</p>\r\n\r\n<h3>Keiretsu Forum - Philadelphia:</h3>\r\n\r\n<p>Keiretsu Forum Philadelphia opened in March, 2011 and holds its Forum meetings at the Law Offices of Woodcock Washburn, the Philadelphia Host Sponsor:</p>\r\n\r\n<p>The Cira Center<br />\r\n2929 Arch Street, 12th Floor<br />\r\nPhiladelphia, PA 19104<br />\r\n<a href="https://maps.google.com/maps?oi=map&amp;q=2929+Arch+St,+Philadelphia,+PA+19103" target="_self" title="Google Map">Google Map</a></p>\r\n\r\n<p>Chapter President Chuck Carter can be reached at (215) 233-0342.</p>\r\n\r\n<h3>Keiretsu Forum - DC Metro:</h3>\r\n\r\n<p>Keiretsu Forum DC Metro held its first meeting in July 2011 and meets monthly at the offices of its host sponsor, CohnReznick:</p>\r\n\r\n<p>7501 Wisconsin Avenue, Suite 400E<br />\r\nBethesda, MD 20814-6583<br />\r\n<a href="https://maps.google.com/maps?q=7501+Wisconsin+Avenue+Suite+400E+Bethesda,+MD+20814-6583&amp;oe=utf-8&amp;client=firefox-a&amp;ie=UTF-8&amp;hq=&amp;hnear=0x89b7c96530455f77:0xb40c8cf637d47e23,7501+Wisconsin+Ave+%23400e,+Bethesda,+MD+20814&amp;gl=us&amp;ei=oCrVTpKjKKby0gGyo5WZAg&amp;oi=geocode_result&amp;ved=0CB4Q8gEwAA" target="_blank" title="Google Map">Google Map</a></p>\r\n\r\n<p>Chapter President Richard Greene can be reached at (301) 280-3074.</p>\r\n\r\n<h3>Keiretsu Forum - New York:</h3>\r\n\r\n<p>Keiretsu Forum New York became a part of the Mid-Atlantic Region in March, 2013 and hold''s it''s meetings in Manhattan at the offices of its host sponsor, Loeb &amp; Loeb meetings:</p>\r\n\r\n<p>345 Park Avenue<br />\r\nNew York, NY 10154<br />\r\n<a href="https://maps.google.com/maps?q=7501+Wisconsin+Avenue+Suite+400E+Bethesda,+MD+20814-6583&amp;oe=utf-8&amp;client=firefox-a&amp;ie=UTF-8&amp;hq=&amp;hnear=0x89b7c96530455f77:0xb40c8cf637d47e23,7501+Wisconsin+Ave+%23400e,+Bethesda,+MD+20814&amp;gl=us&amp;ei=oCrVTpKjKKby0gGyo5WZAg&amp;oi=geocode_result&amp;ved=0CB4Q8gEwAA" target="_blank" title="Google Map">Google Map</a></p>\r\n\r\n<p>Chapter President Charles Albanese can be reached at (201) 848-1082<br />\r\nEleanor Hass, EVP of Business Development can be reached at (212) 421-5257</p>\r\n\r\n<h3>Keiretsu Forum - Pittsburgh:</h3>\r\n\r\n<p>The Pittsburgh chapter joined the Mid-Atlantic Region in March, 2012. It holds monthly Forum meetings at the offices of its host sponsor, Schnader Harrison Segal &amp; Lewis LLP:</p>\r\n\r\n<p>Fifth Avenue Place‎<br />\r\n120 Fifth Ave, Suite 2700<br />\r\nPittsburgh, PA 15222-3001<br />\r\n<a href="https://maps.google.com/maps?hl=en&amp;ie=UTF-8&amp;q=schnader+harrison+fifth+avenue+place+120+fifth+avenue+suite+2700,+pittsburgh&amp;fb=1&amp;gl=us&amp;hq=schnader+harrison+fifth+avenue+place+120+fifth+avenue+suite+2700,&amp;hnear=0x8834f16f48068503:0x8df915a15aa21b34,Pittsburgh,+PA&amp;cid=0,0,4402471530874218397&amp;ei=iFgEUJGEH8Pf0gGN6YSzBw&amp;ved=0CHkQ_BIwBA&amp;oi=local_group" target="_blank" title="» Google Map">Google Map</a></p>\r\n\r\n<p>Chapter President Malcolm Handelsman can be reached at (412) 859-8008.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 5, 5, 'und', 0, '<h1>Angel Investment That Makes A Difference</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Giving Students Real World Knowledge And Experience</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" src="/sites/default/files/angel-investment-2.jpg" style="float:right" />Keiretsu Forum Mid-Atlantic is proud of the quality angel investment opportunities that it provides its angel investor members.&nbsp; It’s proud of its provision of quality deal flow, made possible by an <a href="/node/33" title="extensive sponsorship network">extensive sponsorship network</a> of industry experts, its commitment to <a href="/node/28" title="attracting, screening and guiding">attracting, screening and guiding</a> innovative entrepreneurs and its dedication to <a href="/node/29" title="methodical due diligence">methodical due diligence</a>.</p>\r\n\r\n<p>We’re also proud of our <strong>Due Diligence Fellowship Program</strong>, which is the first program of its type to be established.&nbsp; Initiated in the Philadelphia Chapter, the program recruits local law &amp; MBA students to engage in the due diligence process.&nbsp; This not only helps them fulfill their fellowship requirements, but the program also establishes mutually beneficial relationships between the students and Keiretsu’s investors and entrepreneurs.</p>\r\n\r\n<p>The Fellows attend the monthly screening and Forum meetings held in Philadelphia, where they observe the entrepreneurs’ presentations and participate in the discussions with the chapter’s investors.&nbsp; The students then indicate which projects interest them and are assigned to a due diligence team led by one of the investors.&nbsp; Over the next few weeks, the students assist with the due diligence process.</p>\r\n\r\n<p>President Howard Lubert also conducts a workshop to teach the students the rigorous due diligence process that Keiretsu Forum follows.&nbsp; The students also receive continuous training and feedback from the due diligence team members and the chapter leaders throughout the program.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 6, 6, 'und', 0, '<h1>Keiretsu Forum Mid-Atlantic Welcomes &amp; Encourages Its Guests</h1>\r\n\r\n<div id="inner-content">\r\n<h2>From Future Presenters To Private Equity Investors And Potential Sponsors</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" src="/sites/default/files/private-equity-investors.jpg" style="float:right" />Guests are welcome and encouraged to attend Keiretsu Forum Philadelphia, DC Metro and Pittsburgh meetings.</p>\r\n\r\n<h3>THREE MAIN RULES</h3>\r\n\r\n<ol>\r\n	<li>Only those who are invited by a Keiretsu Forum member or team member are able to attend</li>\r\n	<li>Must complete pre-registration before the meeting</li>\r\n	<li>Guests may attend no more than two meetings before applying for membership or submitting a request for their company to present</li>\r\n</ol>\r\n\r\n<h3>WHO ARE OUR GUESTS?</h3>\r\n\r\n<p>A guest is:</p>\r\n\r\n<ul>\r\n	<li><a href="/node/21" title="A future presenter">A future presenter</a></li>\r\n	<li>An active private equity investor and/or <a href="/node/19" title="potential member">potential member</a></li>\r\n	<li>A <a href="/node/33" title="potential sponsor">potential sponsor</a> or chapter partner</li>\r\n</ul>\r\n\r\n<p>We also actively seek out college and university students <a href="/node/21" target="_self" title="interested in Entrepreneurship">interested in Entrepreneurship</a>.</p>\r\n\r\n<h3>GUEST ETIQUETTE</h3>\r\n\r\n<p><strong>Respect:</strong><br />\r\nBecause Keiretsu Forum Mid-Atlantic values everyone’s participation and each speaker’s time, we highly encourage that guests stay for the entire meeting.</p>\r\n\r\n<p><strong>Participation:</strong><br />\r\nWe also encourage “mind share,” discussions on the facilitated topics for mutual edification and expansion of each attendee’s personal opinions and ideas.</p>\r\n\r\n<p><strong>Devices:</strong><br />\r\nTo support our meeting objectives, please turn off your communication devices. They interfere with both the presentations and our sound system.</p>\r\n\r\n<p><strong>Non-Solicitation:</strong><br />\r\nTo ensure a positive experience for all, guests may not solicit presenting candidates and/or K4 members. Anyone who violates this policy will be asked to leave the meeting immediately.</p>\r\n\r\n<p><strong>Business Cards:</strong><br />\r\nWe are a community of angel investors and innovative entrepreneurs with common passions, not a convenient networking group.&nbsp; We welcome information exchange in an atmosphere of discovery that builds community and connections, but please exercise discretion with business card distribution by waiting until you are asked.</p>\r\n\r\n<h3>THE DETAILS</h3>\r\n\r\n<p><strong>Meeting Composition:</strong><br />\r\nThe overall Keiretsu Forum membership profile consists of:</p>\r\n\r\n<ul>\r\n	<li>80% SEC-accredited individual private equity investors</li>\r\n	<li>10% venture capital investors who are also accredited individual investors</li>\r\n	<li>5% <a href="/node/33" title="sponsor organizations">sponsor organizations</a></li>\r\n	<li>5% Forum resource members who are, first and foremost, active accredited investors</li>\r\n</ul>\r\n\r\n<p><strong>Forum Introductions:</strong><br />\r\nDuring the Forum meetings, there are brief introductions between presentations and all attendees are given an opportunity to participate.&nbsp; We suggest that you be prepared to deliver a brief 30-second vignette addressing your personal and business-related passions and goals.</p>\r\n\r\n<p>We hope to see you at a Forum meeting soon! Reference our <a href="calendar-of-events" title="Calendar of Events">Calendar of Events</a> for one that’s convenient for you.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 7, 7, 'und', 0, '<h1>Code Of Conduct Regarding Investments Offered At The Keiretsu Forum</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Establishing Respectful Business Between Angel Investors &amp; Entrepreneurs</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" src="/sites/default/files/angel-investors.jpg" style="float:right" />Keiretsu Forum arranges meetings between Entrepreneurs and potential Members (Investors).&nbsp; Those Entrepreneurs may be considering conducting private offerings of their equity in which the Member (Investor) may want to consider investing.&nbsp; Under securities law, Entrepreneurs conducting private offerings of their securities must observe various requirements, including that private offering may not involve any advertising or general solicitation.</p>\r\n\r\n<p>Keiretsu Forum and Entrepreneurs that attend its meetings do not conduct any advertising or general solicitation.&nbsp; Keiretsu Forum Members (Investors) that attend meetings and that might want to invest in any Entrepreneurs must have demonstrated appropriate qualifications and must agree to the following terms:</p>\r\n\r\n<ol>\r\n	<li>Member (Investor) agrees that any invitation to Keiretsu Forum that a Member (Investor) may receive is personal to the Member (Investor) and the Member (Investor) will not invite anyone else to attend, whether in addition to or instead of Member (Investor). If you desire to introduce any other potential Member (Investor) to Keiretsu Forum, please contact the Keiretsu Forum in advance.</li>\r\n	<li>Member (Investor) understands that Member (Investor) may learn of private offerings through the Keiretsu Forum. These private offerings are subject to state and federal securities laws, which prohibit, among other things, the communication or retransmission to anyone of information received by Member (Investor) from Entrepreneurs through Keiretsu Forum.&nbsp; <strong>Such information is for the sole use of Member (Investor) and may not be reviewed by or shared with others.</strong>&nbsp; To the extent necessary, Entrepreneurs may separately provide information to Member (Investor) and to Member (Investor)’s legal, tax and investment decisions.</li>\r\n	<li>Member (Investor) understands that Keiretsu Forum has not reviewed any information about Entrepreneurs that are represented at its meetings.&nbsp; Member (Investor) will not rely on Keiretsu Forum for any such review.&nbsp; Keiretsu Forum makes no representations or warranties about any Entrepreneur, express or implied.&nbsp; Member (Investor) understands that Member (Investor) is solely responsible for Member (Investor)’s own due diligence investigation of any Entrepreneur before deciding to invest in that Entrepreneur.</li>\r\n	<li>Member (Investor) understands that all negotiations concerning investments (including price, percentage ownership interest and other terms) will take place directly between Member (Investor) and Entrepreneurs and that Keiretsu Forum is not acting as an agent or principal or in any other capacity in those negotiations or transactions.</li>\r\n	<li>Member (Investor) understands that Keiretsu Forum is not an investment adviser or underwriter for Member (Investor) for any Entrepreneur and that Keiretsu Forum takes no responsibility for the accuracy or completeness of any information about any Entrepreneur communicated to Member (Investor) by any means or by any person at any time.</li>\r\n	<li>Member (Investor) understands that, due to SEC regulations, Member (Investor) may not be able to review certain Entrepreneurs represented at prior Keiretsu Forum Meetings. Member (Investor) may also not be able to view certain Entrepreneurs until 45 days after Keiretsu Forum receives this completed and signed questionnaire.</li>\r\n	<li>Member (Investor) understands that if the Entrepreneur wants Member (Investor) to agree to other restrictions on the use of the Entrepreneur’s confidential information, the Entrepreneur may require that Member (Investor) enter into a separate non-disclosure agreement before providing the confidential information.</li>\r\n	<li>Member (Investor) understands that investing in early stage, private companies involves extreme risk and should be considered only by Members (Investors) that can afford to lose their entire investment.</li>\r\n	<li>Member (Investor) understands that Keiretsu Forum is not a broker/dealer and may not sell, offer to sell or solicit an offer to buy any security. References to Keiretsu Forum include its U.S. affiliates and agents.</li>\r\n	<li>There is a no solicitation policy for members and guests at Keiretsu Forum Meetings and events and members agree not to use their membership for the purpose of soliciting business to their individual firms.</li>\r\n	<li>Member (Investor) should consult Member’s (Investor’s) own attorneys, accountants, investment advisers and other professional advisers when considering an investment.</li>\r\n</ol>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 8, 8, 'und', 0, '<h1>Terms &amp; Conditions For Presenting Entrepreneurs</h1>\r\n\r\n<div id="inner-content">\r\n<h2>To Access Angel Funding, Please Respect The Following</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" src="/sites/default/files/angel-funding.jpg" style="float:right" />Agreement with the following terms and conditions is required in order to present at our Keiretsu Forum Member meetings:</p>\r\n\r\n<h3>FEES</h3>\r\n\r\n<ul>\r\n	<li>There are no fees to submit an application, have your application documents pre-screened or to present at our Deal Screening meetings, if invited.</li>\r\n	<li>There is no fee for attendance at K4 Entrepreneur Workshops, should you choose to attend.</li>\r\n	<li>Companies selected to present at a Keiretsu Forum Member meeting must pay an administrative fee of $3,000 to present to all 4 chapters, which includes the video recording of your presentation at the Forum Meeting and the hosting of the recording, along with your deal package, on <a href="/node/31" title="K4-DealRoom.com">K4-DealRoom.com</a>.</li>\r\n	<li>If you are invited into due diligence as a result of your presentation and member interest there may be fees for normal due diligence items such as background checks, high-level legal review of IP, etc. and you will be advised and will approve these expenses in advance.</li>\r\n</ul>\r\n\r\n<h3>PROCESS AND PROCEDURES</h3>\r\n\r\n<p>If you are selected to present at a Keiretsu Forum Member meeting, you agree to:</p>\r\n\r\n<ul>\r\n	<li>Provide all necessary presentation material according to the timelines indicated to you</li>\r\n	<li>Use the presentation approved at the Deal Screening meeting</li>\r\n</ul>\r\n\r\n<p>If you enter into a <a href="/node/29" title="due diligence process">due diligence process</a> with Keiretsu Forum Mid-Atlantic as a result of your presentation at a Keiretsu Forum Member Meeting, you agree to:</p>\r\n\r\n<ul>\r\n	<li>Provide all additional information requested in a timely and complete manner</li>\r\n	<li>Participate in meetings/conference calls as requested to respond to angel investor questions</li>\r\n	<li>Respond to terms sheet and/or funding agreements in a timely manner</li>\r\n</ul>\r\n\r\n<h3>ANGEL FUNDING OFFERED</h3>\r\n\r\n<p>If you receive funding as a result of your Keiretsu Forum Mid-Atlantic participation, you agree to:</p>\r\n\r\n<ul>\r\n	<li>Provide Keiretsu Forum with a copy of the investment documents/terms sheet and any other financial agreements supplied to the angel investors</li>\r\n	<li>Keep us informed of funding events as we track these locally, nationally and <a href="/node/30" title="internationally">internationally</a></li>\r\n</ul>\r\n\r\n<p>Thank you for adhering to our terms and conditions. By doing so, you prove that you value Keiretsu Forum’s commitment to quality angel investment opportunities and respectful business relationships.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 9, 9, 'und', 0, '<h1>An Angel Network Built On Quality Deal Flow</h1>\r\n\r\n<div id="inner-content">\r\n<h2>And Strategic Partnerships Founded On Respect</h2>\r\n\r\n<h3>Sponsor Testimonial:</h3>\r\n\r\n<p><em>"After spending significant time working with emerging growth companies during my career, I immediately recognized the value of importing K4 to Washington, D.C. and to allow my firm, Cozen O’Connor, to act as host sponsor.&nbsp; I was intrigued by Keiretsu’s model because the members collaborate to generate the best deal flow and carry out extensive due diligence.&nbsp; This model struck me as something that would be an outstanding advantage in the Washington, D.C. angel community -- incredibly helpful to both investors and entrepreneurs."</em><br />\r\n<strong>Louis M. Heidelberger, Esq.<br />\r\nMember of Cozen O''Connor</strong></p>\r\n\r\n<ul>\r\n	<li>Louis has been honored on a number of occasions for his contributions to the legal profession, being named a Best Lawyer in Intellectual Property every year since 1999 and a Best Lawyer in the Bay Area in Intellectual Property from 2003 to 2005.&nbsp; He is listed in Chambers as a Leading Lawyer in IP and was named a Super Lawyer in both Washington, D.C. and Pennsylvania. In 2011, he was elected as member of The Cosmos Club.</li>\r\n</ul>\r\n\r\n<h3>Entrepreneur Testimonial:</h3>\r\n\r\n<p><em>"Keiretsu Forum Mid-Atlantic takes a disciplined approach to deal screening, in-depth due diligence and investing, enabling companies to access a large group of sophisticated investors and enabling its members to access pre-qualified deal flow. The enthusiasm Savara received has been tremendous, and we are delighted at the level of Keiretsu Forum support as we work to advance our lead program through Phase II clinical development."</em><br />\r\n<strong>Robert Neville<br />\r\nChief Executive Officer of Savara Pharmaceuticals</strong></p>\r\n\r\n<ul>\r\n	<li>Rob has successfully started and run a number of companies and projects.&nbsp; Prior to Savara, Rob was founder and CEO of Evity, Inc., which he sold to BMC for $100m in 2000.&nbsp; Based on his work at Evity, Rob was honored as a finalist in the Ernst &amp; Young Entrepreneur of the Year award.</li>\r\n</ul>\r\n\r\n<h3>Investor Testimonial:</h3>\r\n\r\n<p><em>Keiretsu Forum Mid-Atlantic is unique because their investors are particularly savvy and their due diligence process is extremely rigorous."</em><br />\r\n<strong>Bernie Rudnick<br />\r\nMember of Keiretsu Mid-Atlantic</strong></p>\r\n\r\n<ul>\r\n	<li>With 36 years of experience in executive level strategy, finance and management, as well as substantial experience investing and guiding investments in entrepreneurial companies, Bernie has led capital formation totaling over $380M in the past six years and $3B over the last 15 years.&nbsp; He is a founding member and Chairman Emeritus of Mid-Atlantic Diamond Ventures within the Fox School of Business at Temple University.</li>\r\n</ul>\r\n\r\n<h3>Fellow Testimonial:</h3>\r\n\r\n<p><em>"Keiretsu Forum Mid-Atlantic offers a unique educational opportunity for law students.&nbsp; For those of us soon entering into the fields of emerging growth business and corporate law, understanding how investors evaluate companies is a critical component to becoming more effective advocates for our clients.&nbsp; The investors also find the program beneficial, appreciating help with conducting the exhaustive due diligence process."</em><br />\r\n<strong>Pat Bellow, Esq.<br />\r\nFormer Keiretsu Mid-Atlantic Fellow</strong></p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'event_calendar', 0, 11, 11, 'und', 0, '<h1>test event desc</h1>', '', 'full_html'),
('node', 'page', 0, 12, 12, 'und', 0, '<h1>Angel Investing 101: Power Up Your Knowledge</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Everything Investors &amp; Entrepreneurs Need To Know</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724823742" src="/sites/default/files/angel-investing-3.jpg" style="float:right" />Knowledge is power in pretty much every aspect of life, but especially when it comes to your business and angel investment decisions.&nbsp; Keiretsu Forum makes it easy for you to stay informed and up-to-date on everything going on in the world of private equity and startup business development.</p>\r\n\r\n<p>Power up your knowledge with the latest news, trends and developments in angel investing.&nbsp; Download free, instructional content on topics ranging from angel network selection to choosing the best investment opportunities with the lowest risk.&nbsp; Finally, attend educational courses designed for both private investors and entrepreneurs.</p>\r\n\r\n<ul>\r\n	<li><a href="/node/13" target="_self" title="News &amp; Articles">News &amp; Articles</a></li>\r\n	<li><a href="/node/14" target="_self" title="White Papers">Whitepapers</a></li>\r\n	<li><a href="/node/15" target="_self" title="Keiretsu Forum Entrepreneur Academy">Keiretsu Forum Entrepreneur Academy</a></li>\r\n	<li><a href="/node/16" target="_self" title="Keiretsu Forum Investor Academy">Keiretsu Forum Investor Academy</a></li>\r\n</ul>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 13, 13, 'und', 0, '<h1>Your Angel Network Keeps You Aware And Informed</h1>\r\n\r\n<div id="inner-content">\r\n<h2>The Greatest Articles And Latest Updates In The World Of Private Equity</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724849555" src="/sites/default/files/angel-network-3.jpg" style="float:right" />Browse through these articles and press releases to get the news and information that directly affects your angel investment decisions and startup business development.</p>\r\n\r\n<ol>\r\n	<li><a href="/sites/default/files/docs/How-Software-Entrepreneurs-can-be-Successful-Presenters-to-Investors.pdf" target="_blank" title="How Software Entrepreneurs can be Successful Presenters to Investors">How Software Entrepreneurs can be Successful Presenters to Investors</a></li>\r\n	<li><a href="/sites/default/files/docs/Angel-Investing-Worth-the-Effort-by-Geoff-Roach.pdf" target="_blank" title="Angel Investing - Worth the Effort? by Geoff Roach">Angel Investing - Worth the Effort? by Geoff Roach</a></li>\r\n	<li><a href="/sites/default/files/docs/What-Every-Entrepreneur-Should-Know-About-Angel-Investors.pdf" target="_blank" title="What Every Entrepreneur Should Know about Angel Investors">What Every Entrepreneur Should Know about Angel Investors</a></li>\r\n	<li><a href="/sites/default/files/docs/The-Keiretsu-Forum-Entrepreneur-Application-DealRoom-Process.pdf" target="_blank" title="The Entrepreneur''s Guide to the Keiretsu Forum Process">The Entrepreneur''s Guide to the Keiretsu Forum Process</a></li>\r\n	<li><a href="http://technicallyphilly.com/2012/10/25/keiretsu-forum-midatlantic-an-inside-look-at-the-local-angel-group-that-has-invested-3-4m-in-two-years" target="_blank" title="Keiretsu Forum Mid-Atlantic: An inside look at the local angel group that has invested $3.4M in two years">Keiretsu Forum Mid-Atlantic: An inside look at the local angel group that has invested $3.4M in two years</a></li>\r\n	<li><a href="/node/47" target="_blank" title="Sensible Investments: The Only Ones Worth Making">Sensible Investments: The Only Ones Worth Making</a></li>\r\n	<li><a href="/node/48" target="_blank" title="The Risks And Rewards Of Investing In Foreign Companies">The Risks And Rewards Of Investing In Foreign Companies</a></li>\r\n</ol>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 14, 14, 'und', 0, '<h1>Educational Content On Private Equity And Angel Investing</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Available At Your Convenience For Free Download</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724876740" src="/sites/default/files/private-equity-2.jpg" style="float:right" />If you’re serious about your angel investing and private equity pursuits, you want to get your hands on every piece of instructional and educational content available. Keiretsu Forum Mid-Atlantic understands your needs, so every time we publish a whitepaper or tip sheet on angel investment or startup development, this is where it will go.</p>\r\n\r\n<ul>\r\n	<li><a href="/node/49" target="_self" title="Seven Critical Questions To Ask When Selecting An Angel Investment Group">Seven Critical Questions To Ask When Selecting An Angel Investment Group</a></li>\r\n	<li><a href="/node/50" target="_self" title="Five Reasons To Consider Joining An Angel Investor Network">Five Reasons To Consider Joining An Angel Investor Network</a></li>\r\n	<li><a href="/node/51" target="_self" title="Three Things You Must Know About Angel Investment Groups Before Investing">Three Things You Must Know About Angel Investment Groups Before Investing</a></li>\r\n</ul>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 15, 15, 'und', 0, '<h1>Your Private Investors Offer Private Instruction</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Courses On Startup Planning From Business Experts</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724909093" src="/sites/default/files/private-investors.jpg" style="float:right" />The Keiretsu Forum Entrepreneur Academy was designed by the angel investor members of Keiretsu Forum to provide first-class course offerings.&nbsp; Each course, taught by seasoned industry executives, focuses on the critical elements of a startup company''s business plan.</p>\r\n\r\n<p>Academy courses may occur twice a year in person or via webinar and include:</p>\r\n\r\n<ol>\r\n	<li>CEO''s Roles &amp; Responsibilities</li>\r\n	<li>The Deal - Understanding Terms and Conditions and Financing Options</li>\r\n	<li>Protecting Intellectual Property</li>\r\n	<li>Avoiding Incorporation, Formation and Compensation Pitfalls &amp; Landmines</li>\r\n	<li>Sales &amp; Marketing</li>\r\n	<li>Accounting - Setting Up Books and Financial Projections</li>\r\n</ol>\r\n\r\n<p><a href="/node/45"><img alt="ENROLL IN ENTREPRENEUR ACADEMY" class="hs-cta-img" id="hs-cta-img-7c8cf4fe-8a6a-497a-9b0c-cd28c0139fe5" src="/sites/default/files/a4077289-7127-4dd5-85f0-3ca9890d4810.png" style="border-width:0px; height:33px; width:294px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 16, 16, 'und', 0, '<h1>Our Private Equity Investors Get Private Tutoring</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Enroll In The Academy &amp; Get Smart About Your Angel Investing</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724934872" src="/sites/default/files/private-equity-investors-3.jpg" style="float:right" />The Keiretsu Forum Academy for Investors was created in August 2004, by and for our angel investor members, to provide quality education and instruction on private equity investing.&nbsp; These half-day sessions are held monthly and are of tremendous value to anyone who is serious about investment opportunities.</p>\r\n\r\n<p>Previous courses taught at Keiretsu Forum Investor Academy include:</p>\r\n\r\n<ul>\r\n	<li>Beyond Investing</li>\r\n	<li>Investing in Oil and Gas Companies</li>\r\n	<li>Convertible Notes and Warrants</li>\r\n	<li>Legal Aspects of Angel Due Diligence</li>\r\n	<li>Deal Structuring</li>\r\n	<li>Micro Multi-Nationals: A New Global Startup</li>\r\n	<li>Early Stage Company Valuations</li>\r\n	<li>Negotiating Term Sheets</li>\r\n	<li>Financial Due Diligence for Angel Investors</li>\r\n	<li>Pitfalls of Angel Investing</li>\r\n	<li>How to Choose a Winning Management Team</li>\r\n	<li>Intellectual Property</li>\r\n	<li>Real Estate Investing 101</li>\r\n	<li>Investing in China</li>\r\n	<li>Stock Ownership, Value and Dilution</li>\r\n	<li>Investing in Distressed Markets</li>\r\n	<li>Structuring Real Estate Funds</li>\r\n</ul>\r\n\r\n<p><a href="/node/45"><img alt="ATTEND INVESTOR ACADEMY" class="hs-cta-img" id="hs-cta-img-29ca3cce-892a-4ee4-b4ec-9496c0c75270" src="/sites/default/files/bff66cfb-4f3a-46f7-8ba0-f24d23a56f34.png" style="border-width:0px; height:33px; width:232px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 17, 17, 'und', 0, '<h1>Keiretsu Forum Mid-Atlantic In The News</h1>\r\n\r\n<div id="inner-content">\r\n<h2>An Informed Investor Is A Smart Investor</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724876740" src="/sites/default/files/angel-investment-opportunities.jpg" style="float:right" />Keiretsu Forum Mid-Atlantic is keeping busy helping to make its region one of the most active in the angel investing community.&nbsp; Review our press releases to see our most recent achievements and activities.</p>\r\n\r\n<ul>\r\n	<li><a href="/sites/default/files/docs/Woodcock-Washburn.pdf" target="_blank" title="Keiretsu Forum Mid-Atlantic Philadelphia Chapter Announces Woodcock Washburn As New Host Sponsor  ">Keiretsu Forum Mid-Atlantic Philadelphia Chapter Announces Woodcock Washburn As New Host Sponsor </a></li>\r\n	<li><a href="/sites/default/files/docs/Keiretsu_pr_savara_v2.pdf" target="_blank" title="Keiretsu Forum Makes Its Largest Single Investment To Date In Savara Pharmaceuticals'' Recent Series B">Keiretsu Forum Makes Its Largest Single Investment To Date In Savara Pharmaceuticals'' Recent Series B</a></li>\r\n	<li><a href="/sites/default/files/docs/Keiretsu_pr_CourageBizAdvisors_v2.pdf" target="_blank" title="Keiretsu Forum Mid-Atlantic Announces CEO Coaching Partnership with Courage International Business Advisors">Keiretsu Forum Mid-Atlantic Announces CEO Coaching Partnership with Courage International Business Advisors</a></li>\r\n	<li><a href="/sites/default/files/docs/Keiretsu-Forum-Welcomes-New-MidAtlantic-Chapter-President.pdf" target="_blank" title="Keiretsu Forum Welcomes New Mid-Atlantic Chapter President">Keiretsu Forum Welcomes New Mid-Atlantic Chapter President</a></li>\r\n	<li><a href="/sites/default/files/docs/Keiretsu-Forum-Mid-Atlantic-Establishes-Due-Diligence-Fellowship-Program.pdf" target="_blank" title="Keiretsu Forum Mid-Atlantic Establishes Due Diligence Fellowship Program">Keiretsu Forum Mid-Atlantic Establishes Due Diligence Fellowship Program</a></li>\r\n	<li><a href="/sites/default/files/docs/Keiretsu-Forum-Gives-New-Wings-To-Angel-Investing-In-The-Mid-Atlantic-Region.pdf" target="_blank" title="Keiretsu Forum Gives New Wings To Angel Investing In The Mid-Atlantic Region">Keiretsu Forum Gives New Wings To Angel Investing In The Mid-Atlantic Region</a></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html');
INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 18, 18, 'und', 0, '<h1>Your Global Investment Opportunities Await</h1>\r\n\r\n<div id="inner-content">\r\n<h2>As An Angel Investor With Keiretsu Forum Mid-Atlantic</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349720116164" src="/sites/default/files/angel-investor.jpg" style="float:right" />Membership in Keiretsu Forum Mid-Atlantic Chapters is by invitation only.&nbsp; This invitation is extended to individuals who share Keiretsu Forum’s value for innovation, commitment to collaboration, enthusiasm for ethics, devotion to diligence and spirit for social consciousness.</p>\r\n\r\n<h3>The Keiretsu Forum Mid-Atlantic Member Mantra</h3>\r\n\r\n<p><em>You value the <strong>innovative</strong> visions of inspired entrepreneurs.&nbsp; You respect their ambition and intend to build relationships with those you help fund -- fortifying their business pursuits with not only your monetary investment, but also your expert guidance.</em></p>\r\n\r\n<p><em>You respect your chapter’s sponsors, partners and fellow angel investors, <strong>collaborating</strong> to achieve quality, diverse investment opportunities around the world.</em></p>\r\n\r\n<p><em>When making business decisions, <strong>ethics</strong> play a crucial role -- always.&nbsp; Your reputation as an honest and trusted member of the Keiretsu community is of utmost importance to you.</em></p>\r\n\r\n<p><em>You take risks, but only those that have been thoroughly calculated with extensive <strong>due diligence</strong>.</em></p>\r\n\r\n<p><em>You have an intrinsic drive to build relationships, broaden your perspective and strengthen your <strong>social consciousness</strong> by participating in social events and charitable activities.</em></p>\r\n\r\n<p>A Keiretsu Forum member complies with the legal definition of an <em>accredited investor</em>, as defined in <a href="http://www.sec.gov/answers/accred.htm" target="_blank" title="Regulation D - Rule 501 of the Securities Act of 1933">Regulation D - Rule 501 of the Securities Act of 1933</a>.&nbsp; He or she has also read and signed the Keiretsu Forum <a href="/node/7" target="_self" title="Code of Conduct">Code of Conduct</a>.</p>\r\n\r\n<p>There are two categories of angel investor membership in Keiretsu Forum Mid-Atlantic:</p>\r\n\r\n<ul>\r\n	<li>Individual accredited investors, which make up 80% of the Forum.</li>\r\n	<li>Corporate investors, accredited venture capital investors and private equity funds, which make up about 10% of the Forum.</li>\r\n	<li>The remainder of the Forum is comprised of 5% <a href="/node/33" target="_self" title="sponsor organizations">sponsor organizations</a> and 5% partners, service providers and accredited investor resource members.</li>\r\n</ul>\r\n\r\n<p>The membership fee for investors is $3,000.&nbsp; Founding Memberships (limited to 20) at each Chapter may be available at an annual rate of $1,500.</p>\r\n\r\n<ul>\r\n	<li><a href="/node/19" target="_self" title="Benefits Of Membership">Benefits Of Membership</a></li>\r\n	<li><a href="/node/20" target="_self" title="How To Apply">How To Apply</a></li>\r\n</ul>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 19, 19, 'und', 0, '<h1>Your Angel Investing Benefits With Keiretsu Forum</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Glorified To A Global Degree -- Just Like Your Investment Opportunities</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349720146020" src="/sites/default/files/angel-investing-2.jpg" style="float:right; height:186px; width:190px" />As an active, accredited private equity investor and member of Keiretsu Forum Mid-Atlantic, you are entitled to the following benefits:</p>\r\n\r\n<ul>\r\n	<li>Access to a <a href="/node/32" target="_self" title="broad network of innovative entrepreneurs">broad network of innovative entrepreneurs</a> with solid business plans and a deep desire to work with sincere angel investors</li>\r\n	<li>Participation in the extensive screening of these <a href="/node/28" target="_self" title="investment opportunities">investment opportunities</a> at the monthly Deal Screening and Keiretsu Forum meetings</li>\r\n	<li>Opportunity to perform <a href="/node/29" target="_self" title="extensive due diligence">extensive due diligence</a> into the investment opportunities you’re interested in pursuing</li>\r\n	<li>Robust relationships with <a href="/node/33" target="_self" title="sponsors">sponsors</a> -- experts, service providers, resource members and thought leaders -- in the industries that directly affect yours</li>\r\n	<li><a href="/node/30" target="_self" title="Global investment opportunities">Global investment opportunities</a> and collaborative business relationships with private equity investors and entrepreneurs around the world</li>\r\n	<li>Free, unlimited online access to due diligence reports of <a href="/node/31" target="_self" title="carefully vetted investment opportunities">carefully vetted investment opportunities</a> across Keiretsu Forum’s 26 global chapters</li>\r\n	<li>Wide range of charitable activities and social events that strengthen your social consciousness and build reliable, trustworthy relationships with fellow business professionals</li>\r\n	<li>Opportunity to serve as a mentor to passionate students through our <a href="/node/5" target="_self" title="Fellowship Program">Fellowship Program</a></li>\r\n	<li>Active involvement in the Keiretsu Forum Committee System, which is comprised of experts in various professions who provide leadership in screening committees and on due diligence projects</li>\r\n</ul>\r\n\r\n<p><em>NOTE:</em> Keiretsu Forum Mid-Atlantic Chapters are not investment funds.&nbsp; Members make their own individual investment decisions.&nbsp; All Members agree to abide by the <a href="/node/7" target="_self" title="Code of Conduct">Code of Conduct</a> of Keiretsu Forum.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 20, 20, 'und', 0, '<h1>Globalize And Maximize Your Investment Opportunities</h1>\r\n\r\n<div id="inner-content">\r\n<h2>As A Member Of Keiretsu Forum Mid-Atlantic Region</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349720174461" src="/sites/default/files/angel-investment-3.jpg" style="float:right" />If you’re interested in becoming a member of Keiretsu Forum Mid-Atlantic -- in the Philadelphia, DC Metro, New York, or Pittsburgh chapters -- please complete the form by clicking the button below.&nbsp; A representative will respond to your request within 48 hours of your form’s submission.</p>\r\n\r\n<p><em>NOTE:</em> Keiretsu Forum Mid-Atlantic Chapters are not investment funds.&nbsp; Members make their own individual investment decisions.&nbsp; All Members agree to abide by the <a href="/node/7" target="_self" title="Code of Conduct">Code of Conduct</a> of Keiretsu Forum.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 21, 21, 'und', 0, '<h1>Your Business Investors Are Ready To Invest</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Is Your Business Ready To Grow?</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724438106" src="/sites/default/files/business-investors.jpg" style="float:right" />The Keiretsu Forum Mid-Atlantic chapters are unique in the K4 chapter family.&nbsp; Just like the rest of the K4 chapters, they offer robust angel funding, private equity investors and business acceleration guidance to A &amp; B round companies.&nbsp; But the Philadelphia, New York, Metro Washington, D.C. and Pittsburgh chapters go a step further, offering their services to startup entities that are ready to engage outside mentors, supporters, and angel investors.</p>\r\n\r\n<p>The private equity landscape of the Mid-Atlantic region is heavily populated with early stage and startup companies.&nbsp; The K4 Mid-Atlantic chapters make it a point to seek out partners who specialize in early stage deals -- ensuring that our members have access to an exceptional mix of early stage investment opportunities from presenting companies.</p>\r\n\r\n<p>Who are we looking for to join our impressive and innovative team of entrepreneurs?</p>\r\n\r\n<h3>SERIOUS ENTREPRENEURS WITH SERIOUS PLANS</h3>\r\n\r\n<p>We are not looking for business plans scribbled on napkins, nor are we interested in engaging with an individual who is barely out of the idea phase.&nbsp; To clarify what we’re looking for, we like to reference a fundamental concept from one of the K4 Mid-Atlantic’s core businesses, <a href="http://www.safehatch.com/" target="_blank" title="SafeHatch">SafeHatch</a>:</p>\r\n\r\n<ul>\r\n	<li>Based on more than 20 years of technical due diligence on thousands of business plans and companies looking for funding, <a href="/node/3" target="_self" title="Mr. Lubert">Mr. Lubert</a>, the founder and managing partner of SafeHatch and Area President of the Mid-Atlantic Region, developed the SafeHatch Due Diligence Model.&nbsp; It provides a simple analogy for what you need in a successful business plan.</li>\r\n	<li>The analogy relates your business concept and plan with a three-legged stool.&nbsp; The three legs of the stool, in order of importance, are People, Plan and Technology.&nbsp; These legs need not be the same length or girth, but they <em>do</em> need to be individually strong enough to hold up the stool.&nbsp; The only way this is possible is if the legs are joined and supported by the seat on top, which represents the marketplace.</li>\r\n</ul>\r\n\r\n<p>It is impossible for a business venture to succeed if all of these areas are not addressed.&nbsp; Is your concept bolstered by strong people, a strong plan and strong technology?&nbsp; Is it supported by the current marketplace?&nbsp; If so, you’re the type of entrepreneur we welcome into our angel investment network.&nbsp; Please consider applying to present your business concept to Keiretsu Forum Mid-Atlantic!</p>\r\n\r\n<h4>Additional Details</h4>\r\n\r\n<p>Keiretsu members understand that searching for funding can be a daunting process to even the most experienced entrepreneur.&nbsp; To get a better understanding of the process, we encourage companies interested in presenting to attend a <a href="/node/46" target="_self" title="Forum Meeting">Forum Meeting</a> at a local chapter prior to applying.</p>\r\n\r\n<p>Companies that apply to Keiretsu Forum are typically in their A or B rounds, usually with $500k to $1.5m friends’ and family investments.</p>\r\n\r\n<p>Forum members invest in high-quality, diverse investment opportunities in a wealth of industries, including automation &amp; instrumentation, consumer products, energy, financing, food &amp; beverage, health care/life sciences, Internet-related, real estate, services, social ventures, software, telecommunications and any segment with high growth potential.</p>\r\n\r\n<ul>\r\n	<li><a href="/node/22" target="_self" title="Selection &amp; Application Process For Entrepreneurs">Selection &amp; Application Process For Entrepreneurs</a></li>\r\n	<li><a href="/node/34" target="_self" title="PayPal Account">PayPal Account</a></li>\r\n</ul>\r\n\r\n<p>To apply to present your business, click the button below.</p>\r\n\r\n<p><a href="/node/45"><img alt="GROW YOUR BUSINESS WITH KEIRETSU" class="hs-cta-img" id="hs-cta-img-cb100c98-c8cf-47e5-9235-12841f95aa33" src="/sites/default/files/36ffc44f-5843-420b-8a64-8c221a6e0bf4.png" style="border-width:0px; height:33px; width:308px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 22, 22, 'und', 0, '<h1>Grow Your Business With Angel Funding</h1>\r\n\r\n<div id="inner-content">\r\n<h2>The Selection Process And Application</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724487597" src="/sites/default/files/angel-funding-2.jpg" style="float:right" />Before applying to present, we recommend that you 1) read the <a href="/node/13" target="_self" title="article on how to make a successful presentation">article on how to make a successful presentation</a> from Ed Harley, chair emeritus of the Keiretsu Forum Software Committee, and 2) attend a <a href="/node/46" target="_self" title="Forum meeting">Forum meeting</a> at your local K4 Mid-Atlantic Chapter.</p>\r\n\r\n<p>The eight-step process of selecting companies that present to Keiretsu Forum includes the following:</p>\r\n\r\n<ol>\r\n	<li><strong>Application:</strong> Companies and entrepreneurs who are interested in securing angel funding through Keiretsu Forum fill out an application [see below].</li>\r\n	<li><strong>Pre-Screening:</strong> Applications are pre-screened by the appropriate committees, who select 7-10 companies to present at the Deal Screening.</li>\r\n	<li><strong>Deal Screening:</strong> The Deal Screening presentations are twelve minutes long, followed by eight minutes of questions and answers.&nbsp; Three to five companies are chosen to present their stories and business plans in front of the full Forum.</li>\r\n	<li><strong>Presentations:</strong> At the Keiretsu Forum meeting, each company makes a 10-12 minute core presentation and then engages attending Forum members with 8-10 minutes of questions and answers.</li>\r\n	<li><strong>Interest List:</strong> After each entrepreneur presents, an interest list is signed by the angel investor members who are interested in the company.</li>\r\n	<li><strong>Discussion:</strong> Once all the presentations are concluded, entrepreneurs are excused and Forum members discuss the companies.&nbsp; This exchange of opinions is designed to open up investors’ eyes and minds to thoughts and ideas that had not occurred to them during the presentations.</li>\r\n	<li><strong>Due Diligence:</strong> The early stage or startup company enters into a comprehensive <a href="/node/29" target="_self" title="six-week due diligence phase">six-eight week due diligence phase</a> with the angel investing members who signed the interest sheet at the Forum Meeting.&nbsp; It is common for one or two members to take the lead in due diligence and negotiations with the company.&nbsp; While the members collaborate in the due diligence process, each one makes individual investment decisions.</li>\r\n	<li><strong>Multi-Chapter Investing:</strong> After a company sparks interest from investors in the chapter closest geographically, it has the unique opportunity to present at other chapters of its choosing -- broadening exposure to both expert advice and equity capital from Forum members.&nbsp; Members of each chapter conduct their own due diligence, sharing their reports with the entire <a href="/node/30" target="_self" title="Global Investment Network">Global Investment Network</a> on <a href="/node/31" target="_self" title="K4-DealRoom.com">K4-DealRoom.com</a>.&nbsp; This provides the global-reach benefit of procuring your angel funding through Keiretsu Forum.</li>\r\n</ol>\r\n\r\n<h4>Fees For Presenting Entrepreneurs</h4>\r\n\r\n<p>There is never a fee to apply or participate in the Keiretsu Forum Mid-Atlantic Screening Process.&nbsp; If you are invited to participate in our Forum meetings, there is currently a $3,500 administrative fee to help cover the costs of running our meetings and chapters.&nbsp; This is the only fee you’ll face from Keiretsu Forum* -- we are not broker-dealers and do not solicit success fees upon funding.</p>\r\n\r\n<ul>\r\n	<li><em>NOTE:</em> If you are selected by our members for due diligence there are standard charges for background checks, DD Fellows stipends, and legal review fees.&nbsp; Legal fees for terms sheet reviews and IP overview, if appropriate, are contingent upon funding.</li>\r\n</ul>\r\n\r\n<h4>Confidentiality</h4>\r\n\r\n<p>Keiretsu Forum Chapters do not typically sign non-disclosure agreements.&nbsp; Therefore, executive summaries and other supporting documents submitted to Keiretsu Forum for consideration will <em>not</em> be treated as confidential -- <em>even if marked confidential</em>.&nbsp; Please only include information that you are comfortable sharing under these terms.</p>\r\n\r\n<p>To apply to present your business, click the button below.</p>\r\n\r\n<p><a href="/node/45" target="_blank"><img alt="VISIT THE K4 DealRoom" class="hs-cta-img" id="hs-cta-img-9fbab6c8-24ef-4086-9f73-07fa36720cea" src="/sites/default/files/e1ab8bd5-4093-4515-aa86-e15f78cc8dbb.png" style="border-width:0px; height:33px; width:183px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 23, 23, 'und', 0, '<h1>A Note on the SEC 506(c) General Solicitation Ruling</h1>\r\n\r\n<div id="inner-content">\r\n<table border="0" cellpadding="0" cellspacing="0">\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;<img alt="describe the image" id="img-1388069759584" src="/sites/default/files/k4-lapelpinfinal3-100px.jpg" style="height:105px; width:73px" /></td>\r\n			<td>\r\n			<p><strong>&nbsp;</strong></p>\r\n\r\n			<h2><strong>&nbsp;</strong><strong>To: </strong><strong>&nbsp;</strong><strong>Entrepreneurs Applying</strong><br />\r\n			<strong>for Funding</strong></h2>\r\n\r\n			<h2><strong>&nbsp;&nbsp; Re:&nbsp; SEC Rule 506(c) – Effective 9/23/13</strong></h2>\r\n\r\n			<p><strong>&nbsp;</strong></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Keiretsu Forum Mid-Atlantic is dedicated to the support of early stage entrepreneurs through education, mentoring and investment.&nbsp; Early stage innovation is the engine of job creation in our economy. &nbsp;We welcome entrepreneurs’ applications for funding, and want to explain our policy in regard to companies using general solicitation for accredited investors, and our requirement that entrepreneurs (issuers) use the prescribed “principles‐based methodology” (PBM) to verify our accredited investor members.&nbsp;</p>\r\n\r\n<p>Securities and Exchange Commission (SEC) Rule 506(c), effective September 23, 2013, allows companies to generally advertise or solicit investors. &nbsp;This is a major change in the 80‐year history of securities law, and will impact most early‐stage companies and their investors. &nbsp;The term “general solicitation” is not precisely defined in SEC regulations, but has been deemed to include:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>any advertisement, article, notice, or other communication published in any newspaper, magazine, or similar media or broadcast over television and radio (includes internet); and</p>\r\n	</li>\r\n	<li>\r\n	<p>any seminar or meeting whose attendees have been invited by any general solicitation/advertising.<span style="font-size:13px">&nbsp;</span></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>If an entrepreneur participates in any such activities – including publicly advertised events such as demo days, pitch competitions, etc. – general solicitation may be deemed to have occurred. &nbsp;In addition, we recognize some companies will want to proactively advertise for investors through social media or other general outlets, to broaden their access to capital.&nbsp;</p>\r\n\r\n<p>We also recognize that some applicants will assert they are seeking funding under Rule 506(b), which prohibits the use of general solicitation, and allows accredited investors to self‐certify as has always been done. &nbsp;We welcome all applicants, but are concerned that even the most “quiet” of offerings may inadvertently slip into the general advertising category. &nbsp;The penalties for failing to meet all requirements of 506(c) are extremely onerous and in the worst case could require a deal to be unwound.&nbsp; &nbsp;In addition, potential rules under consideration by the SEC may impose a one‐year exclusion from raising funds for any company that fails to file in regard to a generally solicited offering – an almost certain death sentence for early‐stage companies.&nbsp; The proposed rules would also impose extensive additional requirements on startups – many that we believe they will be unable to satisfy. &nbsp;As a result, we will carefully consider the potential for and consequences of inadvertent general solicitation in any due diligence process we may undertake with such issuers.</p>\r\n\r\n<p><u>General solicitation</u><u> </u><u>comes</u><u> with significant new requirements for entrepreneurs (issuers).</u>&nbsp; Issuers must take “reasonable steps to verify” that all purchasers are accredited investors (for definition see: <a href="http://www.sec.gov/answers/accred.htm" title="www.sec.gov/answers/accred.htm">www.sec.gov/answers/accred.htm).</a> &nbsp;The SEC has provided a flexible, “principles‐based methodology” to make this determination. &nbsp;After taking “reasonable steps,” an issuer must reasonably believe the purchaser is accredited (and not otherwise have knowledge that he/she is not). &nbsp;“Absolute proof” is <u>not</u> the standard, but issuers <u>must</u> document steps taken to verify.&nbsp;</p>\r\n\r\n<p>The SEC also provided four alternative, non‐mandatory, non‐exclusive verification methods. &nbsp;These would require the issuer (or a third party) to verify income or net worth of investors, by reviewing detailed financial documentation such as IRS tax forms, banks statements, appraisals and credit reports. &nbsp;We believe these methods place unreasonable, costly, and dangerous burdens on both entrepreneurs and investors – and raise untenable privacy, cost, and complexity concerns.<em><u>&nbsp;</u></em></p>\r\n\r\n<p><em><u>Fortunately, their </u></em><em><u>use should be unnecessary when dealing with an Established Angel Group</u></em><u>.</u> The Angel Capital Association (ACA), of which we are a member, has provided guidance on applying the principles‐based methodology when seeking funding from an Established Angel Group (EAG) such as Keiretsu Forum Mid-Atlantic. &nbsp;This guidance is available at:</p>\r\n\r\n<p>&nbsp;<a href="http://www.angelcapitalassociation.org/data/Documents/Public%20Policy/GuidanceonEAG09_03_13.pdf">www.angelcapitalassociation.org/data/Documents/Public%20Policy/GuidanceonEAG09_03_13.pdf.</a></p>\r\n\r\n<p>Keiretsu Forum Mid-Atlantic supports this methodology, and we require entrepreneurs seeking funding from our organization to consult with legal counsel to gain assurance that reliance on EAG membership will meet the verification test. &nbsp;<u>We recognize these</u><u> rules are complex, but all applicants are also expected to understand and be in compliance with all applicable SEC</u> <u>requirements.</u>&nbsp;&nbsp;</p>\r\n\r\n<p>Since our members, sponsors, and partners are encouraged to bring potential new accredited angel investor members to K4-MA Forum Meetings entrepreneurs will meet potential investors who are not yet members of our organization and who do not qualify under the EAG classification.&nbsp; These potential investors are not exempt from the disclosure rules under 506(c) and issuers are advised to confirm an investor’s membership status before accepting funding from any accredited investor and to act accordingly.&nbsp;</p>\r\n\r\n<p>Keiretsu Forum Mid-Atlantic only accepts accredited investors for investment membership. &nbsp;Our members will not provide personal financial data to companies seeking investment. &nbsp;K4-MA will provide written confirmation on request that any investing member is in good standing at the time of investment.&nbsp; We hope this clarifies our continued interest in early stage investments, while maintaining safety and security of sensitive financial information so our members may continue to actively invest. If you have additional questions, please contact:</p>\r\n\r\n<p><u>Howard Lubert, Area President,</u> <a href="mailto:HLubert@KeiretsuForum-MidAtlantic.com">HLubert@KeiretsuForum-MidAtlantic.com</a><br />\r\n<u>Vince Leusner, Area Vice President,</u> <a href="mailto:VLeusner@KeiretsuForum-MidAtlantic.com">VLeusner@KeiretsuForum-MidAtlantic.com</a><br />\r\n<u>Chuck Carter, VP Entrepreneurial Services,</u>&nbsp; <a href="mailto:CCarter@KeiretsuForum-MidAtlantic.com">CCarter@KeiretsuForum-MidAtlantic.com</a><u>&nbsp;</u></p>\r\n\r\n<p>A formal legal opinion may be obtained from any of our legal firm sponsors with active emerging growth practices.&nbsp; K4-MA is in the process of working with our Legal Firm Sponsors to establish a through yet affordable certification process:&nbsp;</p>\r\n\r\n<p>Michael Dunnam, Partner&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Woodcock Washburn &nbsp;PHL &nbsp; &nbsp;&nbsp;<a href="mailto:Dunnam@Woodcock.com">Dunnam@Woodcock.com</a><br />\r\nLloyd Rothenberg, Partner&nbsp;&nbsp;&nbsp; Loeb &amp; Loeb &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; NY &nbsp; &nbsp; &nbsp;&nbsp;<a href="mailto:LRothenberg@Loeb.com">LRothenberg@Loeb.com</a><br />\r\nLou Heidelberger, Partner&nbsp;&nbsp;&nbsp;&nbsp; Cozen O’Conner &nbsp; &nbsp; &nbsp; &nbsp; NY &nbsp; &nbsp; &nbsp;&nbsp;<a href="mailto:LHeidelberger@Cozen.com">LHeidelberger@Cozen.com</a><br />\r\nJeff Letwin, Partner &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Schnader Harrison &nbsp; &nbsp; &nbsp;PIT &nbsp; &nbsp; &nbsp;<a href="mailto:JLetwin@Schnader.com">JLetwin@Schnader.com</a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 24, 24, 'und', 0, '<h1>An Angel Investment Group That Celebrates Its Sponsors</h1>\r\n\r\n<div>\r\n<h2>With A Sponsorship Program That Makes A Difference</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724534272" src="/sites/default/files/investment-group.jpg" style="float:right" />Tired of sponsorship programs that don’t connect you and your business with the right potential clients or customers?&nbsp; Founded on the principle of forming powerful business connections, Keiretsu Forum Mid-Atlantic is here to help solve that pain.&nbsp; Our membership is comprised entirely of successful investors, many of which maintain executive-level positions in their companies.&nbsp; Our goal is to match these angel investors with the best possible angel investment opportunities available both locally and globally.</p>\r\n\r\n<p>Early stage and startup ventures need a great deal of help, and the entrepreneurs who bring their opportunities to Keiretsu Forum are no different.&nbsp; Keiretsu Forum chapters attract a wealth of sponsor organizations, professional services firms, colleges and universities, incubators, commercial real estate firms and other private equity funds, angel investment groups and venture capital investors.</p>\r\n\r\n<p>Keiretsu Forum Mid-Atlantic welcomes your expertise, resources and experience. In return, we offer you the opportunity for incredible business development and networking.</p>\r\n\r\n<p>We look for sponsors and partners who bring significant value and a willingness to invest their time in helping both our angel investor members and the presenting entrepreneurs grow and prosper.</p>\r\n\r\n<p>Sponsors and professional service organizations from the legal, accounting, advertising and public relations, banking and human resources sectors typically find that there are great business opportunities in participating and partnering with a Keiretsu Forum chapter.</p>\r\n\r\n<ul>\r\n	<li><a href="/node/25" target="_self" title="Benefits Of Becoming A Sponsor">Benefits Of Becoming A Sponsor</a></li>\r\n	<li><a href="/node/26" target="_self" title="Meet Our Sponsors">Meet Our Sponsors</a></li>\r\n</ul>\r\n\r\n<p>To apply to be a sponsor, click the button below.</p>\r\n\r\n<p><a href="/node/45"><img alt="BE A PART OF THE GLOBAL CONNECTION" class="hs-cta-img" id="hs-cta-img-fd4fefdf-6799-493b-bd3e-9ae7a06e0d38" src="/sites/default/files/227dae95-9865-482d-b902-4fa92d915129.png" style="height:33px; width:318px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 25, 25, 'und', 0, '<h1>Your Angel Investor Network Thanks Its Sponsors</h1>\r\n\r\n<div id="inner-content">\r\n<h2>By Rewarding You Generously For Your Expertise</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724565873" src="/sites/default/files/angel-investment-network.jpg" style="float:right" />You have most likely encountered numerous sponsorship programs that disappointed you with lackluster “benefits” and empty words.&nbsp; This is not one of those programs.</p>\r\n\r\n<p>When you partner with Keiretsu Forum at the sponsorship level, you get:</p>\r\n\r\n<ul>\r\n	<li>Ability to attend every meeting with direct, unfettered access to both presenting entrepreneurs and angel investor members, resulting in a highly targeted audience of professionals who need <em>your&nbsp;</em>services\r\n\r\n	<ul>\r\n		<li>Only official sponsors may engage in business development opportunities at K4 chapters.&nbsp;Under the terms of our <a href="/node/7" target="_self" title="Code of Conduct">Code of Conduct</a>, angel investor members are prohibited from engaging in any business development activities outside of investment initiatives.</li>\r\n	</ul>\r\n	</li>\r\n	<li>The opportunity to develop relationships with young companies in search of key vendor and service partners</li>\r\n	<li>The chance to proctor a course in <a href="/node/12" target="_self" title="Keiretsu’s Entrepreneur and Investor Academies">Keiretsu’s Entrepreneur and Investor Academies</a></li>\r\n</ul>\r\n\r\n<p>To apply to be a sponsor, click the button below.</p>\r\n\r\n<p><a href="/node/45"><img alt="BE A PART OF THE GLOBAL CONNECTION" class="hs-cta-img" id="hs-cta-img-fd4fefdf-6799-493b-bd3e-9ae7a06e0d38" src="/sites/default/files/227dae95-9865-482d-b902-4fa92d915129.png" style="border-width:0px; height:33px; width:318px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 26, 26, 'und', 0, '<h1>Meet Keiretsu Forum Mid-Atlantic’s Esteemed Sponsors And Partners</h1>\r\n\r\n<div id="inner-content">\r\n<h2>From Equity Investors To Service Firms &amp; Universities</h2>\r\n\r\n<h3>Host Sponsors:</h3>\r\n<strong>Philadelphia: &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href="http://bakerlaw.com" target="_self"><img alt="BakerHostetler" id="img-1388071003811" src="/sites/default/files/BakerHostetler.jpg" style="height:44px; width:280px" /></a></strong>\r\n\r\n<p>Our Philadelphia Host Sponsor, Woodcock Washburn merged with BakerHostetler on January 1, 2014. &nbsp;BakerHostetler, one of the nation’s largest law firms, represents clients around the globe. With offices coast to coast, our&nbsp;nearly 900 lawyers litigate cases and resolve disputes that potentially threaten clients’ competitiveness, navigate the laws and regulations that shape the global economy, and help clients develop and close deals that fuel their strategic growth.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:1.17em">DC Metro: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><em> &nbsp;<a href="http://cohnreznick.com" target="_self"><img alt="CohnReznick Logo" id="img-1388071836594" src="/sites/default/files/CohnReznick%20Logo.jpg" style="height:51px; width:300px" /></a></em></p>\r\n\r\n<div>\r\n<p><em>CohnReznick LLP provides clients with forward thinking advice helping them navigate complex business and financial issues. With more than 2,000 employees nationwide, we provide the resources, technical skills and deep industry knowledge to help them succeed.</em></p>\r\n\r\n<h3>Pittsburgh: &nbsp; &nbsp;&nbsp;<a href="http://schnader.com" target="_self"><img alt="Schnader Logo2" id="img-1388072176760" src="/sites/default/files/Schnader%20Logo2.gif" /></a></h3>\r\n\r\n<p>Schnader''s Pittsburgh office, established in 1994, serves a wide range of the firm''s local, national and international clients. Client areas including general corporate, securities, business and complex litigation; franchise; taxation; commercial transactions; aviation; environmental; energy; renewable energy; trusts and estates; retirement and business planning; real estate development and finance; land use planning; leasing; labor and employment; employee benefits and construction.&nbsp; With support from all seven of the firm''s offices, Schnader''s attorneys address a diverse variety of litigation, transactional, regulatory and environmental needs.</p>\r\n\r\n<h3>New York: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<a href="http://LOEB.COM" target="_self"><img alt="Loeb&amp;Lowb Logo" id="img-1388072295596" src="/sites/default/files/loeb%26lowb%20logo.gif" style="height:137px; width:140px" /></a></h3>\r\n\r\n<p><strong>Depth. Knowledge. Insight.</strong>&nbsp; Loeb &amp; Loeb LLP is a multi-service law firm with&nbsp;more than&nbsp;300 attorneys and&nbsp;offices in&nbsp;Los Angeles, New York, Chicago,&nbsp;Nashville, Washington, DC,&nbsp;Beijing and Hong Kong. The firm focuses on select core industries and practice areas, rather than endeavoring to be all things to all clients.&nbsp;We represent multi-national,&nbsp;<em>Fortune</em>&nbsp;100 companies in these core practice areas, and serve as primary outside counsel to a multitude of mid-market clients. The firm also represents&nbsp;clients ranging from emerging companies to&nbsp;high net worth individuals and families.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Region Wide Sponsors:</h3>\r\n\r\n<h4><a href="http://percepture.com" target="_self"><img alt="Percepture Logo2" id="img-1388072657134" src="/sites/default/files/Percepture-Logo2.jpg" style="font-size:13px; height:96px; width:220px" /></a><span style="font-size:13px">&nbsp;</span></h4>\r\n\r\n<p>Percepture is a fully-integrated public relations agency and marketing firm, and a New Jersey State Certified Minority Business Enterprise. We specialize in the development, execution and measurement of sales-focused communications campaigns for business-to-business and consumer organizations.</p>\r\n\r\n<p>Percepture has developed, implemented and successfully managed public relations, social media and marketing programs for the world’s premier brands and organizations including Unilever, Disney, HP, Daimler-Chrysler, Foot Locker, The Islands of the Bahamas, Ingersoll Rand, Konica Minolta, Century21, Coldwell Banker Commercial and Chevron Texaco.</p>\r\n\r\n<p>We treat our client’s business as if it were our own, taking pride in and responsibility for the work we do. That commitment is evident in the results we produce. We are a powerful perception-management organization and are always looking for ways to help your business grow. Whether we’re talking to the media about an upcoming article, or speaking to your customers about a case history, we are constantly reinforcing your key messages.</p>\r\n\r\n<p>You’re focused on bottom line results. So are we.</p>\r\n\r\n<p>Increased sales and profitability are things that prove PR’s true worth.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href="http://courageinstitute.org" target="_self"><img alt="Couragepowerup enhe2 vsmall" id="img-1388075550837" src="/sites/default/files/Couragepowerup-enhe2-vsmall.png" /></a></p>\r\n\r\n<p><strong>Courage International Business Advisors:&nbsp; Boosting your ROI from Human Capital</strong></p>\r\n\r\n<p>People.&nbsp; Everyone says that’s your biggest asset. It’s also your biggest headache.&nbsp; Talking about the folks who deliver the goods — and the ones who rub you the wrong way — only gets you so far.&nbsp; If it’s time to <em>do</em> something to improve their ROI — now — or mobilize people to power enterprise growth and get you to the next level, we invite your call.&nbsp; We can help with an assessment of your Growth Potential, to tell you what you’ll need to get from here to there.&nbsp; Or with the coaching that equips a key player to grow into an expanded role.&nbsp; We can assist in recruiting your next key hire.&nbsp; And get them on-boarded quickly, so they hit stride, seize opportunities, or shake things up in a way that takes you forward, not back.&nbsp; If you’ve got the courage to take a fresh look at the additional performance your team can achieve — with pay-for-performance systems, people-management tools and a culture that ignites brilliance and powers innovation — we invite your call.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href="http://yorn.com" target="_self"><img alt="Yorn" id="img-1388073292027" src="/sites/default/files/Yorn.jpg" /></a></p>\r\n\r\n<h4>Real Opinions in Real Time</h4>\r\n\r\n<p>Knowing what people think about the experience you’re creating is critical. It also happens to be one of the hardest things to actually find out. Until now. Researchers at Yorn have keyed into the most important question of all time, “Would you recommend this experience to someone else, and why?” That’s really the only question that matters, right? Yorn gets this answer as a seamless part of your experience. It’s fast, fun, and guess what? People will actually participate.</p>\r\n\r\n<p><a href="http://Wizehive.com" style="font-size: 1em;" target="_self"><img alt="wizehive logo on white" id="img-1388073411349" src="/sites/default/files/wizehive-logo-on-white.jpg" style="height:100px; width:250px" /></a><span style="font-size:1em">&nbsp;</span></p>\r\n\r\n<p>WizeHive is an online platform that combines a form builder, task manager, activity feed and workflow tools -- all wrapped inside a modern social interface.&nbsp; Organizations use it to quickly build and deploy powerful data driven web apps. WizeHive is used by leading universities and foundations to automate their grant management and scholarship application process, utilized by hundreds of companies and digital marketing agencies to build and deploy engaging contests and competitions through their websites and Facebook pages and it''s also employed by thousands of users to manage their business activities and projects.</p>\r\n\r\n<p>WizeHive helps organizations improve their bottom lines by improving online engagement with customers and prospects while helping them automate antiquated business processes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>CHAPTER SPONSORS:</h3>\r\n\r\n<h3>Philadelphia</h3>\r\n\r\n<p><a href="http://weisermazars.com" target="_self"><img alt="WeiserMazars Logo" id="img-1388074016999" src="/sites/default/files/WeiserMazars-Logo.jpg" style="height:74px; width:170px" /></a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href="http://trinet.com" target="_self"><img alt="describe the image" id="img-1388073998796" src="/sites/default/files/trinet-logo.jpg" style="height:122px; width:144px" /></a>&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p><a href="http://safehatch.com" target="_self"><img alt="SafeHatch1" id="img-1388073967905" src="/sites/default/files/SafeHatch1.jpg" style="height:57px; width:250px" /></a>&nbsp; &nbsp;&nbsp;<a href="http://b2bcfo.com/partner/vleusner/" target="_self"><img alt="B2BCFO" id="img-1388074166298" src="/sites/default/files/B2BCFO.jpg" /></a></p>\r\n\r\n<h3>DC Metro</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Pittsburgh</h3>\r\n\r\n<p><a href="http://parentebeard.com" target="_self"><img alt="ParenteBeard" id="img-1388075748415" src="/sites/default/files/ParenteBeard.jpg" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>New York</h3>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;&nbsp; <a href="http://cozen.com" target="_self"><img alt="cozen logo1" id="img-1388074590194" src="/sites/default/files/cozen_logo1.jpg" /></a></p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3><span style="font-size:1.17em">Partners</span></h3>\r\n\r\n<h3><a href="http://cottrellcenter.org" target="_self"><img alt="WCU Cottrell Center" id="img-1388074880604" src="/sites/default/files/WCU%20Cottrell%20Center.jpg" style="height:87px; width:250px" /></a>&nbsp; &nbsp; &nbsp;&nbsp;<a href="http://pennstatemedicine.org/2012/08/13/technology-transfer-bringing-scientific-discoveries-to-market/" target="_self"><img alt="PSU HERSHEY" id="img-1388076107627" src="/sites/default/files/PSU-HERSHEY.jpg" /></a></h3>\r\n\r\n<p><a href="http://drexel.edu" target="_self"><img alt="DREXEL 4SPONSORS LOGO" id="img-1388075358874" src="/sites/default/files/DREXEL-4SPONSORS-LOGO.png" style="height:68px; width:250px" /></a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href="/node/45"><img alt="BE A PART OF THE GLOBAL CONNECTION" class="hs-cta-img" id="hs-cta-img-fd4fefdf-6799-493b-bd3e-9ae7a06e0d38" src="/sites/default/files/227dae95-9865-482d-b902-4fa92d915129.png" style="border-width:0px; height:33px; width:318px" /></a></p>\r\n</div>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 27, 27, 'und', 0, '<h1>The Keiretsu Advantage</h1>\r\n\r\n<div id="inner-content">\r\n<h2>For Angel Investors &amp; Innovative Entrepreneurs</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724606243" src="/sites/default/files/angel-investors-2.jpg" style="float:right" />Keiretsu Forum goes above and beyond the role of an ordinary angel investment network.&nbsp; By providing quality deal flow, vetted global investment opportunities, charitable and social stimulation, educational resources, collaboration with private equity funds throughout North America and an unwavering commitment to honorable business practices, our angel investors and the innovative entrepreneurs who inspire their investments are generously taken care of.</p>\r\n\r\n<p>Browse the following pages to get an idea of what the Keiretsu Advantage is all about.</p>\r\n\r\n<ul>\r\n	<li><a href="/node/28" target="_self" title="Investment Cultivation">Investment Cultivation</a></li>\r\n	<li><a href="/node/29" target="_self" title="Smart Money Due Diligence Program">Smart Money Due Diligence Program</a></li>\r\n	<li><a href="/node/30" target="_self" title="Global Investment Network">Global Investment Network</a></li>\r\n	<li><a href="/node/31" target="_self" title="K4-DealRoom.com">K4-DealRoom.com</a></li>\r\n	<li><a href="/node/32" target="_self" title="More Opportunities = Better Investments">More Opportunities = Better Investments</a></li>\r\n	<li><a href="/node/33" target="_self" title="Sponsors">Sponsors</a></li>\r\n</ul>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 28, 28, 'und', 0, '<h1>Your Return On Investment Is Cultivated By Keiretsu</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Investment Opportunities, Vetted &amp; Elevated With Your Success In Mind</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724640418" src="/sites/default/files/investment-opportunities-2.jpg" style="float:right" />The quality of your angel investing pursuits is directly dependent upon the quality of the investments available to you.&nbsp; To ensure you’re getting the highest quality deal flow and return on investment, Keiretsu Forum Mid-Atlantic’s growth-oriented angel funding philosophy is driven and supported by our unique Investment Cultivation process.</p>\r\n\r\n<p>The entrepreneurs who are chosen to present at our Forum meetings must pass through two scrubbing and screening processes -- first, an initial pre-screening and second, the more in-depth Deal Screening.&nbsp; During these vetting phases, appropriate industry experts meticulously assess the quality of prospective presenters’ business plans and stability of their concepts.</p>\r\n\r\n<p>If their businesses are deemed worthy of investment traction, these driven entrepreneurs are provided with strategic coaching and guidance on presentation best practices.&nbsp; Not only are we assisting these startup and entry-level businesses through this rigorous process, but we’re also ensuring that our angel investors are presented with the best possible investment opportunities.</p>\r\n\r\n<p>After the initial presentation, this cultivation process continues with in-depth <a href="/node/29" target="_self" title="due diligence reporting">due diligence reporting</a>, legal assistance with investment setup, ongoing mentoring services and exit strategy design.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 29, 29, 'und', 0, '<h1>Startup Investors Are Smart About Their Money</h1>\r\n\r\n<div>\r\n<h2>Taking Investment Opportunities &amp; Due Diligence Seriously</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724673432" src="/sites/default/files/startup-investors.jpg" style="float:right" />When you and your fellow angel investor members discover opportunities you’d like to pursue, you collaborate on a comprehensive, six-week due diligence review.&nbsp; This in-depth, member-driven research effort ensures that you have the knowledge and resources necessary to make the most informed and educated investment decisions possible.</p>\r\n\r\n<p>The due diligence report is published and shared with members from all <a href="/node/30" target="_self" title="25 chapters on three continents">26 chapters on three continents</a>&nbsp;<a href="/node/31" target="_self" title="via K4-DealRoom.com">via K4-DealRoom.com</a>.</p>\r\n\r\n<p>The due diligence report also dictates the terms of the deal between investors and entrepreneurs, guaranteeing that all details, facts and figures are clear and agreed upon by both parties. This sets the foundation for a strong angel investment relationship based on trust and solidarity.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="https://hubspot-hubshot.s3.amazonaws.com/hubshot/prod/12/10/04/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 30, 30, 'und', 0, '<h1>Angel Investment On A Global Scale</h1>\r\n\r\n<div>\r\n<h2>Grounded By Localized Knowledge &amp; Firsthand Due Diligence</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724699931" src="/sites/default/files/angel-investment-3.jpg" style="float:right" />When you’re part of Keiretsu Forum -- as an angel investor member or as a presenting entrepreneur -- your angel funding and investment opportunities are never geographically limited.</p>\r\n\r\n<p>“Local knowledge, global reach.”&nbsp; That’s the philosophy behind Keiretsu Forum’s worldwide angel investment network.&nbsp; With nearly 1,000 members and 26 chapters across three continents, <a href="http://K4-DealRoom.com" target="_blank" title="all connected through K4-DealRoom.com">all connected through K4-DealRoom.com</a>, you access carefully vetted and diverse investment opportunities from across the globe.&nbsp; This benefits our entrepreneurs as well, as they are presented with worldwide opportunities to access the angel funding they need to grow their startup and entry-level businesses.</p>\r\n\r\n<p>At Keiretsu, we’re passionate about merging localized knowledge and firsthand due diligence with global investment reach.&nbsp; This unique combination of local and international expertise is what creates diverse investment opportunities and quality deal flow for our angel investors.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html');
INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 31, 31, 'und', 0, '<h1>Your Angel Network Without Borders</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Global Investment Opportunities Brought To You Online</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724734950" src="/sites/default/files/angel-network-2.jpg" style="float:right" />As an angel investor member of <a href="/node/30" target="_self" title="Keiretsu Forum’s Global Investment Network">Keiretsu Forum’s Global Investment Network</a>, you have admission to <a href="http://www.K4-DealRoom.com" target="_blank" title="K4-DealRoom.com">K4-DealRoom.com</a>.&nbsp; This gives you free and unlimited online access to due diligence reports and investment opportunities from 26 Keiretsu chapters across three continents.</p>\r\n\r\n<p>Keiretsu Forum brings global investment opportunities and international expertise to your local accessibility. Additionally, you’re given convenient insight into quality investment opportunities even if you don’t attend meetings or presentations in person.</p>\r\n\r\n<p>This online angel investment portal also offers entrepreneurs the opportunity to share their presentations with Keiretsu’s entire Global Investment Network, greatly enhancing and diversifying their options for angel funding procurement.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 32, 32, 'und', 0, '<h1>A Worldwide Range Of Angel Investment Opportunities</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Carefully Vetted To Complement Quantity With Quality</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724761292" src="/sites/default/files/angel-investment-opportunities-2.jpg" style="float:right" />It just makes sense: More opportunities = better investments.</p>\r\n\r\n<p>Since Keiretsu Forum''s founding in 2000, our members have invested over $400 million in 350+ high-growth companies from a myriad of industries, including software, telecommunications, health/life sciences, biotech, real estate, mobile applications, internet, consumer products and other high growth areas.</p>\r\n\r\n<p>It’s important to note, quality of investments is never compromised to favor quantity. With Keiretsu Forum’s commitment to <a href="/node/28" target="_self" title="Investment Cultivation">Investment Cultivation</a> and <a href="/node/29" target="_self" title="Smart Money Due Diligence">Smart Money Due Diligence</a>, you never have to worry your quantity of investment opportunities outshines their quality. With Keiretsu, quality and quantity come together.</p>\r\n\r\n<p>The sheer range of carefully vetted opportunities available through Keiretsu Forum ensures that you have access to the best available angel investments throughout our <a href="/node/30" target="_self" title="Global Investment Network">Global Investment Network</a>.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 33, 33, 'und', 0, '<h1>Private Investors &amp; Entrepreneurs Get Private Instruction</h1>\r\n\r\n<div>\r\n<h2>From Keiretsu Forum Mid-Atlantic’s Industry-Leading Sponsors</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724791505" src="/sites/default/files/private-equity-investors-2.jpg" style="float:right" />Keiretsu Forum chapters attract a wealth of sponsor organizations, professional services firms, colleges and universities, incubators, commercial real estate firms and other private equity funds, angel investment groups and venture capital investors.</p>\r\n\r\n<p>We make it a point to attract sponsors and partners who bring significant value and a willingness to invest their time in helping both our angel investor members and presenting entrepreneurs grow and prosper.&nbsp; These are industry experts with the knowledge and experience that results in smart startup business development, smart investment decisions and smart, professional relationships.</p>\r\n\r\n<p>Keiretsu Forum Mid-Atlantic’s sponsorship program is ideal for service professionals in any field, but especially in the legal, accounting, banking, public relations and advertising, real estate and human resources sectors.&nbsp; For more information, go to our page on the <a href="/node/25" target="_self" title="benefits of becoming a sponsor">benefits of becoming a sponsor</a> with Keiretsu Forum Mid-Atlantic.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 34, 34, 'und', 0, '<h1>Your Angel Funding PayPal Account</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Financial Security, Guaranteed</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724511586" src="/sites/default/files/angel-funding-3.jpg" style="float:right" />Click the button below to access our PayPal account, where you can use any accepted form of payment to pay the Keiretsu Forum Mid-Atlantic administrative fee. There are no service fees added to your payment to use our PayPal service, although your credit card company may impose currency conversion fees if your bank is not U.S.-based. Keiretsu Forum Mid-Atlantic takes your financial security very seriously -- that’s why we offer this PayPal link as a way to provide you with a completely secure and private payment solution, in lieu of a wire transfer or company check.</p>\r\n\r\n<p>Regarding all educational and program event fees, refund policies are listed on the registration and/or information pages of each event. Refunds are issued minus any PayPal processing fees.</p>\r\n\r\n<p><em>Entrepreneurs:</em> If, for any reason, you miss your scheduled Forum meeting presentation dates, or unforeseen circumstances force you to cancel your scheduled presentations, you hereby understand and agree that this fee is non-refundable -- unless we are able to identify and substitute an appropriate and qualified alternate company to fill your scheduled Forum meeting presentation dates.</p>\r\n\r\n<p><em>Angel Investor Members:</em> PayPal payments are treated as checks and are therefore final and non-refundable.</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 35, 35, 'und', 0, '<h1>Keiretsu Forum Mid-Atlantic Angel Capital Expo<sup>SM</sup></h1>\r\n\r\n<div id="inner-content">\r\n<p><img alt="ACE LOGO3" id="img-1376848633469" src="/sites/default/files/ACE-LOGO3.jpg" style="display:block; margin-left:auto; margin-right:auto" /></p>\r\n\r\n<h2>&nbsp;<br />\r\n<span style="color:#000000"><strong>The 2014 Angel Capital Expo<br />\r\nis Scheduled for Wednesday, October 22!</strong></span></h2>\r\n\r\n<h3>Hosted by Keiretsu Forum Mid-Atlantic<br />\r\nand Drexel University</h3>\r\n\r\n<p><img alt="K4 MA DREXEL LOGO SET2" src="/sites/default/files/K4-MA%20DREXEL%20LOGO%20SET2.jpg" /></p>\r\n\r\n<h2><span style="color:#ff0000">The Premier Gathering of the Angel Capital Community<sup>SM</sup></span></h2>\r\n\r\n<p><span style="color:#000000">Accredited Angel Investors, Venture Capital Principals, Private &amp; Family Wealth Professionals, and other members of the private equity community are cordially invited to join us at the 14th Angel Capital Expo (the first on the East Coast) on Wednesday, October 23, 2013.&nbsp; The Expo is Keiretsu Forum’s signature event bringing together investors and entrepreneurs looking for funding. <strong><a href=" https://www.eventbrite.com/event/4236714126" target="_blank" title="Register to Attend">Register to Attend</a></strong>.<strong>&nbsp;</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#000000"><strong>EXPO:</strong> Wednesday, October 22, 2014 - 7:15am to 6:30pm &nbsp;<br />\r\n<strong>ENTREPRENEUR EDUCATION DAY: </strong>Saturday, October 25, 2014 - 7:15am - 6:30pm&nbsp;</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#000000"><strong>Drexel University</strong></span></p>\r\n\r\n<p><strong>Location TBD</strong></p>\r\n\r\n<h2><span style="color:#000000">Attendees<strong>&nbsp;</strong></span></h2>\r\n\r\n<p><span style="color:#000000">Angel Capital Expo is the premier gathering of the angel capital community and&nbsp;was created to foster collaboration among angel groups, as well as reach out to the larger investment community.&nbsp; Attendees include over 100 angel investors.&nbsp; If you would like to attend, please <a href=" https://www.eventbrite.com/event/4236714126" target="_blank" title="register online">register online</a>.&nbsp; For more information, contact Chuck Carter, Philadelphia Chapter President, at <a href="mailto:ccarter@keiretsuforum-midatlantic.com">CCarter@KeiretsuForum-MidAtlantic.com</a> or call +1 (215) 233-0342.&nbsp; Invitation is extended to <a href="http://www.sec.gov/answers/accred.htm" target="_blank">accredited investors</a> only<strong>.</strong></span></p>\r\n\r\n<h2><span style="color:#000000">Presenters</span></h2>\r\n\r\n<p><span style="color:#000000">Angel Capital Expo&nbsp;features 10 high-quality, diverse investment opportunities in technology, healthcare/life sciences, consumer products, energy/green tech., real estate, and other high growth investment silos.&nbsp; Companies that apply to Keiretsu Forum are typically in their A or B rounds having already secured initial funding of $250k to $1 million from founders, friends, family, and individual angels.</span></p>\r\n\r\n<p><span style="color:#000000">To apply to present at the Angel Capital Expo, please <a href="http://www.k4-dealroom.com/index.html" target="_blank" title="complete the online application">complete the online application</a> and contact Chuck Carter, VP of Entrepreneur Services, at <a href="mailto:nina@keiretsuforum.com">CCarter@KeiretsuForum-MidAtlantic.com</a> or call +1 (215) 233-0342.&nbsp; <u>Make sure to select the Mid-Atlantic Region on your application to be considered for this opportunity.</u>&nbsp; Keiretsu Forum is a global angel investment network and welcomes submissions&nbsp;from international companies.</span></p>\r\n\r\n<p><span style="color:#000000">All presenters will be pre-screened by a select committee&nbsp;of Keiretsu Forum members and due diligence fellows.&nbsp; Presentation coaching will be provided to companies selected to present.&nbsp; Each entrepreneur will make an on-stage&nbsp;presentation and will be available for additional discussion and due diligence at their exhibitor booth&nbsp;throughout the day.&nbsp; Following the presentations, the attendees will vote and award the top three&nbsp;presenting companies the “Most Valued Company” award.</span></p>\r\n\r\n<h2><span style="color:#000000">Agenda</span></h2>\r\n\r\n<p><span style="color:#000000">07:15am – 08:15am &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Registration, Breakfast and Exhibitors</span><br />\r\n<span style="color:#000000">08:15am – 08:45am &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Welcome and Opening Remarks</span><br />\r\n<span style="color:#000000">08:45am – 10:20am &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Presenters – Block I</span><br />\r\n<span style="color:#000000">10:20am – 10:45am &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Break and Booth Exhibitors</span><br />\r\n<span style="color:#000000">10:45am – 12:20pm &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Presenters – Block II</span><br />\r\n<span style="color:#000000">12:20pm – 01:30pm &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Lunch, Guest Speaker and Exhibitors</span><br />\r\n<span style="color:#000000">01:30pm - 02:00pm&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Early Stage Fast Pitch Presentations</span><br />\r\n<span style="color:#000000">02:00pm – 03:35pm &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Presenters – Block III</span><br />\r\n<span style="color:#000000">03:35pm – 04:00am &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Guest Speaker</span><br />\r\n<span style="color:#000000">04:00pm – 05:00pm &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Most Valued Company Award Competition and Exhibitors</span><br />\r\n<span style="color:#000000">05:00pm – 05:15pm &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Announcement of the Most Valued Company and Final Announcements</span><br />\r\n<span style="color:#000000">05:15pm - 06:30pm&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Wine and Cheese Reception - Exhibit Hall</span></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 36, 36, 'und', 0, '<h1 class="rtecenter">Information for Potential Presenters &amp; Entreprenuers</h1>\r\n\r\n<div id="inner-content">\r\n<h1><img alt="describe the image" src="/sites/default/files/ACE-LOGO3.jpg" /></h1>\r\n\r\n<h1 class="rtecenter">Apply to Present at the Mid-Atlantic Angel Capital Expo<sup>SM</sup></h1>\r\n\r\n<h2><strong>October 23, 2013</strong></h2>\r\n\r\n<h3><strong>Hosted by Drexel University</strong></h3>\r\n\r\n<h2 class="rtecenter"><span style="color:#ff0000"><strong>The Premier Gathering of the Angel Capital Community<sup>SM</sup></strong></span></h2>\r\n\r\n<p><span style="color:#000000"><strong>Wednesday, October 23, 2013 - 7:15am to 6:30pm&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\nDrexel University<br />\r\nBossone Building, 32nd and Market Streets, Philadelphia, PA</strong></span></p>\r\n\r\n<h2><span style="color:#000000">Information for Potential Presenters&nbsp;</span></h2>\r\n\r\n<p><span style="color:#000000">The Keiretsu Forum Mid-Atlantic Region Angel Capital Expo will feature 12 high-quality, diverse investment opportunities from technology, healthcare/life sciences, consumer products, energy/green tech., real estate, and other high growth investment silos.&nbsp; Companies that apply to Keiretsu Forum are typically in their A or B rounds having already secured initial funding of $500k to $1.5 million from founders, friends, family, and individual angels.&nbsp; Most of these companies will be looking for an A or B Round investment in the $250k - $3m range, the Keiretsu Forum investment sweet-spot.</span></p>\r\n\r\n<p><span style="color:#000000">To apply to present at the Angel Capital Expo, please <a href="http://K4-DealRoom.com" target="_blank"><span style="color:#000000">complete the online application</span></a> and contact Chuck Carter, VP of Entrepreneur Services, at&nbsp;<a href="mailto:CCarter@KeiretsuForum-MidAtlantic.com"><span style="color:#000000">CCarter@KeirestuForum-MidAtlantic.com</span></a> or call +1 (215) 233-0342.&nbsp; <u>Please check the Mid-Atlantic Region option on the Application.</u>&nbsp; Keiretsu Forum Mid-Atlantic is part of the Keiretsu Forum global angel investment network and welcomes submissions&nbsp;from international companies.</span></p>\r\n\r\n<p><span style="color:#000000">All presenters will be pre-screened by a select committee&nbsp;of Keiretsu Forum members and due diligence fellows.&nbsp; Presentation coaching will be provided to companies selected to present.&nbsp; Each entrepreneur will make an on-stage&nbsp;presentation and will be available for additional discussion and due diligence at their exhibitor booth&nbsp;throughout the day.&nbsp; Following the presentations, the attendees will vote and award the top three&nbsp;presenting companies the “Most Valued Company” award.</span></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 37, 37, 'und', 0, '<h1 class="rtecenter">Information for Potential Presenters &amp; Entreprenuers</h1>\r\n\r\n<div id="inner-content">\r\n<h1><img alt="describe the image" id="img-1377195397416" src="/sites/default/files/ACE-LOGO3.jpg" /></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2 class="rtecenter"><span style="color:#ff0000"><strong>Present at the Mid-Atlantic Angel Capital Expo<sup>SM</sup>&nbsp;</strong></span></h2>\r\n\r\n<h3><strong>October 23, 2013</strong></h3>\r\n\r\n<h3>Hosted by Keiretsu Forum Mid-Atlantic&nbsp;<br />\r\nand Drexel University</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#000000"><strong>Wednesday, October 23, 2013 - 7:15am to 6:30pm&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\nDrexel University<br />\r\nBossone Building, 32nd and Market Streets, Philadelphia, PA</strong></span></p>\r\n\r\n<h2><span style="color:#000000">Information for Potential Presenters&nbsp;</span></h2>\r\n\r\n<p><span style="color:#000000">The Keiretsu Forum Mid-Atlantic Region Angel Capital Expo will feature 12 high-quality, diverse investment opportunities from technology, healthcare/life sciences, consumer products, energy/green tech., real estate, and other high growth investment silos.&nbsp; Companies that apply to Keiretsu Forum are typically in their A or B rounds having already secured initial funding of $500k to $1.5 million from founders, friends, family, and individual angels.&nbsp; Most of these companies will be looking for an A or B Round investment in the $250k - $3m range, the Keiretsu Forum investment sweet-spot.</span></p>\r\n\r\n<p><span style="color:#000000">To apply to present at the Angel Capital Expo, please <a href="http://K4-DealRoom.com" target="_blank"><span style="color:#000000">complete the online application</span></a> and contact Chuck Carter, VP of Entrepreneur Services, at&nbsp;<a href="mailto:CCarter@KeiretsuForum-MidAtlantic.com"><span style="color:#000000">CCarter@KeirestuForum-MidAtlantic.com</span></a> or call +1 (215) 233-0342.&nbsp; <u>Please check the Mid-Atlantic Region option on the Application.</u>&nbsp; Keiretsu Forum Mid-Atlantic is part of the Keiretsu Forum global angel investment network and welcomes submissions&nbsp;from international companies.</span></p>\r\n\r\n<p><span style="color:#000000">All presenters will be pre-screened by a select committee&nbsp;of Keiretsu Forum members and due diligence fellows.&nbsp; Presentation coaching will be provided to companies selected to present.&nbsp; Each entrepreneur will make an on-stage&nbsp;presentation and will be available for additional discussion and due diligence at their exhibitor booth&nbsp;throughout the day.&nbsp; Following the presentations, the attendees will vote and award the top three&nbsp;presenting companies the “Most Valued Company” award.</span></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 38, 38, 'und', 0, '<h1 class="rtecenter">Israeli Innovation Showcase Segment<sup>SM</sup></h1>\r\n\r\n<div id="inner-content">\r\n<h1><img alt="describe the image" id="img-1377283766867" src="/sites/default/files/ACE-LOGO3.jpg" /></h1>\r\n\r\n<h2 class="rtecenter"><span style="color:#ff0000"><strong>Present at the Mid-Atlantic Angel Capital Expo<sup>SM</sup><br />\r\nIsraeli Innovation Showcase Segment</strong></span></h2>\r\n\r\n<h3 class="rtecenter"><strong>October 23, 2013</strong></h3>\r\n\r\n<h3 class="rtecenter">Hosted by Keiretsu Forum Mid-Atlantic<br />\r\nand Drexel University</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#000000"><strong>Wednesday, October 23, 2013 - 7:15am to 6:30pm&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\nDrexel University<br />\r\nBassone Building, 32nd and Market Streets, Philadelphia, PA</strong></span></p>\r\n\r\n<h2><span style="color:#000000">Information for Potential Israeli Presenters</span></h2>\r\n\r\n<p><span style="color:#000000; font-family:arial,sans-serif; font-size:12pt">If your enterprise is already doing business in North America - or is ready to open its North American operation - the Angel Capital Expo will give you:</span></p>\r\n\r\n<p><span style="color:#000000"><span style="font-family:symbol; font-size:12pt">·<span style="font-family:times new roman; font-size:7pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family:arial,sans-serif; font-size:12pt">An introduction to 50+ angels who have invested over $400MM in early-stage A &amp; B round deals</span></span></p>\r\n\r\n<p><span style="color:#000000"><span style="font-family:symbol; font-size:12pt">·<span style="font-family:times new roman; font-size:7pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family:arial,sans-serif; font-size:12pt">A videotape of your pitch that you can make available to other investors through the Keiretsu Forum Deal Room</span></span></p>\r\n\r\n<p><span style="color:#000000"><span style="font-family:symbol; font-size:12pt">·<span style="font-family:times new roman; font-size:7pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family:arial,sans-serif; font-size:12pt">An opportunity to invite up to 5 potential investors or collaboration partners to see your pitch and attend the Angel Capital Expo as your guests</span></span></p>\r\n\r\n<p><span style="color:#000000"><span style="font-family:symbol; font-size:12pt">·<span style="font-family:times new roman; font-size:7pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family:arial,sans-serif; font-size:12pt">A second opportunity to pitch to investors in New York on October 24th at a special event hosted by Greenberg-Traurig and the US-Israel Business Council</span></span></p>\r\n\r\n<p><span style="color:#000000"><span style="font-family:symbol; font-size:12pt">·<span style="font-family:times new roman; font-size:7pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family:arial,sans-serif; font-size:12pt">Access to the Philadelphia-Israel Chamber of Commerce business community as a source of potential customers, development partners, connectors and collaborators - starting with Drexel University, which has brought a number of Israeli innovations to success in the North American market</span></span></p>\r\n\r\n<p><span style="color:#000000"><span style="font-family:symbol; font-size:12pt">·<span style="font-family:times new roman; font-size:7pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family:arial,sans-serif; font-size:12pt">Solid professional feedback to sharpen your investor pitch - from the screening and from the coaching you receive from Dr Yochee Klein, of Courage International</span></span></p>\r\n\r\n<p><span style="color:#000000"><span style="font-family:symbol; font-size:12pt">·<span style="font-family:times new roman; font-size:7pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style="font-family:arial,sans-serif; font-size:12pt">Quick access to the other Keiretsu Forum chapters in the US and Canada</span></span></p>\r\n\r\n<p><img alt="ToddWallach QuotePic ACE3" src="/sites/default/files/ToddWallach-QuotePic%20ACE32.png" /></p>\r\n\r\n<p><span style="color:#000000; font-family:arial,sans-serif; font-size:12pt">Keiretsu Forum Mid-Atlantic is keenly aware of the special needs that Israeli and other offshore entrepreneurs face when they approach North American investors.&nbsp; We do more than provide you with a forum to do your pitch.&nbsp; We provide you with feedback, coaching, and guidance so you leave the room with solid contacts and potential investors who want to know more about your unique value proposition.</span></p>\r\n\r\n<p><span style="color:#000000; font-family:arial,sans-serif; font-size:12pt">To apply to present at the Angel Capital Expo, please <a href="http://K4-DealRoom.com" target="_blank"><span style="color:#000000">complete the online application</span></a> and contact Merom Klein, VP of Special Events, at <a href="mailto:MKlein@KeiretsuForum-MidAtlantic.com"><span style="color:#000000">MKlein@KeirestuForum-MidAtlantic.com</span></a> or call +1 (215) 529-8918 x3.&nbsp; <u>Please check the Israeli Innovation Showcase option on the Application.</u>&nbsp; Keiretsu Forum Mid-Atlantic is part of the Keiretsu Forum global angel investment network and welcomes submissions&nbsp;from international companies.</span></p>\r\n<span style="font-family:arial,sans-serif; font-size:12pt">All presenters will be pre-screened via teleconference by a select committee&nbsp;of Keiretsu Forum members and Due Diligence Fellows.&nbsp; Presentation coaching will be provided to companies selected to present.&nbsp; Each entrepreneur will make an on-stage&nbsp;presentation and will be available for additional discussion and due diligence at their exhibitor booth&nbsp;throughout the day.&nbsp; Following the presentations, the attendees will vote and award the top three&nbsp;presenting companies the “Most Valued Company” awards.</span><span style="font-family:arial,sans-serif; font-size:12.0pt">&nbsp; At the May Angel Capital Expo in San Francisco Israeli companies swept the awards program! </span></div>\r\n', '', 'full_html'),
('node', 'page', 0, 39, 39, 'und', 0, '<h1>Information for Investors - Why Participate?</h1>\r\n\r\n<div id="inner-content">\r\n<h1><img alt="describe the image" id="img-1377194995760" src="/sites/default/files/ACE-LOGO3.jpg" /></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><span style="color:#ff0000"><strong>Investors - Why Participate?</strong></span></h2>\r\n\r\n<p><strong>Wednesday, October 23, 2013 - 7:15am to 6:30pm<br />\r\n<strong>Drexel University<br />\r\nBossone Building, 32nd and Market Streets, Philadelphia, PA</strong></strong></p>\r\n\r\n<p class="rtecenter"><em>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Keiretsu Forum is the world''s largest private equity angel investment network with more than 900 accredited investors in 27 chapters on 3 continents who have invested more than $400m in early stage opportunities.&nbsp;</em></p>\r\n\r\n<p>The Keiretsu Forum Mid-Atlantic Region Angel Capital Expo (ACE) will showcase 12 high-quality, diverse investment opportunities from technology, healthcare/life sciences, consumer products, energy/green tech., real estate, and other high growth investment silos.&nbsp; The event will be open to Angel Investors, Private and Family Wealth Managers, and Venture Capital firms and promises to attract 100-150 of the top investors in the region.&nbsp; There will be representatives from many of the West Coast and International Keiretsu Forum Chapters in attendance as well.&nbsp;</p>\r\n\r\n<p>Reasons you will not want to miss this event:</p>\r\n\r\n<p>1.&nbsp; Opportunity to see 12 qualified, pre-vetted investment opportunites in one place in one day<br />\r\n2.&nbsp; Pre-qualified DealFlow from multiple Keiretsu Forum Regions<br />\r\n3.&nbsp; Many of the presenting companies will have already completed the rigorous Keiretsu Forum Due Diligence process and<br />\r\n&nbsp; &nbsp;&nbsp; will have due diligence reports and investment packages available for accredited investors<br />\r\n4.&nbsp; Network with and engage angel investors from all of the region''s Angel groups<br />\r\n5.&nbsp; Opportunity to catch 6 Early-stage Fast Pitch presentations from some of the area''s top colleges and universities as well<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; as from our active tech. transfer programs<br />\r\n6.&nbsp; Learn how to become a smarter investor</p>\r\n\r\n<p>There are a limited number of unaffiliated angel investor spots available at the Angel Capital Expo.&nbsp; Please register early to guarantee a spot.&nbsp; Questions? Please contact Howard Lubert, Area President, at <a href="mailto:HLubert@KeiretsuForum-MidAtlantic.com">HLubert@KeirestuForum-MidAtlantic.com</a> or call (610) 971-4067.&nbsp; Keiretsu Forum Mid-Atlantic (K4-MA) was founded in Philadelphia in March, 2011 and has since expanded into the Washington DC, Pittsburgh, and New York areas.&nbsp; K4-MA is part of the Keiretsu Forum global angel investment network.</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 40, 40, 'und', 0, '<h1>Angel Capital Expo<sup>SM</sup></h1>\r\n\r\n<div id="inner-content">\r\n<p><img alt="ACE LOGO3" id="img-1376848633469" src="/sites/default/files/ACE-LOGO3.jpg" style="display:block; margin-left:auto; margin-right:auto" /></p>\r\n\r\n<h2>&nbsp;<br />\r\nOctober 23, 2013&nbsp;</h2>\r\n\r\n<h4>Hosted by Keiretsu Forum Mid-Atlantic<br />\r\nand Drexel University<span style="font-size:13px">&nbsp;</span></h4>\r\n\r\n<h3><span style="color:#ff0000"><strong>The Premier Gathering of the Angel Capital Community<sup>SM</sup></strong></span></h3>\r\n\r\n<p><span style="color:#000000"><strong>Wednesday, October 23, 2013 - 7:15am to 6:30pm &nbsp; &nbsp;</strong></span></p>\r\n\r\n<p><span style="color:#000000"><strong>Drexel University<br />\r\nBossone Building, 32nd &amp; Market Streets<br />\r\nPhiladelphia, PA</strong></span></p>\r\n\r\n<p><span style="color:#000000">Accredited Angel Investors, Venture Capital Principals, Private &amp; Family Wealth Professionals, and other members of the private equity community are cordially invited to join us at the 14th Angel Capital Expo (the first on the East Coast) on Wednesday, October 23, 2013.&nbsp; The Expo is Keiretsu Forum’s signature event bringing together investors and entrepreneurs looking for funding.<strong>&nbsp;</strong></span></p>\r\n\r\n<p><span style="color:#000000"><strong><a href="/about-the-angel-capital-expo/" target="_self" title="Click for more information.">Click for more information.</a></strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 41, 41, 'und', 0, '<h1>Keiretsu Forum Mid-Atlantic Angel Capital Expo<sup>SM</sup></h1>\r\n\r\n<div id="inner-content">\r\n<p><img alt="ACE LOGO3" id="img-1376848633469" src="/sites/default/files/ACE-LOGO3.jpg" style="display:block; margin-left:auto; margin-right:auto" /></p>\r\n\r\n<h2>&nbsp;<br />\r\n<span style="color:#000000"><strong>October 23, 2013&nbsp;</strong></span></h2>\r\n\r\n<h3>Hosted by Keiretsu Forum Mid-Atlantic<br />\r\nand Drexel University</h3>\r\n\r\n<div class="img-center-align">\r\n<p><img alt="K4 MA DREXEL LOGO SET2" id="img-1377196648973" src="/sites/default/files/K4-MA%20DREXEL%20LOGO%20SET2.jpg" /></p>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong><span style="color:#ff0000">The Premier Gathering of the Angel Capital Community<sup>SM</sup></span></strong></h2>\r\n\r\n<p><span style="color:#000000">Accredited Angel Investors, Venture Capital Principals, Private &amp; Family Wealth Professionals, and other members of the private equity community are cordially invited to join us at the 14th Angel Capital Expo (the first on the East Coast) on Wednesday, October 23, 2013.&nbsp; The Expo is Keiretsu Forum’s signature event bringing together investors and entrepreneurs looking for funding.<strong> <a href=" https://www.eventbrite.com/event/4236714126" target="_blank" title="REGISTER TO ATTEND">REGISTER TO ATTEND</a></strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#000000"><strong>EXPO:</strong> Wednesday, October 23, 2013 - 7:15am to 6:30pm &nbsp; &nbsp;</span></p>\r\n\r\n<p><span style="color:#000000"><strong>Drexel University<br />\r\nBossone Building, 32nd &amp; Market Streets<br />\r\nPhiladelphia, PA</strong></span></p>\r\n\r\n<h2><span style="color:#000000">Attendees<strong>&nbsp;</strong></span></h2>\r\n\r\n<p><span style="color:#000000">Angel Capital Expo is the premier gathering of the angel capital community and&nbsp;was created to foster collaboration among angel groups, as well as reach out to the larger investment community.&nbsp; Attendees include over 100 angel investors.&nbsp; If you would like to attend, please <a href=" https://www.eventbrite.com/event/4236714126" target="_blank" title="register online">register online</a>.&nbsp; For more information, contact Chuck Carter, Philadelphia Chapter President, at <a href="mailto:ccarter@keiretsuforum-midatlantic.com">CCarter@KeiretsuForum-MidAtlantic.com</a> or call +1 (215) 233-0342.&nbsp; Invitation is extended to <a href="http://www.sec.gov/answers/accred.htm" target="_blank">accredited investors</a> only<strong>.</strong></span></p>\r\n\r\n<h2><span style="color:#000000">Presenters</span></h2>\r\n\r\n<p><span style="color:#000000">Angel Capital Expo&nbsp;features 12 high-quality, diverse investment opportunities in technology, healthcare/life sciences, consumer products, energy/green tech., real estate, and other high growth investment silos.&nbsp; Companies that apply to Keiretsu Forum are typically in their A or B rounds having already secured initial funding of $250k to $1 million from founders, friends, family, and individual angels.</span></p>\r\n\r\n<p><span style="color:#000000">To apply to present at the Angel Capital Expo, please <a href="http://bit.ly/EXPOapp" target="_blank">complete the online application</a> and contact Chuck Carter, VP of Entrepreneur Services, at <a href="mailto:ccarter@keiretsuforum-midatlantic.com" target="_self" title="CCarter@KeiretsuForum-MidAtlantic.com">CCarter@KeiretsuForum-MidAtlantic.com</a> or call +1 (215) 233-0342.&nbsp; <u>Make sure to select the Mid-Atlantic Region on your application to be considered for this opportunity.</u>&nbsp; Keiretsu Forum is a global angel investment network and welcomes submissions&nbsp;from international companies.</span></p>\r\n\r\n<p><span style="color:#000000">All presenters will be pre-screened by a select committee&nbsp;of Keiretsu Forum members and due diligence fellows.&nbsp; Presentation coaching will be provided to companies selected to present.&nbsp; Each entrepreneur will make an on-stage&nbsp;presentation and will be available for additional discussion and due diligence at their exhibitor booth&nbsp;throughout the day.&nbsp; Following the presentations, the attendees will vote and award the top three&nbsp;presenting companies the “Most Valued Company” award.</span></p>\r\n\r\n<h2><span style="color:#000000">Agenda</span></h2>\r\n\r\n<p><span style="color:#000000">Please see the </span><a href="/sites/default/files/docs/Angel-Captial-Expo-Schedule-of-Events.pdf" target="_self" title="Schedule of Events">Schedule of Events</a>.</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 42, 42, 'und', 0, '<h1>ACE<sup>SM</sup>&nbsp;Schedule of Events</h1>\r\n\r\n<div id="inner-content"><a href="/sites/default/files/docs/Angel-Captial-Expo-Schedule-of-Events.pdf" target="_self" title="docs/Angel Capital Expo Schedule of Events.pdf">docs/Angel Capital Expo Schedule of Events.pdf</a>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="ACE LOGO3" id="img-1376848633469" src="/sites/default/files/ACE-LOGO3.jpg" /></p>\r\n\r\n<h3><strong>Drexel University<br />\r\nBossone Building, 32nd &amp; Market Streets<br />\r\nPhiladelphia, PA</strong></h3>\r\n\r\n<p><em><span style="color:#000000">For a printable, downloadable version of the Schedule of Events please&nbsp;</span><a href="/sites/default/files/docs/ACE_Schedule-of-Events2.pdf" target="_self" title="CLICK HERE">CLICK HERE</a>.</em></p>\r\n\r\n<p><a href="http://www.keiretsuforum-midatlantic.com/Portals/188336/docs/Angel Capital Expo Schedule of Events.pdf" target="_self"><img alt="ACE1" class="alignCenter" id="img-1378993080339" src="/sites/default/files/ACE12.jpg" style="display:block; height:150px; margin-left:auto; margin-right:auto; width:600px" /></a></p>\r\n\r\n<p><img alt="ACE2" class="alignCenter" id="img-1378993088202" src="/sites/default/files/ACE21.jpg" style="display:block; height:300px; margin-left:auto; margin-right:auto; width:600px" /></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 43, 43, 'und', 0, '<h1>Angel Capital Expo<sup>sm</sup> Sponsor Opportunities</h1>\r\n\r\n<div id="inner-content">\r\n<h1><img alt="describe the image" id="img-1377284185139" src="/sites/default/files/ACE-LOGO3.jpg" /></h1>\r\n\r\n<h2>&nbsp;<span style="color:#ff0000"><strong>Sponsorship Opportunities</strong></span></h2>\r\n\r\n<p>&nbsp;Download the Angel Capital Expo Sponsorship Form <a href="/sites/default/files/docs/keiretsu-forum-mid-atlantic-angel-capital-expo-sponsor-form.pdf" target="_self" title="here">here</a>.&nbsp;</p>\r\n\r\n<p><span style="color:#000000"><strong>Wednesday, October 23, 2013 - 7:15am to 6:30pm&nbsp;&nbsp;&nbsp;&nbsp; </strong></span></p>\r\n\r\n<p><span style="color:#000000"><strong>Drexel University<br />\r\nBossone Building</strong></span>, <span style="color:#000000"><span style="color:#000000"><strong>32nd and Market Streets</strong><br />\r\n<span style="color:#000000"><strong>Philadelphia, PA</strong></span></span></span></p>\r\n\r\n<p><span style="color:#000000"><em>Keiretsu Forum is the world''s largest private equity angel investment network with more than 900 accredited investors in 27 chapters on 3 continents who have invested more than $400m in early stage opportunities.&nbsp;</em></span></p>\r\n\r\n<p><span style="color:#000000">The Keiretsu Forum Mid-Atlantic Region Angel Capital Expo (ACE) will showcase 12 high-quality, diverse investment opportunities from technology, healthcare/life sciences, consumer products, energy/green tech., real estate, and other high growth investment silos.&nbsp; The event will be open to Angel Investors, Private and Family Wealth Managers, and Venture Capital firms and promises to attract 100-150 of the top investors in the region.&nbsp; There will be representatives from many of the West Coast and International Keiretsu Forum Chapters in attendance as well.&nbsp; The inclusion of the second Israeli Innovation Showcase into the ACE program should generate significant attendance among investors keen on Israel DealFlow.</span></p>\r\n\r\n<p><span style="color:#000000">Sponsorship opportunities include underwriting of event modules. If you would like to become an Angel Capital Expo sponsor, please fill out our <a href="https://adobeformscentral.com/?f=WYVzCgx1ix7ZA4jEc4UrmQ" target="_self" title="sponsorship form">sponsorship form</a>. &nbsp;</span></p>\r\n\r\n<p><span style="color:#000000">There are a limited number of sponsorship opportunities at the Angel Capital Expo for professional organizations interested in exposure to this audience.&nbsp; Please contact Howard Lubert, Area President, at <a href="mailto:HLubert@KeiretsuForum-MidAtlantic.com"><span style="color:#000000">HLubert@KeirestuForum-MidAtlantic.com</span></a> or call (610) 971-4067.&nbsp; Keiretsu Forum Mid-Atlantic (K4-MA) was founded in Philadelphia in March, 2011 and has since expanded into the Washington DC, Pittsburgh, and New York areas. K4-MA is part of the Keiretsu Forum global angel investment network.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'webform', 0, 45, 45, 'und', 0, '<h1>Contact Your Angel Investment Network</h1>\r\n\r\n<div id="inner-content">\r\n<h2>We’ll Get Back To You As Soon As Possible</h2>\r\n\r\n<p>Fill out the form below, choosing the appropriate category of your request in the subject line drop-down menu.&nbsp; A representative of Keiretsu Forum Mid-Atlantic will respond to your request as soon as possible.&nbsp; Thank you for your interest.</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 46, 46, 'und', 0, '<h1>Your Connection To Angel Investment Opportunities</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Meet Locally To See Globally</h2>\r\n\r\n<p>The calendar below provides the dates, times and other information for Forum meetings and other Keiretsu Forum Mid-Atlantic events for angel investors. Hover over the event for details and click to fill out a contact form requesting attendance.</p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 47, 47, 'und', 0, '<h1>Sensible Investments: The Only Ones<br />\r\nWorth Making</h1>\r\n\r\n<div>\r\n<div>\r\n<h2>Insight Into Keiretsu’s Dedication To Due Diligence</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724823742" src="/sites/default/files/angel-investing-3.jpg" style="float:right" />As an investor, you must be comfortable with taking a certain amount of risk to access rewarding opportunities. As a <em>smart</em> investor, you reduce this risk with strict adherence to due diligence. This investigative phase consists of methodical steps to assess each opportunity, steps that are enhanced with your industry expertise -- you know what to look for in a business plan and how to differentiate between grounded innovation and unfounded ideas. The result is a comprehensive report that determines the potential for a reliable return on your investment.</p>\r\n\r\n<p>Members of Keiretsu Forum Mid-Atlantic (K4-MA)&nbsp;have the opportunity to work among the smartest and most experienced investors -- professionals who are passionate about well-informed investment opportunities and therefore dedicated to meticulous due diligence procedures. To provide some insight into this dedication to reducing risk, we have outlined a few frequently asked questions about Keiretsu Forum’s Due Diligence program.</p>\r\n\r\n<ul>\r\n	<li><strong>Who Conducts Due Diligence?</strong><br />\r\n	As a member of Keiretsu Forum Mid-Atlantic, you work with fellow members and our Due Diligence Fellows to perform due diligence for each investment opportunity that garners enough interest by our members to move forward. The typical due diligence team is assembled within two weeks of the company’s presentation at our Forum meetings and we strive to complete the process in six to eight weeks. While all interested members cooperate and collaborate to perform a comprehensive investigation, each member is responsible for making his or her own investment decisions.<br />\r\n	&nbsp;</li>\r\n	<li><strong>How Do I Evaluate A Company?</strong><br />\r\n	Keiretsu Forum offers step-by-step guidance on how to properly perform due diligence and offers a half-day Due Diligence Class every quarter. These instructions are particularly valuable to investors who are new to our due diligence process, but it’s also an excellent idea for anyone who has questions or needs refreshed instruction. For information on our next due diligence training session,&nbsp;<a href="mailto:hlubert@KeiretsuForum-MidAtlantic.com" target="_blank" title="contact Howard Lubert">contact Howard Lubert</a>.<br />\r\n	&nbsp;</li>\r\n	<li><strong>What Elements Of The Business Should I Focus On?</strong><br />\r\n	While every business is unique and each due diligence process is different, there are some general procedures to follow. Each due diligence process should review the company’s articles of incorporation, financial situation and both physical and intellectual assets of the company. This gives you insight into the legitimacy of the business and its ability to make a return on investment for you. For a more detailed list of what’s investigated during the Keiretsu Forum Due Diligence process,&nbsp;<a href="mailto:hlubert@KeiretsuForum-MidAtlantic.com" target="_blank" title="contact Howard Lubart">contact Howard Lubert</a> to join our next training session.<br />\r\n	&nbsp;</li>\r\n	<li><strong>How Else Does Keiretsu Forum’s Due Diligence Process Benefit Me?</strong><br />\r\n	As a Keiretsu Mid-Atlantic member, you gain access to K4-DealRoom.com. From this website, members from around the world can analyze the due diligence reports for business deals presented to other chapters. This gives you access to investment opportunities -- and reports of the thorough investigation that went into ensuring their legitimacy -- around the globe.</li>\r\n</ul>\r\n\r\n<p>When it comes to due diligence, there is a thin, yet crucial line between a thorough investigation and an exhaustive, intrusive dissection. This latter strategy often offends the entrepreneur and creates a wall of distrust, hindering any chance for partnership. This is why K4-MA has taken every step possible to refine our due diligence process. We’re proud of our investors’ ability to reduce the risk of their angel investments while, at the same time, laying down foundations for strong, trusting relationships with potential partners.</p>\r\n\r\n<p><strong>If you’re interested in joining Keiretsu Forum Mid-Atlantic and merging your industry expertise with that of our experienced and dedicated investors, contact Howard Lubert at <a href="mailto:hlubert@KeiretsuForum-MidAtlantic.com" target="_blank" title="hlubert@KeiretsuForum-MidAtlantic.com">hlubert@KeiretsuForum-MidAtlantic.com</a> or 607.971.4067.</strong></p>\r\n\r\n<p><a href="/node/45"><img alt="EXTEND YOUR INVESTMENT REACH" class="hs-cta-img" id="hs-cta-img-c0814334-9ece-453b-9037-f18e44963774" src="/sites/default/files/aea18d9a-780e-4fdf-b55b-60dffc0b65c4.png" style="border-width:0px; height:33px; width:273px" /></a></p>\r\n</div>\r\n</div>\r\n', '', 'full_html');
INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 48, 48, 'und', 0, '<h1>The Risks And Rewards Of Investing In Foreign Companies</h1>\r\n\r\n<div id="inner-content">\r\n<h2>With Great Risk Comes Great Reward,<br />\r\nAnd Vice Versa</h2>\r\n\r\n<p><img alt="describe the image" class="alignRight" id="img-1349724823742" src="/sites/default/files/private-equity-investors.jpg" style="float:right" />Investing in international entrepreneurs is a unique opportunity to expand your investment endeavors to the global spectrum. It presents the possibility to penetrate markets that you have not yet explored and experience cultures different from your own.</p>\r\n\r\n<p>But does it expand your <em>return</em> on investment? Which has more weight, the risk or the reward?</p>\r\n\r\n<h3>THE REWARDS</h3>\r\n\r\n<p>The three main reasons people invest in foreign companies are as follows:</p>\r\n\r\n<ol>\r\n	<li><strong>Portfolio Fortification</strong><br />\r\n	Business happens all over the world, so it goes without saying that the potential for investment opportunities is also global. Expanding your investments into foreign economies allows you to explore emerging markets that have yet to reach their potential, such as those in Eastern Europe and the Pacific Rim. Israel, a stronghold of entrepreneurial spirit and technological innovation, is an especially desirable market for investors -- often referred to as the “start-up nation.” Foreign investments are especially advantageous at times when the U.S. markets and economy aren’t prime for investing.</li>\r\n	<li><strong>Portfolio Diversification</strong><br />\r\n	Exposing your portfolio to both foreign and domestic stocks diversifies your investments, reducing your risk by spreading it out over a wider geographic area and into multiple economies and markets.</li>\r\n	<li><strong>Personal Interest</strong><br />\r\n	Some investors seek entrepreneurs from countries in which they have emotional, familial or religious attachments.&nbsp;They see these investments as ways to help the countries’ economies grow because the successes of startup companies lead to greater employment and revenues.&nbsp;Of course, the attachment to the country is paired with an expectation of significant ROI.</li>\r\n</ol>\r\n\r\n<p><em>"... diversifying internationally is one way for investors to avoid effectively ‘betting’ solely on the U.S."</em><br />\r\n<strong>-- Gregg Fisher,</strong> founder, president and CIO of investment management and advisory firm, Gerstein Fisher</p>\r\n\r\n<h3>THE RISKS</h3>\r\n\r\n<p>The reality is that there is always an element of risk when investing, whether you invest solely in domestic companies or you branch out to foreign opportunities. However, one must be aware of three risks that are specific to international investments.</p>\r\n\r\n<ol>\r\n	<li><strong>Political, Economic And Cultural Events</strong><br />\r\n	Investing internationally exposes your capital to environments that vary in political and economic stability, especially the emerging markets of less developed countries. These markets may fall sharply or rise dramatically, frustrating investors who rely on “timing” markets. These markets operate with different procedures than the domestic ones you’re familiar with. Cultural forces which you may not be aware of can dramatically impact the market.</li>\r\n	<li><strong>Legal Issues</strong><br />\r\n	With your money in the hands of a foreign company, it is subject to legal entanglement between the company’s home country and the U.S. If you end up needing to take legal action, the issue may not be resolved as cleanly as it would be in the U.S. with a domestic company.<br />\r\n	<br />\r\n	If you take the lawsuit against a foreign company <em>inside</em> the U.S. and win, there’s a good chance you won’t even collect on the settlement because of jurisdiction issues. In most cases, the lawsuit would have to be resolved in the company’s home country.</li>\r\n	<li><strong>Currency Fluctuations</strong><br />\r\n	The value of your capital is subject to currency exchange rates and, therefore, the return you see is dependent on how strong or weak the dollar is in comparison to the foreign market’s currency. This may or may not work to your advantage. If the dollar weakens, your return is higher, but if the dollar grows stronger, your return may be lower than expected.</li>\r\n</ol>\r\n\r\n<p>With great risk often comes great reward. But a smart investor, who has the ability to tap into expertise and resources offered by Keiretsu Forum, knows how to balance the risk-reward equation and diversify his portfolio with caution and <a href="/node/29" target="_self" title="thorough due diligence">thorough due diligence</a>.</p>\r\n\r\n<p><strong>To diversify your portfolio with investment prudence, <a href="/node/45" target="_self" title="contact Keiretsu Forum Mid-Atlantic">contact Keiretsu Forum Mid-Atlantic</a> or <strong>call 607.971.4067 to speak to Howard Lubert.</strong></strong></p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 49, 49, 'und', 0, '<h1>Seven Critical Questions To Ask When Selecting An Angel Investment Group</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Download Your Free Report</h2>\r\n\r\n<p><img alt="Angel Group: Free Report" class="alignRight" id="img-1349724823742" src="/sites/default/files/angel-group-free-report.jpg" style="float:right" /> An angel group plays an integral role in nurturing your developing business. From providing you with the resources necessary to grow your business to securing much needed venture capital, angel investors offer you the tools your company needs to succeed. But how do you select the angel investment group that’s right for you?</p>\r\n\r\n<p>Enter your email address in the field below and we’ll send you <em>Seven Critical Questions To Ask When Selecting An Angel Investment Group</em>, an informative free report detailing the most important questions you need to ask when determining the angel group that best fits your company''s needs.</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 50, 50, 'und', 0, '<h1>Five Reasons To Consider Joining An Angel Investor Network</h1>\r\n\r\n<div>\r\n<h2>Download Your Free Guide</h2>\r\n\r\n<p><img alt="Angel Investors: Free Guide" class="alignRight" id="img-1349708025409" src="/sites/default/files/angel-investors-free-guide.jpg" style="float:right" /> From ensuring a return on your investment to exploring the best investment opportunities available and gaining access to a wealth of informative resources, angel investors receive many great benefits when they join an angel investor network.</p>\r\n\r\n<p>Enter your email address in the field below and we’ll send you <em>Five Reasons To Consider Joining An Angel Investor Network</em>, an informative free guide detailing the top reasons why joining an angel investor network provides you with the resources you need to find the right investment opportunities for you and increase the performance of your portfolio.</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 51, 51, 'und', 0, '<h1>Three Things You Must Know About Angel Groups Before Investing</h1>\r\n\r\n<div id="inner-content">\r\n<h2>Download Your Free Must Know Guide</h2>\r\n\r\n<p><img alt="Angel Investor Guide" class="alignRight" id="img-1349707542364" src="/sites/default/files/angel-investor-guide.jpg" style="float:right; height:246px; width:190px" /> Every investment requires careful research, consideration and forethought to be successful. As a potential angel investor, you want to ensure your angel investing experience is profitable and rewarding. Before you get started though, it’s important to know a few things about angel groups first.</p>\r\n\r\n<p>Enter your email address in the field below and we’ll send you <em>Three Things You Must Know About Angel Groups Before Investing</em>, an informative free guide detailing the top things you must know in order to successfully invest with an angel group.</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'blog', 0, 55, 55, 'und', 0, '<p>SA<img alt="describe the image" class="alignLeft" id="img-1400081731899" src="/sites/default/files/k4%20academy%20logo.png" style="float:left" />N FRANCISCO, CA (Marketwired via COMTEX) -- Keiretsu Forum announces the publishing of its Due Diligence Handbook in the Apple iBook store as a free resource for angel investors and entrepreneurs. As the world''s largest private equity angel investment network, Keiretsu Forum provides a leading voice in developing best practices in conducting due diligence. The Due Diligence Handbook outlines the investment group''s due diligence process and provides useful resources that support angel investors in their process of evaluating potential investments.</p>\r\n\r\n<p>Randy Williams, Founder &amp; CEO of Keiretsu Forum, announced the publishing of Keiretsu Forum''s Due Diligence Handbook on May 1, 2014 in front of an audience of over 500 angel investors at Keiretsu Forum''s 18th bi-annual Angel Capital Expo held at Microsoft in Mountain View. "Up until now, the Due Diligence Handbook was only made available to Keiretsu Forum''s 1,100 members in its 30 chapters around the world. Now, Keiretsu Forum is offering this resource to the world free of charge in order to increase communication and collaboration among all angel investors everywhere," said Williams.</p>\r\n\r\n<p>The Handbook can be downloaded via the Apple iBook store for iPads and Apple computers, and will soon be available in the Apple iBook store for iPhones, via Google play, Kobo, and Scribd, and for the Kindle and Nook. A similar version can be downloaded as a PDF at the Keiretsu Forum web site.</p>\r\n\r\n<p>"A cohesive due diligence process in a group setting gives both investors and entrepreneurs the opportunity to benefit from the diverse experience of multiple investors. This Handbook was designed to guide investors through the most important part of the process: conducting a rigorous examination of the many factors that may affect future outcomes," said Michael Gralnick, Chairman of Keiretsu Forum''s Due Diligence Committee.</p>\r\n', '', 'full_html'),
('node', 'blog', 0, 56, 56, 'und', 0, '<p><img alt="describe the image" class="alignLeft" id="img-1398101756130" src="/sites/default/files/k4-lapelpinfinal3-100px.jpg" style="height:97px; width:67px" />The <a href="http://sciencecenter.cal.basecampbusiness.com/node/697669">UC KIZ Funder''s Fair</a> at the Quorum in Philly was a great chance to see what investor groups are currently looking to fund.&nbsp; Twelve representatives from local angel and venture capital companies did presentations on what they are looking to invest in.&nbsp; There was a lot of good advice for startups that are looking to go this route. Below is a summary of what Keiretsu Forum Mid-Atlantic investors said they are looking for in a startup.</p>\r\n\r\n<p>Keiretsu Forum Mid-Atlantic is an angel group that functions like a fund. We focus on high tech, clean green tech, consumer products and life sciences.<br />\r\n<br />\r\nAverage funding amount:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Our sweet spot is A &amp; B round investment opportunities in the $250K to $3M range</p>\r\n	</li>\r\n	<li>\r\n	<p>We have done a $6.2M Series B round!</p>\r\n	</li>\r\n	<li>\r\n	<p>We have had one member write an investment check for $1M</p>\r\n	</li>\r\n	<li>\r\n	<p>Our members typically invest $25-50K in 3-8 deals/year</p>\r\n	</li>\r\n	<li>\r\n	<p>We create Single Purpose LLCs for smaller investments</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Advice for companies interested in funding from Keiretsu Forum Mid-Atlantic:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>We are womb to tomb investors - from application to liquidity event - and we expect our portfolio companies to be led by professionals who are both invested 110% and passionate about what they are doing.</p>\r\n	</li>\r\n	<li>\r\n	<p>We do not suffer fools lightly.&nbsp; Be sure you know your stuff before you engage with us.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'full_html'),
('node', 'blog', 0, 57, 57, 'und', 0, '<p><a href="http://www.keiretsuforum.com/"><img alt="PENSCO" class="featured-image wp-post-image" id="img-1396393494615" src="/sites/default/files/PENSCO-300x214.jpg" style="height:81px; width:114px" title="PENSCO" /></a></p>\r\n\r\n<p><a href="http://www.keiretsuforum.com/">Keiretsu Forum</a>, the world’s largest private equity angel investment network and <a href="https://www.pensco.com/">PENSCO</a> Trust Company, a leading alternative asset custodian announce today a partnership that will allow Keiretsu Forum’s angel investor members access to PENSCO’s custodial services to invest in private equity deals using retirement funds.Keiretsu Forum and PENSCO Announce Partnership to Allow Angel Investors Ability to Invest in Private Equity using Retirement Account Funds</p>\r\n\r\n<p>“We look forward to working with PENSCO to continue to add value to our angel investor members,” said <a href="http://www.keiretsuforum.com/about/team/">Randy Williams</a>, Founder &amp; CEO of Keiretsu Forum. “I believe our members are looking for this kind of opportunity to use their retirement dollars to fund startups they believe in, and PENSCO, as a leader in the self-directed IRA business, is ready to serve this growing market.”</p>\r\n\r\n<p>“Many investors are unaware that they can use money from self-directed IRAs to invest in private equity, private stock and real estate,” said <a href="https://www.pensco.com/AboutUs/Management">Kelly Rodriques</a>, CEO of PENSCO. “We think this partnership with Keiretsu will give more angel investors the ability to pursue their passion for investing in emerging businesses while diversifying their retirement funds beyond the typical stock market investments.”</p>\r\n\r\n<p>Private equity includes investments in privately held companies and private equity funds, as well as hedge funds, Limited Liability Partnerships (LLPs) and Limited Liability Corporations (LLCs).</p>\r\n\r\n<p>According to PENSCO, private equity is the fastest-growing investment held by its clients in self-directed IRAs, followed by real estate, unsecured notes, secured notes and precious metals.</p>\r\n\r\n<p>Keiretsu Forum and PENSCO will hold an educational webinar on Thursday, April 3, 2014 from 1:00 p.m. to 1:45 p.m. PDT on demystifying the angel investment process. <a href="https://www.sec.gov/answers/accred.htm">Accredited investors</a> interested in attending the webinar can <a href="http://info.pensco.com/webinar-040314-kf">register on this link</a>.</p>\r\n\r\n<p><strong>About Keiretsu Forum*</strong></p>\r\n\r\n<p>Keiretsu Forum was founded in 2000 by Randy Williams in the San Francisco Bay Area. With 29 chapters and over 1,100 accredited investor members, Keiretsu Forum is the world’s largest invite-only angel investor network. Keiretsu Forum members provide early stage capital in the range of $250k – 2 million in high quality, diverse investment opportunities and collaborate in the due-diligence, but make their own individual investment decisions. Through the Keiretsu Forum, more than $400 million of capital has been invested into technology, consumer products, Internet, healthcare, life sciences and real estate companies. For more information, visit <a href="http://www.keiretsuforum.com/">www.keiretsuforum.com</a>.</p>\r\n\r\n<p><strong>About PENSCO**</strong></p>\r\n\r\n<p>PENSCO Trust Company has been helping investors use their retirement account funds to invest in real estate, private equity and other non-exchange traded assets since 1989.&nbsp; As the industry’s premier self-directed IRA custodian, we know exactly what it takes to buy, hold and sell alternative assets in retirement accounts.&nbsp;As the trusted custodian of over $10 Billion in assets, PENSCO works with over 50,000 clients across the U.S.&nbsp;To learn more visit www.pensco.com or call (866) 818-4472.</p>\r\n\r\n<p>*Keiretsu Forum is a facilitator bringing together investors and early stage companies offering generally high-risk investments. Keiretsu Forum is not affiliated with the presenting companies and does not endorse, invest in, assist with investment in or recommend any of the companies (or the securities of such companies) that may seek funding through Keiretsu Forum members, and receives no success fees or other compensation for any funding that may occur (although Keiretsu Forum members and/or volunteers may have an economic interest or affiliation with presenting companies which Keiretsu Forum requires they disclose). Accordingly, any information or representations given or made by any presenting companies must not be relied upon as having been reviewed for accuracy or authorized by Keiretsu Forum. Any offers to, or investments made, by a member of Keiretsu Forum will be to or in his, her or its individual capacity and not on behalf of Keiretsu Forum. Consequently, investors must conduct their own due diligence in connection with any investment in companies, including but not limited to legal, tax and investment advice.</p>\r\n\r\n<p>**PENSCO Trust Company performs the duties of an independent retirement custodian, and, as such, does not provide investment advice, sell investments or offer any tax or legal advice. Potential clients are advised to perform their own due diligence in choosing an attorney, tax advisor, or any investment opportunity. Alternative investments are not FDIC insured and are subject to risk, including loss of principal.</p>\r\n', '', 'full_html'),
('node', 'blog', 0, 58, 58, 'und', 0, '<p>In October, Keiretsu Forum Mid-Atlantic hosted the first ever east coast angel capital expo at Drexel University. The event was a huge success and brought together more than 150 accredited investors and 12+ early stage companies. On May 1st, the West Coast chapters of Keiretsu Forum will host their own angel capital expo in San Francisco.&nbsp;<img alt="describe the image" class="alignLeft" id="img-1394470843605" src="/sites/default/files/ace-logo3.jpg" style="float:left; height:114px; width:221px" /></p>\r\n\r\n<p>SAN FRANCISCO, CA -- (Marketwired) -- 03/06/14 -- Keiretsu Forum, the world''s largest private equity angel investment network, announces its 18th bi-annual Angel Capital Expo on Thursday, May 1st, 2014 from 7:30 a.m. to 3:30 p.m. at Microsoft, 1065 La Avenida Street in Mountain View, California.</p>\r\n\r\n<p>Angel Capital Expo is the premier gathering of angel investors and entrepreneurs seeking funding capital to grow their businesses. On May 1st more than 300 of the Bay Area''s most active and respected angel investors will attend the Expo. <a href="http://ctt.marketwire.com/?release=1095811&amp;id=3973429&amp;type=1&amp;url=http%3a%2f%2fwww.youtube.com%2fwatch%3ffeature%3dplayer_embedded%26v%3dbi6fEORKrzk" rel="nofollow">View video from the November 21st, 2013 Angel Capital Expo</a>.</p>\r\n\r\n<p>"Our Angel Capital Expo provides a unique opportunity for collective collaboration in the world of angel investing," said Randy Williams, Founder and CEO of Keiretsu Forum. "We are proud to play a seminal role in the growth of start-up businesses and job creation at a local, national and international level."</p>\r\n\r\n<p>Angel Capital Expo will feature a dozen presentations from early stage companies in technology, life sciences, consumer products, real estate, financial services, social ventures, and other segments with high growth potential. All presenters will be pre-screened by a select committee of Keiretsu Forum members. Each entrepreneur will make a 15-minute presentation and will be available for additional discussion and due diligence at their exhibitor booth throughout the day. Following the presentations, the attendees will vote and award the top three presenting companies the "Most Valued Company" award.</p>\r\n\r\n<p><em>Apply to Present</em><br />\r\nCompanies interested in presenting at the May 1st, 2014 Angel Capital Expo should contact Jenny Pater, Associate for Entrepreneur Services, at <a href="mailto:jpater@keiretsuforum.com" rel="nofollow">jpater@keiretsuforum.com</a> or call +1 (415) 573-0752. On-line application is available at <a href="http://ctt.marketwire.com/?release=1095811&amp;id=3973435&amp;type=1&amp;url=http%3a%2f%2fbit.ly%2fEXPOapp" rel="nofollow">http://bit.ly/EXPOapp</a>.</p>\r\n\r\n<p><em>Register to Attend</em><br />\r\nHosted by Keiretsu Forum, the Angel Capital Expo is the premier gathering of the angel capital community. Invitation to attend is extended only to <a href="http://ctt.marketwire.com/?release=1095811&amp;id=3973438&amp;type=1&amp;url=https%3a%2f%2fwww.sec.gov%2fanswers%2faccred.htm" rel="nofollow">accredited investors</a>. On-line registration is available at <a href="http://ctt.marketwire.com/?release=1095811&amp;id=3973441&amp;type=1&amp;url=http%3a%2f%2fmay1angelexpo.eventbrite.com%2f" rel="nofollow">http://may1angelexpo.eventbrite.com</a>. For more information, contact Sonja Markova, Managing Director, at <a href="mailto:sonja@keiretsuforum.com" rel="nofollow">sonja@keiretsuforum.com</a> or call +1 (415) 573-0751.</p>\r\n\r\n<p><em>About Keiretsu Forum</em><br />\r\nKeiretsu Forum was founded in 2000 by Randy Williams the San Francisco Bay Area. With 29 chapters and over 1,100 accredited investor members, Keiretsu Forum is the world''s largest invite-only angel investor network. Keiretsu Forum members provide early stage capital in the range of $250k - 2 million in high quality, diverse investment opportunities and collaborate in the due-diligence, but make their own individual investment decisions. Through the Keiretsu Forum, more than $400 million of capital has been invested into technology, consumer products, Internet, healthcare, life sciences and real estate companies. For more information, visit <a href="http://ctt.marketwire.com/?release=1095811&amp;id=3973483&amp;type=1&amp;url=http%3a%2f%2fwww.keiretsuforum.com%2f" rel="nofollow">www.keiretsuforum.com</a>.</p>\r\n', '', 'full_html'),
('node', 'blog', 0, 59, 59, 'und', 0, '<p><strong>Keiretsu Forum Mid-Atlantic is proud to co-host the West Chester University Business Idea Competition</strong>.</p>\r\n<p>Sponsored by Chester County SCORE and co-hosted by the Dr. Edwin Cottrell Entrepreneurial Leadership Center and the Keiretsu Forum Mid-Atlantic, the competition promotes creativity and idea generation at West Chester University and Chester County by recognizing innovative ideas for new products, services and technology.</p>\r\n<p>The contest is open to West Chester University undergraduate and graduate students and alumni, and SCORE Chester County clients are eligible and encouraged to compete. The goals of the competition are to foster idea generation and to facilitate commercialization of business ideas, organizers say. Prizes include cash and coaching services.</p>\r\n<p>To enter, submit ideas at <a href="http://www.dailylocal.com/general-news/20140226/wcubizideas2014.istart.org">wcubizideas2014.istart.org</a> by 4 p.m. Thursday, March 27. The ideas will be reviewed by business investors and experts. The most promising ideas will be selected as semifinalists and presented at the 2014 Business Idea Pitch on April 23. Investors from the Keiretsu Forum Mid-Atlantic and business experts will select the top three ideas pitched.</p>\r\n<p><a href="http://www.dailylocal.com/general-news/20140226/entrepreneurs-sought-for-wcu-business-idea-contest" title="Click here for more information" target="_blank">Click here for more information</a></p>\r\n<p>West Chester Univeristy is a Partner of Keiretsu Forum Mid-Atlantic.</p>', '', 'full_html'),
('node', 'blog', 0, 60, 60, 'und', 0, '<p><img alt="describe the image" class="alignLeft" id="img-1392047810613" src="/sites/default/files/logo.gif" style="float:left; height:98px; width:373px" />Due to the winter storm last month, the due diligence training session has been rescheduled for Wednesday February 12th after the screening meeting in Philadelphia.<strong> </strong>Mid-Atlantic President Howard Lubert will explain Keiretsu''s rigorous due diligence process and answer questions about how to properly put together a final report. All members who have not yet had the training are encouraged to attend<strong>. </strong>The new group of&nbsp;<a href="/fellowship-program/" target="_blank" title="Due Diligence Fellows ">Due Diligence Fellows </a>will receive training as well. Contact <strong>info@keiretsuforum-midatlantic.com</strong> if you would like to attend. The workshop will take place at the law office of BakerHostetler, formerly Woodcock Washburn, in the Cira Center (same location as the meeting). The training will run from 12:30-3:30 (approximately) and lunch will be provided. The session will also be broadcast online to members who request access.&nbsp;</p>\r\n', '', 'full_html'),
('node', 'blog', 0, 61, 61, 'und', 0, '<p>Keiretsu Forum Mid-Atlantic (K4-MA) – with chapters in Philadelphia, Washington, D.C., Pittsburgh, and New York and part of the global Keiretsu Forum angel network – will present five early-stage companies to investors at next week’s monthly forum event. The meeting will showcase two technology companies, one life science company, one consumer company and one clean-green energy technology company* at meetings in New York, Philadelphia, Washington, D.C., and Pittsburgh. Attendance is by invitation only.</p>\r\n\r\n<p>More than 100 accredited investors will see the same companies present their business investment opportunities in New York on Tuesday, January 21; in Philadelphia on Wednesday, January 22; in Washington, D.C on Thursday, January 23; and in Pittsburgh on Friday, January 24.</p>\r\n\r\n<p>Two of the K4-MA cities are among the five top metropolitan regions for life sciences venture funding. According to recent data from the PricewaterhouseCoopers LLP/National Venture Capital Association MoneyTree™ Report, based on data from Thomson Reuters, venture capitalists invested $1.4 billion in 167 life sciences deals during the first quarter of 2013. New York was one of three of the five regions that saw double-digit increases in investing in Q1 2013, increasing 66 percent, while the Washington, D.C. metro area grew 53 percent. The top five metropolitan regions that received life sciences venture capital funding during Q1 2013 included the San Francisco Bay at $427 million, Boston at $273 million, the San Diego Metro at $122 million, the New York Metro at $106 million, and the Washington Metroplex at $100 million. These top five regions captured 74 percent of the dollars invested in life sciences companies in the first quarter of 2013. Biotechnology companies accounted for 68 percent of the dollars invested in life sciences deals in the top five metro regions.</p>\r\n\r\n<p><strong>Due Diligence Training Session</strong></p>\r\n\r\n<p>After the Philadelphia forum meeting on Wednesday January 22nd, the K4-MA management team will run a Due Diligence Workshop for new members and <strong><a href="/fellowship-program/" target="_blank" title="due diligence fellows">due diligence fellows</a>. </strong>Chapter president Howard Lubert will explain Keiretsu''s rigorous due diligence process and answer questions about how to properly put together a final report. All members who have not yet had the training are encouraged to attend<strong>. </strong>Contact <strong>info@keiretsuforum-midatlantic.com</strong> if you would like to attend. The workshop will take place at the law offices of BakerHostetler, formerly Woodcock Washburn, in the Cira Center (same location as the meeting).&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>*Due to the new SEC 506(c) ruling made in September 2013, Keiretsu Forum cannot disclose the names of the companies that will be presented at these events until after funding is received.</p>\r\n', '', 'full_html'),
('node', 'blog', 0, 62, 62, 'und', 0, '<p>Silicon Valley; Austin, TX; Boston, MA; New York City. When people mention "startup hubs" these are the cities that typically come to mind. For years, aspiring entrepreneurs flocked to these areas if they wanted to start or grow a business. However, over the past few years, Philadelphia has quietly built a very strong entrepreneurial ecosystem. <img alt="describe the image" class="alignLeft" id="img-1389130063366" src="/sites/default/files/untitled.png" style="float:left; height:198px; width:264px" /></p>\r\n\r\n<p>While the rest of the nation generally saw declines in the number of venture capital dollars and deals last year, Philadelphia saw a <strong>17% increase</strong> in the number of financing deals. In a joint report entitled <a href="https://urldefense.proofpoint.com/v1/url?u=http://benfranklintechnologypartnerssep.cmail1.com/t/j-l-thskrl-fdlkyllt-b/&amp;k=irCpHVC7DzKmry2FUFdCpg%3D%3D%0A&amp;r=dLUcRaPLjI7esu7GD9ySY55vchRGRLjXt%2F5K8DPjoz4%3D%0A&amp;m=%2FcRrfIc%2Fiycf3hgMoI4GcOGtV11MDQ9phCXWaPCGcN8%3D%0A&amp;s=2272f9801165ab9463c6150e06629709740e612fafb3bcc262f4fd1cd5f0b70f"><em><strong>Venture Impact</strong></em></a>, <a href="https://urldefense.proofpoint.com/v1/url?u=http://benfranklintechnologypartnerssep.cmail1.com/t/j-l-thskrl-fdlkyllt-n/&amp;k=irCpHVC7DzKmry2FUFdCpg%3D%3D%0A&amp;r=dLUcRaPLjI7esu7GD9ySY55vchRGRLjXt%2F5K8DPjoz4%3D%0A&amp;m=%2FcRrfIc%2Fiycf3hgMoI4GcOGtV11MDQ9phCXWaPCGcN8%3D%0A&amp;s=45b1d4dc98afb8938de47793b8de55a70139f3affab94b10801a1ffd48bf8f80"><strong>Ernst &amp; Young LLP</strong></a>, early-stage investor <a href="https://urldefense.proofpoint.com/v1/url?u=http://benfranklintechnologypartnerssep.cmail1.com/t/j-l-thskrl-fdlkyllt-p/&amp;k=irCpHVC7DzKmry2FUFdCpg%3D%3D%0A&amp;r=dLUcRaPLjI7esu7GD9ySY55vchRGRLjXt%2F5K8DPjoz4%3D%0A&amp;m=%2FcRrfIc%2Fiycf3hgMoI4GcOGtV11MDQ9phCXWaPCGcN8%3D%0A&amp;s=928354acc44a7e30013648cb577d4f0024dd7f438334e1fb4c2cd585269940ee"><strong>Ben Franklin Technology Partners of Southeastern PA</strong></a> (BFTP/SEP), and <a href="https://urldefense.proofpoint.com/v1/url?u=http://benfranklintechnologypartnerssep.cmail1.com/t/j-l-thskrl-fdlkyllt-x/&amp;k=irCpHVC7DzKmry2FUFdCpg%3D%3D%0A&amp;r=dLUcRaPLjI7esu7GD9ySY55vchRGRLjXt%2F5K8DPjoz4%3D%0A&amp;m=%2FcRrfIc%2Fiycf3hgMoI4GcOGtV11MDQ9phCXWaPCGcN8%3D%0A&amp;s=46e5a9201c486a3e9b9ab51a0e3d0cd2979d4f774195af30e78811dc7c5522e4"><strong>Greater Philadelphia Alliance for Capital and Technologies </strong></a>(PACT) state that during the past 18 months more than $1B has been invested in Greater Philadelphia companies, and the stage has been set for future growth. Since 2008, the region has had 10 IPOs and over 160 acquisitions worth around $7.5 Billion.</p>\r\n\r\n<p>Recent noteable events in Philly''s entrepreneurial scene:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Keiretsu Forum Mid-Atlantic established its headquarters in Philadelphia and has since grown to include Washington, DC, New York City, and Pittsburgh, PA</p>\r\n	</li>\r\n	<li>\r\n	<p>Early Stage VC,&nbsp;<a href="http://www.firstround.com/" target="_blank" title="First Round Capital ">First Round Capital</a>, moved its headquarters to University City and established the student-run Dorm Room Fund</p>\r\n	</li>\r\n	<li>\r\n	<p>The Philadelphia Industrial Development Corporation has partnered with First Round Capital to create a $6 million public/private venture fund,&nbsp;<a href="http://www.startupphl.com/" target="_blank" title="the Startup PHL Seed Fund">the Startup PHL Seed Fund</a>, to increase the availability of investment capital for Philadelphia-based startups</p>\r\n	</li>\r\n	<li>\r\n	<p>Accelerator <a href="http://www.dreamitventures.com/" target="_blank" title="Dreamit Ventures">Dreamit Ventures</a> has expanded and established its headquarters at the Science Center in University City</p>\r\n	</li>\r\n	<li>\r\n	<p>Dreamit is <a href="http://technical.ly/philly/2013/12/11/dreamit-venures-drexel-excite-center/?utm_source=twitterfeed&amp;utm_medium=twitter&amp;utm_campaign=Feed%3A+TechnicallyPhilly+%28Technically+Philly%29" target="_blank" title="raising a $30 million fund">raising a $30 million fund</a> focused on its growing number of alumni companies</p>\r\n	</li>\r\n	<li>\r\n	<p>Drexel University, a Keiretsu Forum Mid-Atlantic partner, has invested $3 million in the Dreamit fund and is developing the office space being used as the accelerators'' headquarters</p>\r\n	</li>\r\n	<li>\r\n	<p>Drexel has also established the nations first, stand alone <a href="http://www.drexel.edu/close/" target="_blank" title="College of Entrepreneurship ">College of Entrepreneurship&nbsp;</a></p>\r\n	</li>\r\n	<li>\r\n	<p>The University of Pennsylvania''s <a href="http://technical.ly/philly/2013/11/04/penn-medicine-spinout-companies/" target="_blank" title="UPStart Program">UPStart Program</a>, which works with faculty members to build companies around technology developed at the University of Pennsylvania, currently has 56 active companies that have raised over $10 million from investors</p>\r\n	</li>\r\n	<li>\r\n	<p>Philadelphia Magazine profiled the city''s growing entrepreneurial scene in its <a href="http://www.phillymag.com/articles/meet-philly-startups-leading-entrepreneurship-era/" target="_blank" title="October 2013 issue">October 2013 issue</a></p>\r\n	</li>\r\n</ul>\r\n', '', 'full_html'),
('node', 'blog', 0, 63, 63, 'und', 0, '<p><img alt="describe the image" class="alignLeft" src="/sites/default/files/k4-lapelpinfinal3-100px.jpg" style="float:left; height:79px; width:55px" />Although there are some noteable differences between the two, angel and venture capital investing often get lumped together. It can be helpful for angels to keep track of what venture capital firms are doing because many of their investment opportunities overlap. A <a href="http://www.forbes.com/sites/mahendraramsinghani/2013/12/26/venture-capital-2013-recap-oh-what-a-year-it-was/?utm_content=buffer124be&amp;utm_source=buffer&amp;utm_medium=twitter&amp;utm_campaign=Buffer#!" target="_blank" title="report from Silicon Valley Bank ">report from Silicon Valley Bank </a>shows that venture capital firms had a very successful year in 2013. It is much harder to aggregate the data from individual angel investors and complete a comprehensive report of their activity, but Silicon Valley Bank, <a href="https://www.cbinsights.com/" target="_blank" title="CB Insights">CB Insights</a>, and the <a href="http://www.angelresourceinstitute.org/" target="_blank" title="Angel Resource Institute ">Angel Resource Institute </a>produce quarterly reports of angel investing activity in the United States. You can view the most recent reports <a href="http://www.angelresource.org/research/halo-report.aspx" target="_blank" title="here">here</a>. Overall, 2013 was a very good year for investors: the stock market reached record highs, VC firms had the best returns of the last five years, and angel investors continued to see access to great deal flow and have some successful exits. Happy New Year from Keiretsu Forum Mid-Atlantic!</p>\r\n', '', 'full_html'),
('node', 'blog', 0, 64, 64, 'und', 0, '<p>Th<img alt="describe the image" class="alignLeft" id="img-1387558696212" src="/sites/default/files/k4-lapelpinfinal3-100px.jpg" style="float:left; height:60px; width:79px" />e Angel Capital Association is conducting a short,&nbsp;anonymous survey to learn more about current accredited investors in the United States. Please take a minute to fill it out so that they can have accurate information before presenting a proposal to the Securities and Exchange Commission ("SEC"). Take the confidential, 2 minute survey here: <a href="http://angelinsightsurveys.org/surveys/index.php?sid=31783&amp;lang=en" target="_blank" title="http://angelinsightsurveys.org/surveys/index.php?sid=31783&amp;lang=en">http://angelinsightsurveys.org/surveys/index.php?sid=31783&amp;lang=en</a></p>\r\n\r\n<p>Under the Dodd-Frank Act, the SEC must review the standards for what makes an investor "accredited" according to regulation D of the Securities Act of 1933. The Dodd-Frank Act already adjusted the definition of an accredited investor in 2011 when it mandated that individuals can no longer include the value of their primary residence when calculating their net worth. The SEC will now examine whether to increase the 30 year old standards for what makes an individual person an accredited investor. Currently, an individual can qualify as an accredited investor if they are: 1) a natural person who has individual net worth, or joint net worth with the person’s spouse, that exceeds $1 million at the time of the purchase, excluding the value of the primary residence of such person; 2) a natural person with income exceeding $200,000 in each of the two most recent years or joint income with a spouse exceeding $300,000 for those years and a reasonable expectation of the same income level in the current year. [Source:&nbsp;<a href="http://www.sec.gov/answers/accred.htm" target="_blank" title="SEC.gov">SEC.gov</a>]</p>\r\n\r\n<p>Some advocates are trying to raise these standards to account for inflation. One proposal would raise the minimum net worth requirement to $2.5 million and the annual income requirement to $450,000. A study by Angel Capital Association suggests this change would reduce the number of individual accredited investors by as much as <strong>60%</strong>. The SEC will also consider whether to allow individuals who do not meet the wealth requirements, but who have financial or investment expertise (eg. a CPA or CFA certification) to participate in private placements. According to the SEC, about 8.5 million households qualify as accredited investors, but only a very small number participate in private placements for startup and emerging growth companies. Last year, companies raised about $900 billion through private placements, which was nearly 4 times the amount raised through public offerings or "IPOs". These investments were only made by about 234,000 investors.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'full_html'),
