(1, 'node', ' investment opportunities for angel investors in the midatlantic area angel investment opportunities for private investors with global pursuits who we are  keiretsu is the japanese word for a family of affiliated companies that form a tightknit alliance and work toward each other s mutual success consistent with this definition keiretsu forum is a conglomeration of serious investors business leaders venture capitalists corporate institutional investors and serial entrepreneurs bound by two overlapping and codependent goals to work together for each other s mutual benefit forming strategic partnerships enhancing each other s knowledge and building an angel network of diverse skills to access promising angel investment opportunities around the world with nearly 1000 accredited angel investor members dispersed throughout 26 chapters on three continents  keiretsu forum is the world s largest and most successful accredited investor private equity community since keiretsu forum s founding in 2000 its members have invested more than 400 million in 300 different companies from a myriad of industries including software telecommunications health life sciences biotech real estate mobile applications internet consumer products and other high growth areas what we do forum members collaborate in the thorough due diligence phase and angel funding terms process but make individual investment decisions with rounds in the range of 250k 2m keiretsu forum s investment opportunities are strengthened by extensive educational opportunities  stimulating smart angel investing decisions and longlasting strategies along with investing in innovative companies the members of keiretsu forum s angel network are also encouraged to participate in both social activities and charitable opportunities and serve as mentors through our fellowship program  forum members have donated over 2m to date to over 110 nonprofit organizations how we operate keiretsu forum believes that through a holistic approach which includes interlocking relationships with sponsors  partners and key resources it offers an angel network that produces the highest quality deal flow and investment opportunities  keiretsu forum midatlantic chapter keiretsu forum midatlantic formed in 2011 and comprised of the philadelphia dc metro new york and pittsburgh chapters is committed to being one of the most successful and distinguished private equity angel investment organizations in the region our core team of angel investor members sponsors and partners is growing every day strengthening the chapter s knowledge base and working together to access quality investment opportunities around the world how keiretsu forum works management chapters calendar of events fellowship program guest policy code of conduct terms and conditions testimonials   ', 0),
(2, 'node', ' angel investing for smart private investors and driven entrepreneurs collaboration quality deal flow due diligence the equation for angel investing success keiretsu s key components keiretsu forum s angel investing members benefit from collaborative relationships with industry experts who participate via sponsorship or partnership  these organizations include professional services firms colleges and universities incubators commercial real estate firms investment banking institutions and other private investors in angel investment groups venture capital firms and private equity funds these relationships facilitate quality deal flow  providing the capital talent technology expert guidance and resources needed to access promising angel investment opportunities and build prosperous ventures however it is not sufficient to merely provide the resources expertise and exciting new investment opportunities keiretsu forum is dedicated to mitigating the risk of investments as much as possible from prescreening and deal screening entrepreneurs before they are invited to present at a forum meeting to the extensive due diligence phase  the eightstep process application  companies and entrepreneurs who are interested in securing angel funding through keiretsu forum fill out an application  prescreening  applications are prescreened by the appropriate committees who select 710 companies to present at the deal screening deal screening  the deal screening presentations are seven minutes long followed by eight minutes of questions and answers threetofive companies are chosen to present their stories and business plans in front of the full forum presentations  at the keiretsu forum meeting each company makes a 10minute core presentation and then engages attending forum members with 10 minutes of questions and answers interest list  after each entrepreneur presents an interest list is signed by the individual members who are interested in the company discussion  once all the presentations are concluded entrepreneurs are excused and forum members discuss the companies this exchange of opinions is designed to open up investors eyes and minds to thoughts and ideas that had not occurred to them during the presentations due diligence  the early stage or startup company enters into a comprehensive sixweek due diligence phase with the angel investing members who signed the interest sheet at the keiretsu forum meeting it is common for one or two members to take the lead in due diligence and negotiations with the company while the members collaborate in the due diligence process each one makes individual investment decisions multichapter investing  after a company sparks interest from investors in the chapter closest to it geographically it has the unique opportunity to present at other chapters of its choosing broadening exposure to both expert advice and equity capital from forum members members of each chapter conduct their own due diligence sharing their reports with the entire global investment network on k4dealroomcom  this provides yet another collaborative globalreach benefit of angel investing membership with keiretsu forum  how keiretsu forum works  ', 0),
(3, 'node', ' private equity experts who connect angel investors with entrepreneurs your private equity business management experts here to connect you to innovative earnest entrepreneurs introducing howard lubert area president keiretsu forum midatlantic howard lubert is the founder and managing partner senior analyst at safehatch llc a technical due diligence and business acceleration consultancy that supports startup and early stage technology companies safehatch typically takes a senior management role in the portfolio companies it supports and works with them until they are prepared to complete their management teams with fulltime employees business acceleration services are provided for companies in many disciplines but are usually focused in the internet ebusiness security saas infrastructure software elearning mobile or wireless spheres mr lubert dedicated 28 years to formalizing and optimizing the due diligence and deal flow processes for safeguard scientifics and its family of private equity funds as well as other venture capital and angel investment groups lubert was also senior manager at deloitte touche where he played a principal role in the development of the ebusiness consulting practice areas of expertise technical due diligence business acceleration business remediation turnaround introducing vince leusner area vice president keiretsu forum midatlantic vince leusner helps businesses maximize value as a philadelphiabased partner with b2b cfo as the largest cfo firm in the us b2b cfo focuses on emerging and midmarket companies with revenues of up to 75 million that want to increase cash profitability sales and company value mr leusner has 27 years of financial management and financial advisory experience working with publicly traded and privately held entities of all sizes vince has managed advised and consulted with entities in north and south america europe and asia he worked for clients in a vast variety of industries including services media financial services retailing distribution public utilities hospitality manufacturing notforprofit and gaming areas of expertise treasury cash management financial performance processes procedures cost effective internal controls financial management financial reporting budgeting variance analysis introducing jack warnock area vice president keiretsu forum midatlantic a serial entrepreneur early stage company advisor mr warnock joined the k4ma regional management team in january 2014 an accredited investor jack brings extensive exterience in mergers acquisitions joint ventures strategic alliances governance and risk management finance operations management due diligence and succession planning to the k4 network jack was a cpa at arthur andersen cfo at ftp software thinking machines and towers perrin administration solutions m a at verizon bell atlantic office managing partner at tatum business consulting development at smart devine cofounder at jw strategic advisors mcisaac risk solutions and safeguard scientifics bridge tech partners investment banker at wh newbold s and currently serves on the board of directors at c w thomas areas of expertise corporate management development finance operations strategic inititatives university tech transfer market technical due diligence  management lubert  ', 0),
(4, 'node', ' angel investment network philadelphia pittsburgh and metro dc angel investment network for the midatlantic region global investment opportunities at your local convenience keiretsu forum midatlantic established in 2011 consists of chapters in philadelphia metro washington dc pittsburgh and new york keiretsu forum philadelphia  keiretsu forum philadelphia opened in march 2011 and holds its forum meetings at the law offices of woodcock washburn the philadelphia host sponsor the cira center 2929 arch street 12th floor philadelphia pa 19104 google map chapter president chuck carter can be reached at 215 2330342 keiretsu forum dc metro  keiretsu forum dc metro held its first meeting in july 2011 and meets monthly at the offices of its host sponsor cohnreznick 7501 wisconsin avenue suite 400e bethesda md 208146583 google map chapter president richard greene can be reached at 301 2803074 keiretsu forum new york  keiretsu forum new york became a part of the midatlantic region in march 2013 and hold s it s meetings in manhattan at the offices of its host sponsor loeb loeb meetings 345 park avenue new york ny 10154 google map chapter president charles albanese can be reached at 201 8481082 eleanor hass evp of business development can be reached at 212 4215257 keiretsu forum pittsburgh  the pittsburgh chapter joined the midatlantic region in march 2012 it holds monthly forum meetings at the offices of its host sponsor schnader harrison segal lewis llp fifth avenue place 120 fifth ave suite 2700 pittsburgh pa 152223001 google map chapter president malcolm handelsman can be reached at 412 8598008  chapters  ', 0),
(5, 'node', ' angel investment with strong ties to fellowship education angel investment that makes a difference giving students real world knowledge and experience keiretsu forum midatlantic is proud of the quality angel investment opportunities that it provides its angel investor members it s proud of its provision of quality deal flow made possible by an extensive sponsorship network of industry experts its commitment to attracting screening and guiding innovative entrepreneurs and its dedication to methodical due diligence  we re also proud of our due diligence fellowship program  which is the first program of its type to be established initiated in the philadelphia chapter the program recruits local law mba students to engage in the due diligence process this not only helps them fulfill their fellowship requirements but the program also establishes mutually beneficial relationships between the students and keiretsu s investors and entrepreneurs the fellows attend the monthly screening and forum meetings held in philadelphia where they observe the entrepreneurs presentations and participate in the discussions with the chapter s investors the students then indicate which projects interest them and are assigned to a due diligence team led by one of the investors over the next few weeks the students assist with the due diligence process president howard lubert also conducts a workshop to teach the students the rigorous due diligence process that keiretsu forum follows the students also receive continuous training and feedback from the due diligence team members and the chapter leaders throughout the program    fellowship program fellowship program fellowship program  ', 0),
(6, 'node', ' private equity investors future presenters sponsors welcome keiretsu forum midatlantic welcomes encourages its guests from future presenters to private equity investors and potential sponsors guests are welcome and encouraged to attend keiretsu forum philadelphia dc metro and pittsburgh meetings three main rules only those who are invited by a keiretsu forum member or team member are able to attend must complete preregistration before the meeting guests may attend no more than two meetings before applying for membership or submitting a request for their company to present who are our guests  a guest is  a future presenter an active private equity investor and or potential member a potential sponsor or chapter partner we also actively seek out college and university students interested in entrepreneurship  guest etiquette respect  because keiretsu forum midatlantic values everyone s participation and each speaker s time we highly encourage that guests stay for the entire meeting participation  we also encourage mind share discussions on the facilitated topics for mutual edification and expansion of each attendee s personal opinions and ideas devices  to support our meeting objectives please turn off your communication devices they interfere with both the presentations and our sound system nonsolicitation  to ensure a positive experience for all guests may not solicit presenting candidates and or k4 members anyone who violates this policy will be asked to leave the meeting immediately business cards  we are a community of angel investors and innovative entrepreneurs with common passions not a convenient networking group we welcome information exchange in an atmosphere of discovery that builds community and connections but please exercise discretion with business card distribution by waiting until you are asked the details meeting composition  the overall keiretsu forum membership profile consists of 80 secaccredited individual private equity investors 10 venture capital investors who are also accredited individual investors 5  sponsor organizations 5 forum resource members who are first and foremost active accredited investors forum introductions  during the forum meetings there are brief introductions between presentations and all attendees are given an opportunity to participate we suggest that you be prepared to deliver a brief 30second vignette addressing your personal and businessrelated passions and goals we hope to see you at a forum meeting soon reference our calendar of events for one that s convenient for you    guest policy  ', 0),
(7, 'node', ' angel investors must follow this code of conduct code of conduct regarding investments offered at the keiretsu forum establishing respectful business between angel investors entrepreneurs keiretsu forum arranges meetings between entrepreneurs and potential members investors those entrepreneurs may be considering conducting private offerings of their equity in which the member investor may want to consider investing under securities law entrepreneurs conducting private offerings of their securities must observe various requirements including that private offering may not involve any advertising or general solicitation keiretsu forum and entrepreneurs that attend its meetings do not conduct any advertising or general solicitation keiretsu forum members investors that attend meetings and that might want to invest in any entrepreneurs must have demonstrated appropriate qualifications and must agree to the following terms member investor agrees that any invitation to keiretsu forum that a member investor may receive is personal to the member investor and the member investor will not invite anyone else to attend whether in addition to or instead of member investor if you desire to introduce any other potential member investor to keiretsu forum please contact the keiretsu forum in advance member investor understands that member investor may learn of private offerings through the keiretsu forum these private offerings are subject to state and federal securities laws which prohibit among other things the communication or retransmission to anyone of information received by member investor from entrepreneurs through keiretsu forum  such information is for the sole use of member investor and may not be reviewed by or shared with others  to the extent necessary entrepreneurs may separately provide information to member investor and to member investor s legal tax and investment decisions member investor understands that keiretsu forum has not reviewed any information about entrepreneurs that are represented at its meetings member investor will not rely on keiretsu forum for any such review keiretsu forum makes no representations or warranties about any entrepreneur express or implied member investor understands that member investor is solely responsible for member investor s own due diligence investigation of any entrepreneur before deciding to invest in that entrepreneur member investor understands that all negotiations concerning investments including price percentage ownership interest and other terms will take place directly between member investor and entrepreneurs and that keiretsu forum is not acting as an agent or principal or in any other capacity in those negotiations or transactions member investor understands that keiretsu forum is not an investment adviser or underwriter for member investor for any entrepreneur and that keiretsu forum takes no responsibility for the accuracy or completeness of any information about any entrepreneur communicated to member investor by any means or by any person at any time member investor understands that due to sec regulations member investor may not be able to review certain entrepreneurs represented at prior keiretsu forum meetings member investor may also not be able to view certain entrepreneurs until 45 days after keiretsu forum receives this completed and signed questionnaire member investor understands that if the entrepreneur wants member investor to agree to other restrictions on the use of the entrepreneur s confidential information the entrepreneur may require that member investor enter into a separate nondisclosure agreement before providing the confidential information member investor understands that investing in early stage private companies involves extreme risk and should be considered only by members investors that can afford to lose their entire investment member investor understands that keiretsu forum is not a broker dealer and may not sell offer to sell or solicit an offer to buy any security references to keiretsu forum include its us affiliates and agents there is a no solicitation policy for members and guests at keiretsu forum meetings and events and members agree not to use their membership for the purpose of soliciting business to their individual firms member investor should consult member s investor s own attorneys accountants investment advisers and other professional advisers when considering an investment  code conduct code conduct code conduct code conduct code conduct  ', 0),
(8, 'node', ' startups seeking angel funding must consent to these terms terms conditions for presenting entrepreneurs to access angel funding please respect the following agreement with the following terms and conditions is required in order to present at our keiretsu forum member meetings  fees there are no fees to submit an application have your application documents prescreened or to present at our deal screening meetings if invited there is no fee for attendance at k4 entrepreneur workshops should you choose to attend companies selected to present at a keiretsu forum member meeting must pay an administrative fee of 3000 to present to all 4 chapters which includes the video recording of your presentation at the forum meeting and the hosting of the recording along with your deal package on k4dealroomcom  if you are invited into due diligence as a result of your presentation and member interest there may be fees for normal due diligence items such as background checks highlevel legal review of ip etc and you will be advised and will approve these expenses in advance process and procedures if you are selected to present at a keiretsu forum member meeting you agree to provide all necessary presentation material according to the timelines indicated to you use the presentation approved at the deal screening meeting if you enter into a due diligence process with keiretsu forum midatlantic as a result of your presentation at a keiretsu forum member meeting you agree to provide all additional information requested in a timely and complete manner participate in meetings conference calls as requested to respond to angel investor questions respond to terms sheet and or funding agreements in a timely manner angel funding offered if you receive funding as a result of your keiretsu forum midatlantic participation you agree to provide keiretsu forum with a copy of the investment documents terms sheet and any other financial agreements supplied to the angel investors keep us informed of funding events as we track these locally nationally and internationally thank you for adhering to our terms and conditions by doing so you prove that you value keiretsu forum s commitment to quality angel investment opportunities and respectful business relationships    terms and conditions  ', 0),
(9, 'node', ' an angel network built on quality deal flow and strategic partnerships an angel network built on quality deal flow and strategic partnerships founded on respect sponsor testimonial   after spending significant time working with emerging growth companies during my career i immediately recognized the value of importing k4 to washington dc and to allow my firm cozen o connor to act as host sponsor i was intrigued by keiretsu s model because the members collaborate to generate the best deal flow and carry out extensive due diligence this model struck me as something that would be an outstanding advantage in the washington dc angel community incredibly helpful to both investors and entrepreneurs  louis m heidelberger esq member of cozen o connor louis has been honored on a number of occasions for his contributions to the legal profession being named a best lawyer in intellectual property every year since 1999 and a best lawyer in the bay area in intellectual property from 2003 to 2005 he is listed in chambers as a leading lawyer in ip and was named a super lawyer in both washington dc and pennsylvania in 2011 he was elected as member of the cosmos club entrepreneur testimonial   keiretsu forum midatlantic takes a disciplined approach to deal screening indepth due diligence and investing enabling companies to access a large group of sophisticated investors and enabling its members to access prequalified deal flow the enthusiasm savara received has been tremendous and we are delighted at the level of keiretsu forum support as we work to advance our lead program through phase ii clinical development  robert neville chief executive officer of savara pharmaceuticals rob has successfully started and run a number of companies and projects prior to savara rob was founder and ceo of evity inc which he sold to bmc for 100m in 2000 based on his work at evity rob was honored as a finalist in the ernst young entrepreneur of the year award investor testimonial  keiretsu forum midatlantic is unique because their investors are particularly savvy and their due diligence process is extremely rigorous  bernie rudnick member of keiretsu midatlantic with 36 years of experience in executive level strategy finance and management as well as substantial experience investing and guiding investments in entrepreneurial companies bernie has led capital formation totaling over 380m in the past six years and 3b over the last 15 years he is a founding member and chairman emeritus of midatlantic diamond ventures within the fox school of business at temple university fellow testimonial   keiretsu forum midatlantic offers a unique educational opportunity for law students for those of us soon entering into the fields of emerging growth business and corporate law understanding how investors evaluate companies is a critical component to becoming more effective advocates for our clients the investors also find the program beneficial appreciating help with conducting the exhaustive due diligence process  pat bellow esq former keiretsu midatlantic fellow  testimonials  ', 0),
(11, 'node', ' test event 915am to 930am test event desc ', 0),
(12, 'node', ' angel investing 101 everything investors entrepreneurs need to know angel investing 101 power up your knowledge everything investors entrepreneurs need to know knowledge is power in pretty much every aspect of life but especially when it comes to your business and angel investment decisions keiretsu forum makes it easy for you to stay informed and uptodate on everything going on in the world of private equity and startup business development power up your knowledge with the latest news trends and developments in angel investing download free instructional content on topics ranging from angel network selection to choosing the best investment opportunities with the lowest risk finally attend educational courses designed for both private investors and entrepreneurs news articles whitepapers keiretsu forum entrepreneur academy keiretsu forum investor academy  keiretsu entrepreneur and investor academies  ', 0),
(13, 'node', ' your angel network keeps you aware of investment opportunities news your angel network keeps you aware and informed the greatest articles and latest updates in the world of private equity browse through these articles and press releases to get the news and information that directly affects your angel investment decisions and startup business development how software entrepreneurs can be successful presenters to investors angel investing worth the effort by geoff roach what every entrepreneur should know about angel investors the entrepreneur s guide to the keiretsu forum process keiretsu forum midatlantic an inside look at the local angel group that has invested 34m in two years sensible investments the only ones worth making the risks and rewards of investing in foreign companies  news articles article how make successful presentation  ', 0),
(14, 'node', ' private equity angel investing reports available for free download educational content on private equity and angel investing available at your convenience for free download if you re serious about your angel investing and private equity pursuits you want to get your hands on every piece of instructional and educational content available keiretsu forum midatlantic understands your needs so every time we publish a whitepaper or tip sheet on angel investment or startup development this is where it will go seven critical questions to ask when selecting an angel investment group five reasons to consider joining an angel investor network three things you must know about angel investment groups before investing  whitepapers  ', 0),
(15, 'node', ' private investors business experts offer courses on startup planning your private investors offer private instruction courses on startup planning from business experts the keiretsu forum entrepreneur academy was designed by the angel investor members of keiretsu forum to provide firstclass course offerings each course taught by seasoned industry executives focuses on the critical elements of a startup company s business plan academy courses may occur twice a year in person or via webinar and include ceo s roles responsibilities the deal understanding terms and conditions and financing options protecting intellectual property avoiding incorporation formation and compensation pitfalls landmines sales marketing accounting setting up books and financial projections  keiretsu forum entrepreneur academy  ', 0),
(16, 'node', ' private equity investors attend educative sessions on angel investing our private equity investors get private tutoring enroll in the academy get smart about your angel investing the keiretsu forum academy for investors was created in august 2004 by and for our angel investor members to provide quality education and instruction on private equity investing these halfday sessions are held monthly and are of tremendous value to anyone who is serious about investment opportunities previous courses taught at keiretsu forum investor academy include beyond investing investing in oil and gas companies convertible notes and warrants legal aspects of angel due diligence deal structuring micro multinationals a new global startup early stage company valuations negotiating term sheets financial due diligence for angel investors pitfalls of angel investing how to choose a winning management team intellectual property real estate investing 101 investing in china stock ownership value and dilution investing in distressed markets structuring real estate funds  keiretsu forum investor academy  ', 0),
(17, 'node', ' your angel network keeps you aware of investment opportunities press releases keiretsu forum midatlantic in the news an informed investor is a smart investor keiretsu forum midatlantic is keeping busy helping to make its region one of the most active in the angel investing community review our press releases to see our most recent achievements and activities keiretsu forum midatlantic philadelphia chapter announces woodcock washburn as new host sponsor keiretsu forum makes its largest single investment to date in savara pharmaceuticals recent series b keiretsu forum midatlantic announces ceo coaching partnership with courage international business advisors keiretsu forum welcomes new midatlantic chapter president keiretsu forum midatlantic establishes due diligence fellowship program keiretsu forum gives new wings to angel investing in the midatlantic region   ', 0),
(18, 'node', ' angel investor access to global investment opportunities with keiretsu your global investment opportunities await as an angel investor with keiretsu forum midatlantic membership in keiretsu forum midatlantic chapters is by invitation only this invitation is extended to individuals who share keiretsu forum s value for innovation commitment to collaboration enthusiasm for ethics devotion to diligence and spirit for social consciousness the keiretsu forum midatlantic member mantra you value the innovative visions of inspired entrepreneurs you respect their ambition and intend to build relationships with those you help fund fortifying their business pursuits with not only your monetary investment but also your expert guidance you respect your chapter s sponsors partners and fellow angel investors  collaborating to achieve quality diverse investment opportunities around the world when making business decisions  ethics play a crucial role always your reputation as an honest and trusted member of the keiretsu community is of utmost importance to you you take risks but only those that have been thoroughly calculated with extensive due diligence  you have an intrinsic drive to build relationships broaden your perspective and strengthen your social consciousness by participating in social events and charitable activities a keiretsu forum member complies with the legal definition of an accredited investor  as defined in regulation d rule 501 of the securities act of 1933  he or she has also read and signed the keiretsu forum code of conduct  there are two categories of angel investor membership in keiretsu forum midatlantic individual accredited investors which make up 80 of the forum corporate investors accredited venture capital investors and private equity funds which make up about 10 of the forum the remainder of the forum is comprised of 5  sponsor organizations and 5 partners service providers and accredited investor resource members the membership fee for investors is 3000 founding memberships limited to 20 at each chapter may be available at an annual rate of 1500 benefits of membership how to apply ', 0),
(19, 'node', ' angel investing with keiretsu forum the smartest decision you ll make your angel investing benefits with keiretsu forum glorified to a global degree just like your investment opportunities as an active accredited private equity investor and member of keiretsu forum midatlantic you are entitled to the following benefits access to a broad network of innovative entrepreneurs with solid business plans and a deep desire to work with sincere angel investors participation in the extensive screening of these investment opportunities at the monthly deal screening and keiretsu forum meetings opportunity to perform extensive due diligence into the investment opportunities you re interested in pursuing robust relationships with sponsors  experts service providers resource members and thought leaders in the industries that directly affect yours global investment opportunities and collaborative business relationships with private equity investors and entrepreneurs around the world free unlimited online access to due diligence reports of carefully vetted investment opportunities across keiretsu forum s 26 global chapters wide range of charitable activities and social events that strengthen your social consciousness and build reliable trustworthy relationships with fellow business professionals opportunity to serve as a mentor to passionate students through our fellowship program active involvement in the keiretsu forum committee system which is comprised of experts in various professions who provide leadership in screening committees and on due diligence projects note  keiretsu forum midatlantic chapters are not investment funds members make their own individual investment decisions all members agree to abide by the code of conduct of keiretsu forum  potential member benefits membership  ', 0),
(20, 'node', ' global investment opportunities for philadelphia pittsburgh metro dc globalize and maximize your investment opportunities as a member of keiretsu forum midatlantic region if you re interested in becoming a member of keiretsu forum midatlantic in the philadelphia dc metro new york or pittsburgh chapters please complete the form by clicking the button below a representative will respond to your request within 48 hours of your form s submission note  keiretsu forum midatlantic chapters are not investment funds members make their own individual investment decisions all members agree to abide by the code of conduct of keiretsu forum  how apply  ', 0),
(21, 'node', ' business investors providing angel funding for startup companies your business investors are ready to invest is your business ready to grow  the keiretsu forum midatlantic chapters are unique in the k4 chapter family just like the rest of the k4 chapters they offer robust angel funding private equity investors and business acceleration guidance to a b round companies but the philadelphia new york metro washington dc and pittsburgh chapters go a step further offering their services to startup entities that are ready to engage outside mentors supporters and angel investors the private equity landscape of the midatlantic region is heavily populated with early stage and startup companies the k4 midatlantic chapters make it a point to seek out partners who specialize in early stage deals ensuring that our members have access to an exceptional mix of early stage investment opportunities from presenting companies who are we looking for to join our impressive and innovative team of entrepreneurs  serious entrepreneurs with serious plans we are not looking for business plans scribbled on napkins nor are we interested in engaging with an individual who is barely out of the idea phase to clarify what we re looking for we like to reference a fundamental concept from one of the k4 midatlantic s core businesses  safehatch  based on more than 20 years of technical due diligence on thousands of business plans and companies looking for funding  mr lubert  the founder and managing partner of safehatch and area president of the midatlantic region developed the safehatch due diligence model it provides a simple analogy for what you need in a successful business plan the analogy relates your business concept and plan with a threelegged stool the three legs of the stool in order of importance are people plan and technology these legs need not be the same length or girth but they do need to be individually strong enough to hold up the stool the only way this is possible is if the legs are joined and supported by the seat on top which represents the marketplace it is impossible for a business venture to succeed if all of these areas are not addressed is your concept bolstered by strong people a strong plan and strong technology is it supported by the current marketplace if so you re the type of entrepreneur we welcome into our angel investment network please consider applying to present your business concept to keiretsu forum midatlantic  additional details keiretsu members understand that searching for funding can be a daunting process to even the most experienced entrepreneur to get a better understanding of the process we encourage companies interested in presenting to attend a forum meeting at a local chapter prior to applying companies that apply to keiretsu forum are typically in their a or b rounds usually with 500k to 15m friends and family investments forum members invest in highquality diverse investment opportunities in a wealth of industries including automation instrumentation consumer products energy financing food beverage health care life sciences internetrelated real estate services social ventures software telecommunications and any segment with high growth potential selection application process for entrepreneurs paypal account to apply to present your business click the button below  future presenter interested entrepreneurship  ', 0),
(22, 'node', ' angel funding application and presentation guidelines grow your business with angel funding the selection process and application before applying to present we recommend that you 1 read the article on how to make a successful presentation from ed harley chair emeritus of the keiretsu forum software committee and 2 attend a forum meeting at your local k4 midatlantic chapter the eightstep process of selecting companies that present to keiretsu forum includes the following  application  companies and entrepreneurs who are interested in securing angel funding through keiretsu forum fill out an application see below  prescreening  applications are prescreened by the appropriate committees who select 710 companies to present at the deal screening deal screening  the deal screening presentations are twelve minutes long followed by eight minutes of questions and answers three to five companies are chosen to present their stories and business plans in front of the full forum presentations  at the keiretsu forum meeting each company makes a 1012 minute core presentation and then engages attending forum members with 810 minutes of questions and answers interest list  after each entrepreneur presents an interest list is signed by the angel investor members who are interested in the company discussion  once all the presentations are concluded entrepreneurs are excused and forum members discuss the companies this exchange of opinions is designed to open up investors eyes and minds to thoughts and ideas that had not occurred to them during the presentations due diligence  the early stage or startup company enters into a comprehensive sixeight week due diligence phase with the angel investing members who signed the interest sheet at the forum meeting it is common for one or two members to take the lead in due diligence and negotiations with the company while the members collaborate in the due diligence process each one makes individual investment decisions multichapter investing  after a company sparks interest from investors in the chapter closest geographically it has the unique opportunity to present at other chapters of its choosing broadening exposure to both expert advice and equity capital from forum members members of each chapter conduct their own due diligence sharing their reports with the entire global investment network on k4dealroomcom  this provides the globalreach benefit of procuring your angel funding through keiretsu forum fees for presenting entrepreneurs there is never a fee to apply or participate in the keiretsu forum midatlantic screening process if you are invited to participate in our forum meetings there is currently a 3500 administrative fee to help cover the costs of running our meetings and chapters this is the only fee you ll face from keiretsu forum we are not brokerdealers and do not solicit success fees upon funding note  if you are selected by our members for due diligence there are standard charges for background checks dd fellows stipends and legal review fees legal fees for terms sheet reviews and ip overview if appropriate are contingent upon funding confidentiality keiretsu forum chapters do not typically sign nondisclosure agreements therefore executive summaries and other supporting documents submitted to keiretsu forum for consideration will not be treated as confidential  even if marked confidential  please only include information that you are comfortable sharing under these terms to apply to present your business click the button below  selection application process for entrepreneurs  ', 0),
(23, 'node', ' a note on the sec 506 c  a note on the sec 506 c general solicitation ruling       to    entrepreneurs applying for funding  re sec rule 506 c effective 92313   keiretsu forum midatlantic is dedicated to the support of early stage entrepreneurs through education mentoring and investment early stage innovation is the engine of job creation in our economy we welcome entrepreneurs applications for funding and want to explain our policy in regard to companies using general solicitation for accredited investors and our requirement that entrepreneurs issuers use the prescribed principles based methodology pbm to verify our accredited investor members securities and exchange commission sec rule 506 c effective september 23 2013 allows companies to generally advertise or solicit investors this is a major change in the 80 year history of securities law and will impact most early stage companies and their investors the term general solicitation is not precisely defined in sec regulations but has been deemed to include any advertisement article notice or other communication published in any newspaper magazine or similar media or broadcast over television and radio includes internet and any seminar or meeting whose attendees have been invited by any general solicitation advertising if an entrepreneur participates in any such activities including publicly advertised events such as demo days pitch competitions etc general solicitation may be deemed to have occurred in addition we recognize some companies will want to proactively advertise for investors through social media or other general outlets to broaden their access to capital we also recognize that some applicants will assert they are seeking funding under rule 506 b which prohibits the use of general solicitation and allows accredited investors to self certify as has always been done we welcome all applicants but are concerned that even the most quiet of offerings may inadvertently slip into the general advertising category the penalties for failing to meet all requirements of 506 c are extremely onerous and in the worst case could require a deal to be unwound in addition potential rules under consideration by the sec may impose a one year exclusion from raising funds for any company that fails to file in regard to a generally solicited offering an almost certain death sentence for early stage companies the proposed rules would also impose extensive additional requirements on startups many that we believe they will be unable to satisfy as a result we will carefully consider the potential for and consequences of inadvertent general solicitation in any due diligence process we may undertake with such issuers general solicitation comes with significant new requirements for entrepreneurs issuers   issuers must take reasonable steps to verify that all purchasers are accredited investors for definition see  wwwsecgov answers accredhtm   the sec has provided a flexible principles based methodology to make this determination after taking reasonable steps an issuer must reasonably believe the purchaser is accredited and not otherwise have knowledge that he she is not absolute proof is not the standard but issuers must document steps taken to verify the sec also provided four alternative non mandatory non exclusive verification methods these would require the issuer or a third party to verify income or net worth of investors by reviewing detailed financial documentation such as irs tax forms banks statements appraisals and credit reports we believe these methods place unreasonable costly and dangerous burdens on both entrepreneurs and investors and raise untenable privacy cost and complexity concerns   fortunately their use should be unnecessary when dealing with an established angel group  the angel capital association aca of which we are a member has provided guidance on applying the principles based methodology when seeking funding from an established angel group eag such as keiretsu forum midatlantic this guidance is available at  wwwangelcapitalassociationorg data documents public 20policy guidanceoneag090313pdf keiretsu forum midatlantic supports this methodology and we require entrepreneurs seeking funding from our organization to consult with legal counsel to gain assurance that reliance on eag membership will meet the verification test  we recognize these rules are complex but all applicants are also expected to understand and be in compliance with all applicable sec requirements  since our members sponsors and partners are encouraged to bring potential new accredited angel investor members to k4ma forum meetings entrepreneurs will meet potential investors who are not yet members of our organization and who do not qualify under the eag classification these potential investors are not exempt from the disclosure rules under 506 c and issuers are advised to confirm an investor s membership status before accepting funding from any accredited investor and to act accordingly keiretsu forum midatlantic only accepts accredited investors for investment membership our members will not provide personal financial data to companies seeking investment k4ma will provide written confirmation on request that any investing member is in good standing at the time of investment we hope this clarifies our continued interest in early stage investments while maintaining safety and security of sensitive financial information so our members may continue to actively invest if you have additional questions please contact  howard lubert area president  hlubert keiretsuforummidatlanticcom vince leusner area vice president  vleusner keiretsuforummidatlanticcom chuck carter vp entrepreneurial services    ccarter keiretsuforummidatlanticcom   a formal legal opinion may be obtained from any of our legal firm sponsors with active emerging growth practices k4ma is in the process of working with our legal firm sponsors to establish a through yet affordable certification process michael dunnam partner woodcock washburn phl  dunnam woodcockcom lloyd rothenberg partner loeb loeb ny  lrothenberg loebcom lou heidelberger partner cozen o conner ny  lheidelberger cozencom jeff letwin partner schnader harrison pit  jletwin schnadercom   ', 0);
