(24, 'node', ' angel investment group with invaluable sponsorship opportunities an angel investment group that celebrates its sponsors with a sponsorship program that makes a difference tired of sponsorship programs that don t connect you and your business with the right potential clients or customers founded on the principle of forming powerful business connections keiretsu forum midatlantic is here to help solve that pain our membership is comprised entirely of successful investors many of which maintain executivelevel positions in their companies our goal is to match these angel investors with the best possible angel investment opportunities available both locally and globally early stage and startup ventures need a great deal of help and the entrepreneurs who bring their opportunities to keiretsu forum are no different keiretsu forum chapters attract a wealth of sponsor organizations professional services firms colleges and universities incubators commercial real estate firms and other private equity funds angel investment groups and venture capital investors keiretsu forum midatlantic welcomes your expertise resources and experience in return we offer you the opportunity for incredible business development and networking we look for sponsors and partners who bring significant value and a willingness to invest their time in helping both our angel investor members and the presenting entrepreneurs grow and prosper sponsors and professional service organizations from the legal accounting advertising and public relations banking and human resources sectors typically find that there are great business opportunities in participating and partnering with a keiretsu forum chapter benefits of becoming a sponsor meet our sponsors to apply to be a sponsor click the button below ', 0),
