(27, 'node', ' advantages for angel investors in keiretsu forum midatlantic chapters the keiretsu advantage for angel investors innovative entrepreneurs keiretsu forum goes above and beyond the role of an ordinary angel investment network by providing quality deal flow vetted global investment opportunities charitable and social stimulation educational resources collaboration with private equity funds throughout north america and an unwavering commitment to honorable business practices our angel investors and the innovative entrepreneurs who inspire their investments are generously taken care of browse the following pages to get an idea of what the keiretsu advantage is all about investment cultivation smart money due diligence program global investment network k4dealroomcom more opportunities better investments sponsors ', 0),
(28, 'node', ' investment opportunities made possible by investment cultivation your return on investment is cultivated by keiretsu investment opportunities vetted elevated with your success in mind the quality of your angel investing pursuits is directly dependent upon the quality of the investments available to you to ensure you re getting the highest quality deal flow and return on investment keiretsu forum midatlantic s growthoriented angel funding philosophy is driven and supported by our unique investment cultivation process the entrepreneurs who are chosen to present at our forum meetings must pass through two scrubbing and screening processes first an initial prescreening and second the more indepth deal screening during these vetting phases appropriate industry experts meticulously assess the quality of prospective presenters business plans and stability of their concepts if their businesses are deemed worthy of investment traction these driven entrepreneurs are provided with strategic coaching and guidance on presentation best practices not only are we assisting these startup and entrylevel businesses through this rigorous process but we re also ensuring that our angel investors are presented with the best possible investment opportunities after the initial presentation this cultivation process continues with indepth due diligence reporting  legal assistance with investment setup ongoing mentoring services and exit strategy design  promising angel investment opportunities attracting screening and guiding investment opportunities investment cultivation investment cultivation  ', 0),
(29, 'node', ' startup investors take due diligence seriously startup investors are smart about their money taking investment opportunities due diligence seriously when you and your fellow angel investor members discover opportunities you d like to pursue you collaborate on a comprehensive sixweek due diligence review this indepth memberdriven research effort ensures that you have the knowledge and resources necessary to make the most informed and educated investment decisions possible the due diligence report is published and shared with members from all 26 chapters on three continents   via k4dealroomcom  the due diligence report also dictates the terms of the deal between investors and entrepreneurs guaranteeing that all details facts and figures are clear and agreed upon by both parties this sets the foundation for a strong angel investment relationship based on trust and solidarity  extensive due diligence phase sixweek due diligence phase methodical due diligence due diligence process extensive due diligence sixeight week due diligence phase smart money due diligence program due diligence reporting smart money due diligence thorough due diligence  ', 0),
