(31, 'node', ' angel network without borders keiretsu forum s global reach your angel network without borders global investment opportunities brought to you online as an angel investor member of keiretsu forum s global investment network  you have admission to k4dealroomcom  this gives you free and unlimited online access to due diligence reports and investment opportunities from 26 keiretsu chapters across three continents keiretsu forum brings global investment opportunities and international expertise to your local accessibility additionally you re given convenient insight into quality investment opportunities even if you don t attend meetings or presentations in person this online angel investment portal also offers entrepreneurs the opportunity to share their presentations with keiretsu s entire global investment network greatly enhancing and diversifying their options for angel funding procurement  k4dealroomcom k4dealroomcom carefully vetted investment opportunities k4dealroomcom k4dealroomcom via k4dealroomcom  ', 0),
