(41, 'node', ' angel capital expo keiretsu forum midatlantic angel capital expo sm   october 23 2013  hosted by keiretsu forum midatlantic and drexel university   the premier gathering of the angel capital community sm accredited angel investors venture capital principals private family wealth professionals and other members of the private equity community are cordially invited to join us at the 14th angel capital expo the first on the east coast on wednesday october 23 2013 the expo is keiretsu forum s signature event bringing together investors and entrepreneurs looking for funding register to attend   expo  wednesday october 23 2013 715am to 630pm  drexel university bossone building 32nd market streets philadelphia pa attendees   angel capital expo is the premier gathering of the angel capital community and was created to foster collaboration among angel groups as well as reach out to the larger investment community attendees include over 100 angel investors if you would like to attend please register online  for more information contact chuck carter philadelphia chapter president at ccarter keiretsuforummidatlanticcom or call 1 215 2330342 invitation is extended to accredited investors only  presenters angel capital expo features 12 highquality diverse investment opportunities in technology healthcare life sciences consumer products energy green tech real estate and other high growth investment silos companies that apply to keiretsu forum are typically in their a or b rounds having already secured initial funding of 250k to 1 million from founders friends family and individual angels to apply to present at the angel capital expo please complete the online application and contact chuck carter vp of entrepreneur services at ccarter keiretsuforummidatlanticcom or call 1 215 2330342  make sure to select the midatlantic region on your application to be considered for this opportunity  keiretsu forum is a global angel investment network and welcomes submissions from international companies all presenters will be prescreened by a select committee of keiretsu forum members and due diligence fellows presentation coaching will be provided to companies selected to present each entrepreneur will make an onstage presentation and will be available for additional discussion and due diligence at their exhibitor booth throughout the day following the presentations the attendees will vote and award the top three presenting companies the most valued company award agenda please see the schedule of events   ', 0),
