(43, 'node', ' angel capital expo sponsor opportunities angel capital expo sm sponsor opportunities   sponsorship opportunities  download the angel capital expo sponsorship form here   wednesday october 23 2013 715am to 630pm  drexel university bossone building   32nd and market streets philadelphia pa keiretsu forum is the world s largest private equity angel investment network with more than 900 accredited investors in 27 chapters on 3 continents who have invested more than 400m in early stage opportunities  the keiretsu forum midatlantic region angel capital expo ace will showcase 12 highquality diverse investment opportunities from technology healthcare life sciences consumer products energy green tech real estate and other high growth investment silos the event will be open to angel investors private and family wealth managers and venture capital firms and promises to attract 100150 of the top investors in the region there will be representatives from many of the west coast and international keiretsu forum chapters in attendance as well the inclusion of the second israeli innovation showcase into the ace program should generate significant attendance among investors keen on israel dealflow sponsorship opportunities include underwriting of event modules if you would like to become an angel capital expo sponsor please fill out our sponsorship form  there are a limited number of sponsorship opportunities at the angel capital expo for professional organizations interested in exposure to this audience please contact howard lubert area president at hlubert keirestuforummidatlanticcom or call 610 9714067 keiretsu forum midatlantic k4ma was founded in philadelphia in march 2011 and has since expanded into the washington dc pittsburgh and new york areas k4ma is part of the keiretsu forum global angel investment network  ', 0),
(45, 'node', ' contact your angel investment network contact your angel investment network we ll get back to you as soon as possible fill out the form below choosing the appropriate category of your request in the subject line dropdown menu a representative of keiretsu forum midatlantic will respond to your request as soon as possible thank you for your interest subject select request for membership as an investor request to present as an entrepreneur seeking angel funding request to become a sponsor enroll in investor academy enroll in entrepreneur academy general inquiry first name last name email we will keep your email completely private address city state zip work phone cell phone please contact me via none email only email or phone call me at work call my cell call work or cell best contact time select am pm message  fill out application contact keiretsu forum midatlantic  ', 0),
