(47, 'node', ' sensible investments the only ones worth making sensible investments the only ones worth making insight into keiretsu s dedication to due diligence as an investor you must be comfortable with taking a certain amount of risk to access rewarding opportunities as a smart investor you reduce this risk with strict adherence to due diligence this investigative phase consists of methodical steps to assess each opportunity steps that are enhanced with your industry expertise you know what to look for in a business plan and how to differentiate between grounded innovation and unfounded ideas the result is a comprehensive report that determines the potential for a reliable return on your investment members of keiretsu forum midatlantic k4ma have the opportunity to work among the smartest and most experienced investors professionals who are passionate about wellinformed investment opportunities and therefore dedicated to meticulous due diligence procedures to provide some insight into this dedication to reducing risk we have outlined a few frequently asked questions about keiretsu forum s due diligence program who conducts due diligence  as a member of keiretsu forum midatlantic you work with fellow members and our due diligence fellows to perform due diligence for each investment opportunity that garners enough interest by our members to move forward the typical due diligence team is assembled within two weeks of the company s presentation at our forum meetings and we strive to complete the process in six to eight weeks while all interested members cooperate and collaborate to perform a comprehensive investigation each member is responsible for making his or her own investment decisions  how do i evaluate a company  keiretsu forum offers stepbystep guidance on how to properly perform due diligence and offers a halfday due diligence class every quarter these instructions are particularly valuable to investors who are new to our due diligence process but it s also an excellent idea for anyone who has questions or needs refreshed instruction for information on our next due diligence training session  contact howard lubert   what elements of the business should i focus on  while every business is unique and each due diligence process is different there are some general procedures to follow each due diligence process should review the company s articles of incorporation financial situation and both physical and intellectual assets of the company this gives you insight into the legitimacy of the business and its ability to make a return on investment for you for a more detailed list of what s investigated during the keiretsu forum due diligence process  contact howard lubert to join our next training session  how else does keiretsu forum s due diligence process benefit me  as a keiretsu midatlantic member you gain access to k4dealroomcom from this website members from around the world can analyze the due diligence reports for business deals presented to other chapters this gives you access to investment opportunities and reports of the thorough investigation that went into ensuring their legitimacy around the globe when it comes to due diligence there is a thin yet crucial line between a thorough investigation and an exhaustive intrusive dissection this latter strategy often offends the entrepreneur and creates a wall of distrust hindering any chance for partnership this is why k4ma has taken every step possible to refine our due diligence process we re proud of our investors ability to reduce the risk of their angel investments while at the same time laying down foundations for strong trusting relationships with potential partners if you re interested in joining keiretsu forum midatlantic and merging your industry expertise with that of our experienced and dedicated investors contact howard lubert at hlubert keiretsuforummidatlanticcom or 6079714067  sensible investments the only ones worth making  ', 0),
(48, 'node', ' foreign investments highrisk or highreward  the risks and rewards of investing in foreign companies with great risk comes great reward and vice versa investing in international entrepreneurs is a unique opportunity to expand your investment endeavors to the global spectrum it presents the possibility to penetrate markets that you have not yet explored and experience cultures different from your own but does it expand your return on investment which has more weight the risk or the reward  the rewards the three main reasons people invest in foreign companies are as follows  portfolio fortification business happens all over the world so it goes without saying that the potential for investment opportunities is also global expanding your investments into foreign economies allows you to explore emerging markets that have yet to reach their potential such as those in eastern europe and the pacific rim israel a stronghold of entrepreneurial spirit and technological innovation is an especially desirable market for investors often referred to as the startup nation foreign investments are especially advantageous at times when the us markets and economy aren t prime for investing portfolio diversification exposing your portfolio to both foreign and domestic stocks diversifies your investments reducing your risk by spreading it out over a wider geographic area and into multiple economies and markets personal interest some investors seek entrepreneurs from countries in which they have emotional familial or religious attachments they see these investments as ways to help the countries economies grow because the successes of startup companies lead to greater employment and revenues of course the attachment to the country is paired with an expectation of significant roi  diversifying internationally is one way for investors to avoid effectively betting solely on the us   gregg fisher  founder president and cio of investment management and advisory firm gerstein fisher the risks the reality is that there is always an element of risk when investing whether you invest solely in domestic companies or you branch out to foreign opportunities however one must be aware of three risks that are specific to international investments political economic and cultural events investing internationally exposes your capital to environments that vary in political and economic stability especially the emerging markets of less developed countries these markets may fall sharply or rise dramatically frustrating investors who rely on timing markets these markets operate with different procedures than the domestic ones you re familiar with cultural forces which you may not be aware of can dramatically impact the market legal issues with your money in the hands of a foreign company it is subject to legal entanglement between the company s home country and the us if you end up needing to take legal action the issue may not be resolved as cleanly as it would be in the us with a domestic company if you take the lawsuit against a foreign company inside the us and win there s a good chance you won t even collect on the settlement because of jurisdiction issues in most cases the lawsuit would have to be resolved in the company s home country currency fluctuations the value of your capital is subject to currency exchange rates and therefore the return you see is dependent on how strong or weak the dollar is in comparison to the foreign market s currency this may or may not work to your advantage if the dollar weakens your return is higher but if the dollar grows stronger your return may be lower than expected with great risk often comes great reward but a smart investor who has the ability to tap into expertise and resources offered by keiretsu forum knows how to balance the riskreward equation and diversify his portfolio with caution and thorough due diligence  to diversify your portfolio with investment prudence  contact keiretsu forum midatlantic or call 6079714067 to speak to howard lubert  the risks and rewards investing foreign companies  ', 0),
(49, 'node', ' selecting an angel group seven critical questions to ask seven critical questions to ask when selecting an angel investment group download your free report an angel group plays an integral role in nurturing your developing business from providing you with the resources necessary to grow your business to securing much needed venture capital angel investors offer you the tools your company needs to succeed but how do you select the angel investment group that s right for you enter your email address in the field below and we ll send you seven critical questions to ask when selecting an angel investment group  an informative free report detailing the most important questions you need to ask when determining the angel group that best fits your company s needs  seven critical questions ask when selecting angel investment group  ', 0),
