(55, 'node', ' keiretsu forum publishes its due diligence handbook sa n francisco ca marketwired via comtex keiretsu forum announces the publishing of its due diligence handbook in the apple ibook store as a free resource for angel investors and entrepreneurs as the world s largest private equity angel investment network keiretsu forum provides a leading voice in developing best practices in conducting due diligence the due diligence handbook outlines the investment group s due diligence process and provides useful resources that support angel investors in their process of evaluating potential investments randy williams founder ceo of keiretsu forum announced the publishing of keiretsu forum s due diligence handbook on may 1 2014 in front of an audience of over 500 angel investors at keiretsu forum s 18th biannual angel capital expo held at microsoft in mountain view up until now the due diligence handbook was only made available to keiretsu forum s 1100 members in its 30 chapters around the world now keiretsu forum is offering this resource to the world free of charge in order to increase communication and collaboration among all angel investors everywhere said williams the handbook can be downloaded via the apple ibook store for ipads and apple computers and will soon be available in the apple ibook store for iphones via google play kobo and scribd and for the kindle and nook a similar version can be downloaded as a pdf at the keiretsu forum web site a cohesive due diligence process in a group setting gives both investors and entrepreneurs the opportunity to benefit from the diverse experience of multiple investors this handbook was designed to guide investors through the most important part of the process conducting a rigorous examination of the many factors that may affect future outcomes said michael gralnick chairman of keiretsu forum s due diligence committee angel investor network due diligence angel investment network keiretsu forum keiretsu forum midatlantic ', 0);
