(56, 'node', ' what startups should know before pitching to keiretsu forum the uc kiz funder s fair at the quorum in philly was a great chance to see what investor groups are currently looking to fund twelve representatives from local angel and venture capital companies did presentations on what they are looking to invest in there was a lot of good advice for startups that are looking to go this route below is a summary of what keiretsu forum midatlantic investors said they are looking for in a startup keiretsu forum midatlantic is an angel group that functions like a fund we focus on high tech clean green tech consumer products and life sciences average funding amount our sweet spot is a b round investment opportunities in the 250k to 3m range we have done a 62m series b round we have had one member write an investment check for 1m our members typically invest 2550k in 38 deals year we create single purpose llcs for smaller investments advice for companies interested in funding from keiretsu forum midatlantic we are womb to tomb investors from application to liquidity event and we expect our portfolio companies to be led by professionals who are both invested 110 and passionate about what they are doing we do not suffer fools lightly be sure you know your stuff before you engage with us  angel investment groups accredited investor angel funding series a funding keiretsu forum midatlantic ', 0),
(57, 'node', ' keiretsu forum and pensco announce partnership to allow angel investors ability to invest in private equity using retirement account funds keiretsu forum  the world s largest private equity angel investment network and pensco trust company a leading alternative asset custodian announce today a partnership that will allow keiretsu forum s angel investor members access to pensco s custodial services to invest in private equity deals using retirement fundskeiretsu forum and pensco announce partnership to allow angel investors ability to invest in private equity using retirement account funds we look forward to working with pensco to continue to add value to our angel investor members said randy williams  founder ceo of keiretsu forum i believe our members are looking for this kind of opportunity to use their retirement dollars to fund startups they believe in and pensco as a leader in the selfdirected ira business is ready to serve this growing market many investors are unaware that they can use money from selfdirected iras to invest in private equity private stock and real estate said kelly rodriques  ceo of pensco we think this partnership with keiretsu will give more angel investors the ability to pursue their passion for investing in emerging businesses while diversifying their retirement funds beyond the typical stock market investments private equity includes investments in privately held companies and private equity funds as well as hedge funds limited liability partnerships llps and limited liability corporations llcs according to pensco private equity is the fastestgrowing investment held by its clients in selfdirected iras followed by real estate unsecured notes secured notes and precious metals keiretsu forum and pensco will hold an educational webinar on thursday april 3 2014 from 100 pm to 145 pm pdt on demystifying the angel investment process accredited investors interested in attending the webinar can register on this link  about keiretsu forum  keiretsu forum was founded in 2000 by randy williams in the san francisco bay area with 29 chapters and over 1100 accredited investor members keiretsu forum is the world s largest inviteonly angel investor network keiretsu forum members provide early stage capital in the range of 250k 2 million in high quality diverse investment opportunities and collaborate in the duediligence but make their own individual investment decisions through the keiretsu forum more than 400 million of capital has been invested into technology consumer products internet healthcare life sciences and real estate companies for more information visit wwwkeiretsuforumcom  about pensco  pensco trust company has been helping investors use their retirement account funds to invest in real estate private equity and other nonexchange traded assets since 1989 as the industry s premier selfdirected ira custodian we know exactly what it takes to buy hold and sell alternative assets in retirement accounts as the trusted custodian of over 10 billion in assets pensco works with over 50000 clients across the us to learn more visit wwwpenscocom or call 866 8184472 keiretsu forum is a facilitator bringing together investors and early stage companies offering generally highrisk investments keiretsu forum is not affiliated with the presenting companies and does not endorse invest in assist with investment in or recommend any of the companies or the securities of such companies that may seek funding through keiretsu forum members and receives no success fees or other compensation for any funding that may occur although keiretsu forum members and or volunteers may have an economic interest or affiliation with presenting companies which keiretsu forum requires they disclose accordingly any information or representations given or made by any presenting companies must not be relied upon as having been reviewed for accuracy or authorized by keiretsu forum any offers to or investments made by a member of keiretsu forum will be to or in his her or its individual capacity and not on behalf of keiretsu forum consequently investors must conduct their own due diligence in connection with any investment in companies including but not limited to legal tax and investment advice pensco trust company performs the duties of an independent retirement custodian and as such does not provide investment advice sell investments or offer any tax or legal advice potential clients are advised to perform their own due diligence in choosing an attorney tax advisor or any investment opportunity alternative investments are not fdic insured and are subject to risk including loss of principal accredited investor keiretsu forum angel investment opportunities keiretsu forum midatlantic pensco ', 0),
(58, 'node', ' keiretsu forum announces angel capital expo on may 1st in october keiretsu forum midatlantic hosted the first ever east coast angel capital expo at drexel university the event was a huge success and brought together more than 150 accredited investors and 12 early stage companies on may 1st the west coast chapters of keiretsu forum will host their own angel capital expo in san francisco san francisco ca marketwired 30614 keiretsu forum the world s largest private equity angel investment network announces its 18th biannual angel capital expo on thursday may 1st 2014 from 730 am to 330 pm at microsoft 1065 la avenida street in mountain view california angel capital expo is the premier gathering of angel investors and entrepreneurs seeking funding capital to grow their businesses on may 1st more than 300 of the bay area s most active and respected angel investors will attend the expo view video from the november 21st 2013 angel capital expo  our angel capital expo provides a unique opportunity for collective collaboration in the world of angel investing said randy williams founder and ceo of keiretsu forum we are proud to play a seminal role in the growth of startup businesses and job creation at a local national and international level angel capital expo will feature a dozen presentations from early stage companies in technology life sciences consumer products real estate financial services social ventures and other segments with high growth potential all presenters will be prescreened by a select committee of keiretsu forum members each entrepreneur will make a 15minute presentation and will be available for additional discussion and due diligence at their exhibitor booth throughout the day following the presentations the attendees will vote and award the top three presenting companies the most valued company award apply to present companies interested in presenting at the may 1st 2014 angel capital expo should contact jenny pater associate for entrepreneur services at jpater keiretsuforumcom or call 1 415 5730752 online application is available at http bitly expoapp  register to attend hosted by keiretsu forum the angel capital expo is the premier gathering of the angel capital community invitation to attend is extended only to accredited investors  online registration is available at http may1angelexpoeventbritecom  for more information contact sonja markova managing director at sonja keiretsuforumcom or call 1 415 5730751 about keiretsu forum keiretsu forum was founded in 2000 by randy williams the san francisco bay area with 29 chapters and over 1100 accredited investor members keiretsu forum is the world s largest inviteonly angel investor network keiretsu forum members provide early stage capital in the range of 250k 2 million in high quality diverse investment opportunities and collaborate in the duediligence but make their own individual investment decisions through the keiretsu forum more than 400 million of capital has been invested into technology consumer products internet healthcare life sciences and real estate companies for more information visit wwwkeiretsuforumcom  accredited investor keiretsu forum angel funding angel capital expo ', 0),
(59, 'node', ' keiretsu forum to cohost west chester university business idea contest keiretsu forum midatlantic is proud to cohost the west chester university business idea competition  sponsored by chester county score and cohosted by the dr edwin cottrell entrepreneurial leadership center and the keiretsu forum midatlantic the competition promotes creativity and idea generation at west chester university and chester county by recognizing innovative ideas for new products services and technology the contest is open to west chester university undergraduate and graduate students and alumni and score chester county clients are eligible and encouraged to compete the goals of the competition are to foster idea generation and to facilitate commercialization of business ideas organizers say prizes include cash and coaching services to enter submit ideas at wcubizideas2014istartorg by 4 pm thursday march 27 the ideas will be reviewed by business investors and experts the most promising ideas will be selected as semifinalists and presented at the 2014 business idea pitch on april 23 investors from the keiretsu forum midatlantic and business experts will select the top three ideas pitched click here for more information west chester univeristy is a partner of keiretsu forum midatlantic startup businesses entrepreneurs accredited investor keiretsu forum midatlantic west chester university ', 0),
(60, 'node', ' rescheduled due diligence training session due to the winter storm last month the due diligence training session has been rescheduled for wednesday february 12th after the screening meeting in philadelphia midatlantic president howard lubert will explain keiretsu s rigorous due diligence process and answer questions about how to properly put together a final report all members who have not yet had the training are encouraged to attend  the new group of  due diligence fellows will receive training as well contact info keiretsuforummidatlanticcom if you would like to attend the workshop will take place at the law office of bakerhostetler formerly woodcock washburn in the cira center same location as the meeting the training will run from 1230330 approximately and lunch will be provided the session will also be broadcast online to members who request access  ', 0),
(61, 'node', ' january forum meeting and due diligence training session keiretsu forum midatlantic k4ma with chapters in philadelphia washington dc pittsburgh and new york and part of the global keiretsu forum angel network will present five earlystage companies to investors at next week s monthly forum event the meeting will showcase two technology companies one life science company one consumer company and one cleangreen energy technology company at meetings in new york philadelphia washington dc and pittsburgh attendance is by invitation only more than 100 accredited investors will see the same companies present their business investment opportunities in new york on tuesday january 21 in philadelphia on wednesday january 22 in washington dc on thursday january 23 and in pittsburgh on friday january 24 two of the k4ma cities are among the five top metropolitan regions for life sciences venture funding according to recent data from the pricewaterhousecoopers llp national venture capital association moneytree report based on data from thomson reuters venture capitalists invested 14 billion in 167 life sciences deals during the first quarter of 2013 new york was one of three of the five regions that saw doubledigit increases in investing in q1 2013 increasing 66 percent while the washington dc metro area grew 53 percent the top five metropolitan regions that received life sciences venture capital funding during q1 2013 included the san francisco bay at 427 million boston at 273 million the san diego metro at 122 million the new york metro at 106 million and the washington metroplex at 100 million these top five regions captured 74 percent of the dollars invested in life sciences companies in the first quarter of 2013 biotechnology companies accounted for 68 percent of the dollars invested in life sciences deals in the top five metro regions due diligence training session after the philadelphia forum meeting on wednesday january 22nd the k4ma management team will run a due diligence workshop for new members and due diligence fellows  chapter president howard lubert will explain keiretsu s rigorous due diligence process and answer questions about how to properly put together a final report all members who have not yet had the training are encouraged to attend  contact info keiretsuforummidatlanticcom if you would like to attend the workshop will take place at the law offices of bakerhostetler formerly woodcock washburn in the cira center same location as the meeting due to the new sec 506 c ruling made in september 2013 keiretsu forum cannot disclose the names of the companies that will be presented at these events until after funding is received angel investment groups accredited investor due diligence angel investment keiretsu forum midatlantic ', 0),
(62, 'node', ' the expansion of philadelphia s entrepreneurial ecosystem silicon valley austin tx boston ma new york city when people mention startup hubs these are the cities that typically come to mind for years aspiring entrepreneurs flocked to these areas if they wanted to start or grow a business however over the past few years philadelphia has quietly built a very strong entrepreneurial ecosystem while the rest of the nation generally saw declines in the number of venture capital dollars and deals last year philadelphia saw a 17 increase in the number of financing deals in a joint report entitled venture impact   ernst young llp  earlystage investor ben franklin technology partners of southeastern pa  bftp sep and greater philadelphia alliance for capital and technologies  pact state that during the past 18 months more than 1b has been invested in greater philadelphia companies and the stage has been set for future growth since 2008 the region has had 10 ipos and over 160 acquisitions worth around 75 billion recent noteable events in philly s entrepreneurial scene keiretsu forum midatlantic established its headquarters in philadelphia and has since grown to include washington dc new york city and pittsburgh pa early stage vc  first round capital  moved its headquarters to university city and established the studentrun dorm room fund the philadelphia industrial development corporation has partnered with first round capital to create a 6 million public private venture fund  the startup phl seed fund  to increase the availability of investment capital for philadelphiabased startups accelerator dreamit ventures has expanded and established its headquarters at the science center in university city dreamit is raising a 30 million fund focused on its growing number of alumni companies drexel university a keiretsu forum midatlantic partner has invested 3 million in the dreamit fund and is developing the office space being used as the accelerators headquarters drexel has also established the nations first stand alone college of entrepreneurship  the university of pennsylvania s upstart program  which works with faculty members to build companies around technology developed at the university of pennsylvania currently has 56 active companies that have raised over 10 million from investors philadelphia magazine profiled the city s growing entrepreneurial scene in its october 2013 issue startup businesses seed money drexel university keiretsu forum midatlantic philadelphia startups penn upstart ', 0),
(63, 'node', ' 2013 investment trends although there are some noteable differences between the two angel and venture capital investing often get lumped together it can be helpful for angels to keep track of what venture capital firms are doing because many of their investment opportunities overlap a report from silicon valley bank shows that venture capital firms had a very successful year in 2013 it is much harder to aggregate the data from individual angel investors and complete a comprehensive report of their activity but silicon valley bank  cb insights  and the angel resource institute produce quarterly reports of angel investing activity in the united states you can view the most recent reports here  overall 2013 was a very good year for investors the stock market reached record highs vc firms had the best returns of the last five years and angel investors continued to see access to great deal flow and have some successful exits happy new year from keiretsu forum midatlantic  accredited investor angel investments keiretsu forum angel investment opportunities keiretsu forum midatlantic ', 0),
(64, 'node', ' help the sec define the new accredited investor standards th e angel capital association is conducting a short anonymous survey to learn more about current accredited investors in the united states please take a minute to fill it out so that they can have accurate information before presenting a proposal to the securities and exchange commission sec take the confidential 2 minute survey here  http angelinsightsurveysorg surveys indexphp sid 31783 lang en under the doddfrank act the sec must review the standards for what makes an investor accredited according to regulation d of the securities act of 1933 the doddfrank act already adjusted the definition of an accredited investor in 2011 when it mandated that individuals can no longer include the value of their primary residence when calculating their net worth the sec will now examine whether to increase the 30 year old standards for what makes an individual person an accredited investor currently an individual can qualify as an accredited investor if they are 1 a natural person who has individual net worth or joint net worth with the person s spouse that exceeds 1 million at the time of the purchase excluding the value of the primary residence of such person 2 a natural person with income exceeding 200000 in each of the two most recent years or joint income with a spouse exceeding 300000 for those years and a reasonable expectation of the same income level in the current year source  secgov  some advocates are trying to raise these standards to account for inflation one proposal would raise the minimum net worth requirement to 25 million and the annual income requirement to 450000 a study by angel capital association suggests this change would reduce the number of individual accredited investors by as much as 60   the sec will also consider whether to allow individuals who do not meet the wealth requirements but who have financial or investment expertise eg a cpa or cfa certification to participate in private placements according to the sec about 85 million households qualify as accredited investors but only a very small number participate in private placements for startup and emerging growth companies last year companies raised about 900 billion through private placements which was nearly 4 times the amount raised through public offerings or ipos these investments were only made by about 234000 investors  accredited investor jobs act sec requirements angel funding doddfrank act ', 0),
